INSERT INTO `problem` VALUES (100,'demo test','<p>Calculate a + b.</p>','<p>&nbsp;</p>\n<p class=\"p1\">Two integers a and b, separated by a space. (0&lt;=a,b&lt;=9).</p>','<p>&nbsp;</p>\n<p class=\"p1\">The sum of a and b in the first line.</p>','5 7','12','0','<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">Your program should always read from stdin(Standard Input), and write to stdout(Standard Output). Solutions to this problem can be as follows:</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">C:</p>\n<p class=\"p1\">#include</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">int main() {</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;int a, b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;scanf(\"%d%d\", &amp;a, &amp;b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;printf(\"%d\\n\", a + b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;return 0;</p>\n<p class=\"p1\">}</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">C++:</p>\n<p class=\"p1\">#include</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">using namespace std;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">int main() {</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;int a, b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;cin &gt;&gt; a &gt;&gt; b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;cout &lt;&lt; a + b &lt;&lt; endl;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;return 0;</p>\n<p class=\"p1\">}</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">Pascal:</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">var</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;a, b: Integer;</p>\n<p class=\"p1\">begin</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;readln(a, b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;writeln(a + b);</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">end.</p>','','2016-06-19 15:39:27',1,10,'N',99,391,0),(1001,'isPrime(maxK-minK)','<p>&nbsp; &nbsp; 给定一个长度为N(0&lt;n&lt;=10000)的序列，保证每一个序列中的数字a[i]是小于maxlongint的非负整数 ，编程要求求出整个序列中第k大的数字减去第k小的数字的值m，并判断m是否为质数。(0&lt;k&lt;=n)</p>','<p>输入格式：</p>\n<p>第一行为2个数n，k（含义如上题）</p>\n<p>第二行为n个数，表示这个序列</p>','<p>输出格式：</p>\n<p>如果m为质数则</p>\n<p>第一行为\'YES\'(没有引号）</p>\n<p>第二行为这个数m</p>\n<p>否则&nbsp;</p>\n<p>第一行为\'NO\'</p>\n<p>第二行为这个数m</p>','5 2\n1 2 3 4 5','YES\n2','0','<p>对于第K大的详细解释:</p>\n<p>如果一个序列为1 2 2 2 2 3</p>\n<p>第1大 为3</p>\n<p>第2大 为2</p>\n<p>第3大 为2</p>\n<p>第4大 为2</p>\n<p>第5大 为1</p>\n<p>第K小与上例相反</p>\n<p>&nbsp;</p>\n<p>另外需要注意的是</p>\n<p>最小的质数是2,如果小于2的话,请直接输出NO</p>','','2016-06-30 19:20:25',5,10,'Y',NULL,0,0),(10,'小熊的购物单','<p><span style=\"color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; font-size: 13px; line-height: 26px; text-indent: 26px; background-color: rgba(255, 255, 255, 0.65098);\">小熊今天很开心，家里购置的新房就要领钥匙了，新房里有一间他自己专用的很宽敞的房间。更让他高兴的是，妈妈昨天对他说：&ldquo;你的房间需要购买哪些物品，怎么布置，你说了算，只要不超过N 元钱就行&rdquo;。今天一早金明就开始做预算，但是他想买的东西太多了，肯定会超过妈妈限定的N 元。于是，他把每件物品规定了一个重要度，分为5 等：用整数1~5 表示，第5 等最重要。他还从因特网上查到了每件物品的价格（都是整数元）。他希望在不超过N 元（可以等于N 元）的前提下，使每件物品的价格与重要度的乘积的总和最大。设第j 件物品的价格为v[j]，重要度为w[j]，共选中了k 件物品，编号依次为j1...jk，则所求的总和为：v[j1]*w[j1]+..+v[jk]*w[jk]请你帮助金明设计一个满足要求的购物单.</span></p>','<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">输入的第1 行，为两个正整数，用一个空格隔开：</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">N m</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">（其中N（&lt;30000）表示总钱数，m(&lt;25)为希望购买物品的个数。）</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">从第2 行到第m+1 行，第j 行给出了编号为j-1</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">的物品的基本数据，每行有2 个非负整数</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">v p</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">（其中v 表示该物品的价格（v&le;10000），p 表示该物品的重要度（1~5））</p>','<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">输出只有一个正整数，为不超过总钱数的物品的价格与重要度乘积的总和的</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">最大值（&lt;100000000）</p>','1000 5\n800 2\n400 5\n300 5\n400 3\n200 2','3900','0','<p>动态规划</p>','','2016-06-20 15:54:52',2,10,'Y',NULL,0,0),(1002,'Highest Scholarship','<p>某校的惯例是在每学期的期末考试之后发放奖学金。发放的奖学金共有五种，获取的条件各自不同：</p>\n<p>1) &nbsp; &nbsp; 院士奖学金，每人8000元，期末平均成绩高于80分（&gt;80），并且在本学期内发表1篇或1篇以上论文的学生均可获得；</p>\n<p>&nbsp;</p>\n<p>2) &nbsp; &nbsp; 五四奖学金，每人4000元，期末平均成绩高于85分（&gt;85），并且班级评议成绩高于80分（&gt;80）的学生均可获得；</p>\n<p>&nbsp;</p>\n<p>3) &nbsp; &nbsp; 成绩优秀奖，每人2000元，期末平均成绩高于90分（&gt;90）的学生均可获得；</p>\n<p>&nbsp;</p>\n<p>4) &nbsp; &nbsp; 西部奖学金，每人1000元，期末平均成绩高于85分（&gt;85）的西部省份学生均可获得；</p>\n<p>&nbsp;</p>\n<p>5) &nbsp; &nbsp; 班级贡献奖，每人850元，班级评议成绩高于80分（&gt;80）的学生干部均可获得；</p>\n<p>&nbsp;</p>\n<p>只要符合条件就可以得奖，每项奖学金的获奖人数没有限制，每名学生也可以同时获得多项奖学金。例如姚林的期末平均成绩是87分，班级评议成绩82分，同时他还是一位学生干部，那么他可以同时获得五四奖学金和班级贡献奖，奖金总数是4850元。</p>\n<p>&nbsp;</p>\n<p>现在给出若干学生的相关数据，请计算哪些同学获得的奖金总数最高（假设总有同学能满足获得奖学金的条件）。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','<p>&nbsp;输入的第一行是一个整数N（1 &lt;= N &lt;= 100），表示学生的总数。接下来的N行每行是一位学生的数据，从左向右依次是姓名，期末平均成绩，班级评议成绩，是否是学生干部，是否是西部省份学生，以及发表的论文数。姓名是由大小写英文字母组成的长度不超过20的字符串（不含空格）；期末平均成绩和班级评议成绩都是0到100之间的整数（包括0和100）；是否是学生干部和是否是西部省份学生分别用一个字符表示，Y表示是，N表示不是；发表的论文数是0到10的整数（包括0和10）。每两个相邻数据项之间用一个空格分隔。</p>','<p>输出包括三行，第一行是获得最多奖金的学生的姓名，第二行是这名学生获得的奖金总数。如果有两位或两位以上的学生获得的奖金最多，输出他们之中在输入文件中出现最早的学生的姓名。第三行是这N个学生获得的奖学金的总数。</p>','4\nYaoLin 87 82 Y N 0\nChenRuiyi 88 78 N Y 1\nLiXin 92 88 N N 0\nZhangQin 83 87 Y N 1\n','ChenRuiyi\n9000\n28700\n','0','','','2016-06-30 20:10:01',10,100,'Y',NULL,0,0),(1003,'Sea Bright Codes','<p class=\"p1\"><span class=\"s1\">Given N, B, and D: Find a set of N codewords (1 &lt;= N &lt;= 64), each of length B bits (1 &lt;= B &lt;= 8), such that each of the codewords is at least SB&nbsp;distance of D (1 &lt;= D &lt;= 7) away from each of the other codewords. The SB&nbsp;distance between a pair of codewords is the number of binary bits that differ in their binary notation. Consider the two codewords 0x554 and 0x234 and their differences (0x554 means the hexadecimal number with hex digits 5, 5, and 4):</span></p>\n<p class=\"p1\"><span class=\"s1\">0x554 = 0101 0101 0100 0x234 = 0010 0011 0100 Bit differences: xxx xx</span></p>\n<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Since five bits were different, the SB&nbsp;distance is 5.</span></p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">N, B, D on a single line</span></p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">N codewords, sorted, in decimal, ten per line. In the case of multiple solutions, your program should output the solution which, if interpreted as a base 2^B integer, would have the least value.</span></p>','16 7 3','0 7 25 30 42 45 51 52 75 76 82 85 97 102 120 127','0','<p class=\"p1\"><span class=\"s1\">There are only a few tools we need to solve this problem. First of all, we can use basic techniques to find the Nth bit of a number M: counting the least significant bit as bit 0, the next bit as bit 1, etc., we can find the value of that bit through the expression</span></p>\n<p class=\"p1\"><span class=\"s1\">int Nth_bit = (1 &lt;&lt; N) &amp; M;</span></p>\n<p class=\"p1\"><span class=\"s1\">In other words, we are shifting the number 1 left by N spaces, and then performing a binary AND on the resulting number with our original number, which will leave either a 1 in the Nth bit or a 0. So the first thing we have to do is find out the distance between each pair of numbers within the set of all numbers with B bits (0..2B-1).</span></p>\n<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">We also know that 0 can be one of the numbers in the set, because if the minimum number in the set were N instead of 0, we could XOR N to each number in the set and they would still be the same distance apart. The limits on the problem are low enough that we can do a DFS(depth first search), and as soon as we hit a solution we can output it and exit.</span></p>','','2016-07-01 01:33:06',5,10,'N',2,2,0),(101,'Summing a Series  ','<p>Sum a given integer series.</p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">&nbsp;series of positive integers, one per line. Proceed to the end of input.</span></p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">One integer, which is the sum of the input series. Our input guarantees the correct answer will never exceed&nbsp;</span></span><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\"><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">2</span></span></span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">-1.</span></p>','3\n9\n7','19','0','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">How to detect the end of input?</span></p>','','2016-07-01 23:11:00',1,1,'N',88,291,0),(102,'Compass Moving','<p>You are given a tower of n disks, initially stacked in decreasing size on one of three pegs, your objective is to transfer the entire tower to one of the other pegs, moving only one disk at a time and never moving a larger one onto a smaller. &nbsp;</p>\n<p>For example, n = 2:</p>\n<p><a style=\"text-align: -webkit-center; background-color: #e8e8ff;\"><span style=\"background-color: #ffffff; font-size: 14px;\"><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><img src=\"data/102/102.png\" alt=\"hanoi\" /></span></span></a></p>\n<p>We need 3 moves to perform the task.</p>\n<p>&nbsp;</p>\n<p>Now the question arises: What\'s the best we can do? That is, how many moves are necessary and sufficient to perform the task? &nbsp; Please write a program to find out the minimum number of moves we need to do with n disks in the tower.</p>','<p>One positive integer, n (1 &lt;= n &lt;= 64).</p>','<p>One integer, the minimum number of moves needed.</p>','2','3','0','<p>The answer might be a huge integer which cannot be hold in a 32-bit int variable.</p>','','2016-07-01 23:17:21',5,10,'N',51,204,0),(103,'Prime Test','<p>A prime number (or prime integer, often simply called a \"prime\" for short) is a positive integer p&gt;1 that has no positive integer divisors other than 1 and p itself. &nbsp;For example, the only divisors of 13 are 1 and 13, making 13 a prime number, while the number 24 has divisors 1, 2, 3, 4, 6, 8, 12, and 24 (corresponding to the factorization 24=23*3), making 24 not a prime number. Positive integers other than 1 which are not prime are called composite numbers. &nbsp;Given an integer n, write a program to check whether n is a prime number or not.</p>','<p>One integer, n. (2&lt;=n&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup>&nbsp;-1).</p>','<p>Output \"YES\" if n is a prime number, otherwise \"NO\".</p>','2','YES','0','','','2016-07-01 23:29:40',2,32,'N',87,252,0),(104,'Prime Refactorying','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">For a given integer, Prime Refactorying is finding which prime numbers you need to multiply together to get the original number, also called prime decomposition. &nbsp; Given a positive integer n&gt;=2, the prime refactorying&nbsp;is written</span></span><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n = p<sub>1</sub><sup>a<sub>1</sub></sup>p<sub>2</sub><sup>a<sub>2</sub></sup>...p<sub>k</sub><sup>a<sub>k</sub></sup></em><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" />where the pis are the k prime factors, each of order ai. &nbsp;</p>\n<p>Write a program to factor a given integer n.</p>\n<p>&nbsp;</p>','<p>&nbsp;</p>\n<p>One integer,n.(2&lt;=n&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup>-1).</p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">Output the refactorying of n as follows: &nbsp;</span></span></p>\n<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">n=p1(a1)p2(a2)...pk(ak) &nbsp;Where p1&lt;p2&lt;...&lt;pk, and ai denotes the exponent of pi.</span></span></p>\n<p>For example,for n = 1500 =&nbsp;<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">2</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">*3*5</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">3</sup>, the output should be:</p>\n<p><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" />1500=2(2)3(1)5(3)</p>','15','3(1)5(1)','0','','','2016-07-01 23:33:16',2,64,'N',39,147,0),(115,'翻译异族语言','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">把瓦尔克星球的语言翻译成科尔曼星球的语言是一件很难的事。但这两个语言很像，相同含义的单词的区别很小：只要把单词的拼写翻转过来就能转成另一种语言。比如</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">瓦尔克星语的</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;courier new&quot;, monospace; font-size: 15.4px; line-height: 19.6px;\">code</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">转成</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">科尔曼星语就是</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;courier new&quot;, monospace; font-size: 15.4px; line-height: 19.6px;\">edoc。</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">在翻译过程中不犯错误是很难的，需要编程来完成这件事。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输入的第一行是一个字符串s，第二行是一个字符串t。每个字符串有小写拉丁字母组成，字母间没有空格。每个字符串不为空且长度不超过100个字符。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">如果字符串t是字符串s的翻转，输出</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">YES</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">, 否则输出&nbsp;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">NO</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','第一个例子：\ncode\nedoc\n\n第二个例子：\nabb\naba','第一个例子：YES\n\n第二个例子：NO','0','<p>implementation、strings</p>','','2016-07-20 23:08:29',2,64,'N',81,178,0),(106,'The last non-zero digit of n!','<p>Given an integer n, please output the last non-zero digit of n! &nbsp;</p>\n<p>For example, 5!=120, the last non-zero digit is 2, for 9!=362880 it is 8.</p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">One positive integer&nbsp;</span><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">. (0&lt;</span><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">&lt;10</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">10001</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">)</span></p>','<p>The last non-zero digit of n!</p>','1','1','0','','','2016-07-02 13:55:51',5,64,'N',2,76,0),(107,'a^b mod c','<p>The calculation of&nbsp;<em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: rgb(232, 232, 255);\"><strong>a<sup>b</sup>&nbsp;mod c</strong></em>&nbsp;arises in many fields of computer science, this time we brought it to you, can you prove us your talent?</p>','<p>Three integers, a, b, c. (1&lt;=a,b,c&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup>-1)</p>','<p>One integer, the result of&nbsp;<em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">a</em><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\"><em>b</em></sup>&nbsp;mod c.</p>','3 7 15','12','0','<p>The operator mod is defined as calculating the reminder of a divides b. For example, 5 mod 1 = 0, 5 mod 2 = 1, 5 mod 3 = 2, 5 mod 4 = 1, 5 mod 5 = 0, 5 mod 6 = 5, 5 mod 7 = 5, 5 mod 8 = 5, etc. &nbsp;</p>\n<p>The operator mod has following properties:</p>\n<p>(a + b) mod c = ((a mod c) + b) mod c &nbsp;</p>\n<p>(a - b) mod c = ((a mod c) - b) mod c &nbsp;</p>\n<p>(a * b) mod c = ((a mod c) * b) mod c &nbsp;</p>\n<p>It is obvious that (a + b) mod c = ((a mod c) + (b mod c)) mod c, and etc.</p>','','2016-07-02 14:04:50',1,64,'N',1,83,0),(108,'BCD and SCM','<p>In mathematics, privided N positive integers,there exists maximum integer which can be divided among those integers without remainder,meanwhile,there exists minmum integer which can divide each of those intergers without remainds.</p>\n<p>In this problem, we define the BCD of an integer series as the largest positive integer that divides every number of that series without remainder. And the SCM of an integer series as the smallest positive integer that is a multiple of every number of the series. &nbsp;</p>\n<p>For example, for the following integer series: &nbsp;</p>\n<p>8 16 12 24 &nbsp;</p>\n<p>We have&nbsp;BCD&nbsp;= 4 and&nbsp;SCM&nbsp;= 48. &nbsp;</p>\n<p>You are given an non-negative integer series, please calculate its&nbsp;BCD&nbsp;and&nbsp;SCM.</p>','<p>The input will consist of a number of non-negative integers, one per line. Proceed to the end of input.</p>','<p>Two integers, the series\' BCD and SCM, separated by a single space. Our input guarantees the correct answer will never exceed&nbsp;<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">63</sup>-1.</p>','8 16 12 24','4\n48','0','','','2016-07-02 14:20:52',1,64,'N',2,8,0),(1004,'Ali Baba and the 40 Robbers','<p class=\"p1\"><span class=\"s1\">One day, Alibaba, as usual, drives his three donkeys to the forest to collect woods. After his hard work, finally he gets enough woods. ?He puts the woods on the back of these donkeys and goes home happily. Just after he goes through a high mountain, he sees a cloud of dust. It seems to have a group of people coming. ?He has been warned that there are a lot of thieves around this area recently. So he ties the donkeys to a tree, hiding himself behind a large rock.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Just a while, these people come, with the horses fully-loaded. Ali Baba don\'t know what\'s in the bags. However, he is sure that they are not to woods. The group has 40 persons. Ali Baba decides to see what makes them to take so many things to the mountains.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The group of people come to a foot of the mountain. Ali Baba follows them there quietly. He knew that once found he would be killed. Though they speak briefly in a low voice, he is fully aware of the fact that this is a group of robbers and the things are stolen. However, why they took things at the foot of this mountain? Ali Baba decides to continue observing.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The robber leader go in front of the mountain, says: \"Open, Simsim.\" As a big piece of stone answers and removes. There is a cave.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The robbers move the things into the cave and then come out. The robber leader says: \"Close, Simsim.\" and the stone move back. The cave disappeared. Then the group of robbers go back.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba remember this place and the sentence. Of course, he is very surprised about what has happened.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba decides to take a look at the hidden treasures. He waits until the the robbers go far away, then come to the front of the cave.</span></p>\n<p class=\"p1\"><span class=\"s1\">He has never done such a thing. The legs has begun shaking up. However, he eventually encourages himself and shouts loudly: \"Open, Simsim.\"</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">the stone removes and exposes a black hole. He goes into cave and is shocked by the scene inside. ?This is a very large cave, which is full of valuable gold, silver, jewelry and jade. He has never seen so many treasures in all his life. ?Ali Baba is a bit afraid of the robbers\' returning. So he runs back to the hole. However, Ali Baba thinks, why not take some back, as he has already here?</span></p>\n<p class=\"p2\"><span class=\"s1\">&nbsp;</span></p>\n<p class=\"p1\"><span class=\"s1\">So he throw away all the woods on the dunkeys in order to fill three large bags with treasures inside, and then out of the cave. \"Close, Simsim.\" Ali Baba says. The stone then block the hole.&nbsp;</span></p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba leads the donkey to the forests, covered the treasure with wood in order to avoid any suspicion of oth</span>ers, and then goes home happily.</p>','<p>Each test data has two positive integer N, K (1&le;K&le;N&le;1000), separate by a space character.</p>\n<p>N is number of all drawers;K is number of breaked drawers.</p>','<p>Output the float number of the answer. Accurate to three digits after decimal point.</p>','3 1','0.333','0','','','2016-07-02 14:57:30',1,64,'Y',NULL,0,0),(105,'Round Robin Killing','<p>n men stands in a format of circle under the commander that every <span style=\"font-size: 14px;\">m</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">th&nbsp;</sup>man will be executed going around the circle until only one remains, find the position L(n,m) of the circle&nbsp;where&nbsp;you should stand in order to be the last survivor. &nbsp;</p>\n<p>For example, n = 5 and m = 2, we number everyone from 1 to n based on their positions, and the entire process will be as follows:</p>\n<p><img src=\"/data/105/105.png\" alt=\"Josephus\" /></p>\n<p>In this case we should stand at position 3 thus we can escape from being executed. &nbsp;</p>\n<p>&nbsp;</p>\n<p>Now you are given n and m, your task is to write a program to find the position of the last survivor.</p>','<p>Two integers n and m, separated by a single space. (1 &lt;= n, m &lt;= 1000000).</p>','<p>One integer, the position of the last survivor.</p>','5 2','3','0','','','2016-07-02 03:02:40',1,64,'N',35,132,0),(109,'求幂运算','<p>请精确计算 <span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n&nbsp;</sup>的值，其中&nbsp;<span style=\"font-family: &quot;Times New Roman&quot;, Times, serif; font-size: 16px;\">&nbsp;0.0 &lt; T &lt; 99.999、 0 &lt; n &lt;= 25</span></p>','<p>输入由两组数组成 T、 n。T占位列数为1到6，n占位列数为8到9</p>','<p>输出每一行为一个<span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n</sup>的结果</p>\n<p>如果该数（0&lt;<span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n</sup>&lt;1）,小数点前的0省略</p>\n<p>如果该数有小数，小数最后不能以0结尾</p>\n<p>如果该数是整数，末尾不能有小数点&nbsp;</p>','95.123 12\n0.4321 20\n5.1234 15\n6.7592  9\n98.999 10\n1.0100 12','548815620517731830194541.899025343415715973535967221869852721\n.00000005148554641076956121994511276767154838481760200726351203835429763013462401\n43992025569.928573701266488041146654993318703707511666295476720493953024\n29448126.764121021618164430206909037173276672\n90429072743629540498.107596019456651774561044010001\n1.126825030131969720661201','0','<p>判断输入数据结束<span style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">:&nbsp;</span><br style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\" /><em style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">s</em><span style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">&nbsp;is a string and&nbsp;</span><em style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">n</em><span style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">&nbsp;is an integer&nbsp;</span></p>\n<pre style=\"font-size: 16px;\"><strong>C++</strong>\n<br />while(cin&gt;&gt;s&gt;&gt;n)\n<br />{\n<br />...\n<br />}\n<br /><strong>c</strong>\n<br />while(scanf(\"%s%d\",s,&amp;n)==2) //to  see if the scanf read in as many items as you want\n<br />/*while(scanf(%s%d\",s,&amp;n)!=EOF) //this also work    */\n<br />{\n<br />...\n<br />}</pre>','','2016-07-02 16:48:40',5,64,'N',12,32,0),(1005,'Knight Payment','<p>The lord&nbsp;pays his knight in gold coins. On the first day of his service, the knight receives one gold coin. On each of the next two days (the second and third days of service), the knight receives two gold coins. On each of the next three days (the fourth, fifth, and sixth days of service), the knight receives three gold coins. On each of the next four days (the seventh, eighth, ninth, and tenth days of service), the knight receives four gold coins. This pattern of payments will continue indefinitely: after receiving N gold coins on each of N consecutive days, the knight will receive N+1 gold coins on each of the next N+1 consecutive days, where N is any positive integer. &nbsp; Your program will determine the total number of gold coins paid to the knight in any given number of days (starting from Day 1).&nbsp;</p>','<p>The input contains at least one, but no more than 21 lines. Each line of the input file (except the last one) contains data for one test case of the problem, consisting of exactly one integer (in the range 1..10000), representing the number of days. The end of the input is signaled by a line containing the number 0.</p>','<p>There is exactly one line of output for each test case. This line contains the number of days from the corresponding line of input, followed by one blank space and the total number of gold coins paid to the knight in the given number of days, starting with Day 1.</p>','10\n6\n7\n11\n15\n16\n100\n10000\n1000\n21\n22\n0','10 30\n6 14\n7 18\n11 35\n15 55\n16 61\n100 945\n10000 942820\n1000 29820\n21 91\n22 98','0','','','2016-07-03 23:58:20',1,64,'N',31,62,0),(1006,'N的个数','<p>计算出最小的K，K由N个连续的数字组成，且能被整数M整除。</p>\n<p>举例，11是最小的由&lsquo;1&rsquo;组成的整数能被11整除，111111是最小的整数能被13整除，由6个&ldquo;1&rdquo;组成。</p>','<p>输入为K行，每行由两个正整数组成N和M，由空格分隔，M不大于10000</p>','<p>输出K行，每行输出对应输入行中数字N的个数，如果不存在该数，输出0</p>','1 5 \n1 11 \n1 13','0\n2\n6','0','','','2016-07-06 01:40:44',1,64,'N',6,47,0),(110,'简单算术表达式','<p>计算只有加法和乘法两种运算的算术表达式。</p>','<p>输入仅有一行，为需要你计算的表达式，表达式中只包含数字、加法运算符&ldquo;+&rdquo;和乘法运算符&ldquo;*&rdquo;，且没有括号，所有参与运算的数字均为0到2^31-1之间的整数。输入数据保证这一行只有0~ 9、+、*这12种字符。</p>','<p>输出只有一行，包含一个整数，表示这个表达式的值。<strong>注意：当答案长度多于4位时，请只输出最后4位，前导0不输出。</strong></p>','1+1*3+4\n1+1234567890*1\n1+1000000003*1','8\n7891\n4','0','<p>对于30%的数据，0&le;表达式中加法运算符和乘法运算符的总数&le;100；</p>\n<p>对于80%的数据，0&le;表达式中加法运算符和乘法运算符的总数&le;1000；</p>\n<p>对于100%的数据，0&le;表达式中加法运算符和乘法运算符的总数&le;100000</p>','','2016-07-08 01:37:56',1,64,'N',7,30,0),(1008,'末尾淘汰选举 ','<p>&nbsp; &nbsp; &nbsp;&nbsp;该选举要求投票人列出候选人在心中的排名，第一轮计票只会统计每位投票人的第一选择，如果有一位候选人得到50%以上的票数，那么他就当选。如果没有人超过50%，那就淘汰票数最少的候选人，那些原本选择这个候选人的选票，则依照顺位将票投给下一个仍未出局的候选人。这个流程不断的重复(每一次的计票，票数最少的那些候选人都被排除当选)， 或者是所有剩下的候选人得票数相同才停止。&nbsp;</p>','<p>输入第一行为一个正整数N，表示共有N个测试选举，然后一行空白行。然后输入第一组测试数据，第一行为一个整数n (n&lt;=20)代表候选人的个数。接下来的n行每一行依次表示了候选人的名字。这些名字可能长达80个可显示的字符。 &nbsp; 之后会有至多1000行，每一行包含了一张选票的内容。每一张选票都包含了一个1~n的排列，第一个数代表这张选票上的「第一选择」，第二个数字代表第二顺位&hellip;以此类推 &nbsp;&nbsp;</p>\n<p>&nbsp;</p>','<p>任意两块连续的测试选举之间输出一列空白。 &nbsp;</p>\n<p>对每一组测试选举输出赢得选举的候选人名字，或是同时打成平手的所有候选人名字。</p>','1\n\n3\nJohn Terry\nJane Smith\nMark Hughes\n1 2 3\n2 1 3\n2 3 1\n1 2 3\n3 1 2','John Terry','0','','','2016-07-08 19:38:42',3,64,'N',1,3,0),(1009,'自动判题脚本','<p>OJ 测试评判系统有三种输出结果分别为&ldquo;Accepted&rdquo;, &ldquo;Presentation Error&rdquo; or &ldquo;Wrong Answer&rdquo;. 这三种结果的定义如下:</p>\n<p>Accepted: 程序输出结果和标准答案完全比配，所有的字符、数字必须一一吻合，排列顺序相同。</p>\n<p>Presentation Error: 所有数字字符比配，排列顺序相同。但至少有一个非数字字符不同或排列顺序不同。比如字符串&lsquo;15 0&rsquo;和&lsquo;150&rsquo;属于&nbsp;&lsquo;Presentation Error&rsquo;；而字符串 &lsquo;15 0&rsquo; 和 &lsquo;1 0&rsquo;属于&lsquo;Wrong Answer&rsquo;。</p>\n<p>Wrong Answer: 如果输出结果不属于上述任何一种情况，那么将得到 &lsquo;Wrong Answer&rsquo; 结果。</p>','<p>由任意多组输入构成，每一组输入从一个正整数n（n&lt;100）开始，独占一行，表示有n行标准答案，之后n行输入为标准答案的字符内容。然后是一个正整数m（m&lt;100）独占一行，表示有m行程序执行答案，之后m行输入为程序执行答案的字符内容。输入遇到单独一行 n=0 表示输入结束。</p>\n<p>任何一行不会超过 120 个字符。</p>','<p>对于每一组输入会有一行输出对应：</p>\n<p>Run #x: Accepted</p>\n<p>Run #x: Presentation Error</p>\n<p>Run #x: Wrong Answer</p>\n<p>x表示第x组比对数据 (x从1开始).</p>','2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 15\n2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 5\n3\nInput Set #1: YES\nInput Set #2: NO\nInput Set #3: NO\n3\nInput Set #0: YES\nInput Set #1: NO\nInput Set #2: NO\n1\n1 0 1 0\n1\n1010\n1\nThe judges are mean!\n1\nThe judges are good!\n0','Run #1: Accepted\nRun #2: Wrong Answer\nRun #3: Presentation Error\nRun #4: Wrong Answer\nRun #5: Presentation Error\nRun #6: Presentation Error','0','','','2016-07-09 00:44:45',3,64,'N',2,15,0),(1010,'随机序列转化','<p>&nbsp;</p>\n<div style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">小米正在学习一种算法，他非常喜欢玩这种游戏。</p>\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">他收到了两组由数字1到n随机排列的序列，要求他把序列一转化到序列二。转化方式为将排在序列最后一位的数字插入到排在前面的序列中，可以插入到序列的最开头，也可以插入到任意连个相连的数字间。</p>\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">小米有一个算法能解决这个问题，但不够快，他想知道最少要操作多少步才能将序列一转化为序列二。</p>\n</div>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行为一个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;2&middot;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span>) &mdash; 为每一条序列的数字数。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">接下来第一行为第一个序列， 由<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;个整数组成，每个整数范围在1~n之间，且只出现一次，数字间由空格分开。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">下一行为第二个序列，格式和第一个序列一样。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">打印出一个正整数n，代表 序列一 至少需要n步操作才能转化为 序列二。</span></p>','3\n3 2 1\n1 2 3','2','0','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">举例如下序列组:</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">1 5 2 3 4</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">1 4 5 2 3</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">1 3 4 5 2</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">1 2 3 4 5</li>\n</ul>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">需要操作3步.</span></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">greedy</span></p>','','2016-07-09 23:21:21',2,256,'N',1,4,0),(1011,'被破译的兽族密码','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">人族取得了和兽族战争的主动权。为了驱逐兽族，人族需要知道还有多少兽族后备军。很幸运，卫士抓住了一个兽族士兵，他有一个加密的消息，人族需要破解。</p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">兽族士兵有一组正整数序列a。人族情报已得知这是克里克code：兽族是用一组仅由a组成的序列破解这个密文，从而得到一个数字m。而在序列a中存在a的一个子序列，这个子序列至少包含k个相同的数字，这种子序列的个数正好等于m。而数字k已是一个被人族破译的数字，所以人族将军需要运行一个程序破解这个a序列。</p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">将军已有的信息为序列&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em></span>&nbsp;和数字&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>, 他要获得a中至少包含k个相同数字的子序列个数</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span class=\"tex-font-style-it\" style=\"font-style: italic;\"><em>a</em>&thinsp;=&thinsp;(<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span>)</span><span class=\"tex-font-style-it\" style=\"font-style: italic;\">的子序列</span><span style=\"line-height: 1.4em;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em>[<em>i</em>...&nbsp;<em>j</em>]&nbsp;(1&thinsp;&le;&thinsp;<em>i</em>&thinsp;&le;&thinsp;<em>j</em>&thinsp;&le;&thinsp;<em>n</em>)</span><span style=\"line-height: 1.4em;\">&nbsp;是一个序列</span><span style=\"line-height: 1.4em;\">, 是由a序列中连续的元素构成, 从&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 1.4em;\">-th 个元素开始到第&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>j</em></span><span style=\"line-height: 1.4em;\">-th 个元素结束:&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em>[<em>i</em>...&nbsp;<em>j</em>]&thinsp;=&thinsp;(<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>&thinsp;+&thinsp;1</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>j</em></span>)</span><span style=\"line-height: 1.4em;\">.</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">输入第一行有两个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;4&middot;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span>) </span>用空格分隔，分别表示序列的元素个数和子序列中需要相同元素的个数</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">相应的，第二行输入则是n个正整数<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span><span style=\"line-height: 19.6px;\">)</span><span style=\"line-height: 1.4em;\">的序列，元素间有空格分隔。</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">输出一行，一个正整数---即至少包含k个相同正整数的子序列个数。</p>','5 3\n1 2 1 1 3','2','0','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">至少包含3个相同数字的子序列为: (1,2,1,1,3) 和 (1,2,1,1)。总共两个。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">two pointers</p>','','2016-07-10 01:31:49',3,256,'N',1,3,0),(111,'Orange Juice','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">凯尔非常喜欢喝橙汁汽水，所以他厨房里的所有食物都含有橙汁汽水成分。在他的冰箱里有n瓶橙汁汽水，每第i-th瓶汽水的橙汁占比<span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 19.6px;\">&nbsp;%。</span></p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\"><span style=\"line-height: 19.6px;\">一天凯尔准备制作一份橙汁鸡尾酒。他从n瓶汽水中取出相同分量的橙汁汽水并混合，他想知道混合后鸡尾酒里橙汁的占比。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;100</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 冰箱里橙汁汽水的瓶数. 第二行为每瓶汽水橙汁的占比</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">0&thinsp;&le;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;100</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 每个数字以空格分隔。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出凯尔鸡尾酒中橙汁的比例。 所有结果精确到&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">10&thinsp;<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">&thinsp;-&thinsp;4</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','4\n0 25 50 75','37.5000','0','','','2016-07-11 01:17:52',2,256,'N',63,144,0),(1041,'教授的多边形区域','<p>柏拉图教授请他的会编程的学生完成下面的任务。</p>\n<p>学生必须要实现一个数据结构，通过一组点数据集合S，能构建出一个凸多边形。程序的输入有q组数据，数据分为两种类型：</p>\n<p>1、S集合中增加一个点坐标（x，y）。加完后集合S围成的凸多边形可能发生变化，也可能没有发生变化。</p>\n<p>2、判断一个坐标点（x，y）是否在集合S围成有限区域内（包括区域边界线）。</p>\n<p>所有的学生都能完成这个任务，你呢？</p>','<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行包含一个正整数</span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap; color: rgb(34, 34, 34); line-height: 19.6px;\"><em>q</em></span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap; color: rgb(34, 34, 34); line-height: 19.6px;\">4&thinsp;&le;&thinsp;<em>q</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">)。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">接下来<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>q</em></span>&nbsp;行，每一行的格式为: \"<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>x</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>y</em></span>\", <span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;代表这组数据的类型 (1 或者 2),&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\">(<em>x</em>,&thinsp;<em>y</em>)</span>&nbsp;代表坐标点(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\">&thinsp;-&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">6</span>&thinsp;&le;&thinsp;<em>x</em>,&thinsp;<em>y</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">6</span></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>x</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>y</em></span>&nbsp;都是正整数)。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">输入中保证至少一组数据的类型为2。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">保证输入的前三组数据类型为第一种，所有加入集合的点都是不同的。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6000003814697px;\">输出对应的是所有输入类型为2的数据，输出\"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.3999996185303px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6000003814697px;\">YES</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6000003814697px;\">\", 如果点在凸多边形内或边界上，否则输出\"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.3999996185303px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6000003814697px;\">NO</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6000003814697px;\">\"。</span></p>','8\n1 0 0\n1 2 0\n1 2 2\n2 1 0\n1 0 2\n2 1 1\n2 2 1\n2 20 -1','YES\nYES\nYES\nNO','0','<p>data structures、geometry</p>','','2016-07-28 16:35:01',1,256,'N',1,2,0),(1012,'特殊的矩阵','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">矩阵A是一个N*N的方形矩阵，该矩阵的元素只有0和1，定义第i行，第j列数值为<em>A</em><span class=\"lower-index\"><em>i</em>,&thinsp;<em>j。</em></span></p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">定义矩阵 <span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px; white-space: nowrap;\"><em>A</em></span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">是清晰的如果没有相邻的两个矩阵单元都为1&nbsp;</span></span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">定义矩阵<em>A</em>是对称的如果&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>A</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>,&thinsp;<em>j</em></span>&thinsp;=&thinsp;<em>A</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em>&thinsp;-&thinsp;<em>i</em>&thinsp;+&thinsp;1,&thinsp;<em>j</em></span></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>A</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>,&thinsp;<em>j</em></span>&thinsp;=&thinsp;<em>A</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>,&thinsp;<em>n</em>&thinsp;-&thinsp;<em>j</em>&thinsp;+&thinsp;1</span></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">定义矩阵A的锋利指数为矩阵中1的个数。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">给定整数x，找出最小整数n，使得n*n矩阵是清晰对称矩阵，且锋利指数为x。</p>','<p>&nbsp;</p>\n<div class=\"input-specification\" style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">输入一行&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">x</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">x</em>&thinsp;&le;&thinsp;100</span>) ，x为矩阵的锋利指数。</p>\n</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一个正整数n &mdash; 最小的</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">n*n清晰对称矩阵，且锋利指数为x</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','9','5','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">对应的例子:</span></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"><img src=\"data/1012/1012.png\" alt=\"\" /></span></p>\n<p>&nbsp;</p>\n<p>constructive algorithms, dp, math</p>','','2016-07-11 21:38:35',2,256,'N',2,3,0),(1013,'最大对称子序列','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">给定一个字符串s，仅由小写英文字母组成。找到最长字母子序列。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">定义一个非空字符串&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k</em></span>]</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;=&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k</em></span></span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;(</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;&lt;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;&lt;&thinsp;...&thinsp;&lt;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k</em></span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>s</em>|</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">) 是字符串&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;=&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span class=\"tex-span\"><em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; white-space: nowrap;\">s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px; white-space: nowrap;\">...&nbsp;</span></span><em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; white-space: nowrap;\">s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>s</em>|</span><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">（</span></span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>s</em>|</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;这个字符串s的长度）的字串。&nbsp;比如字串 \"</span></span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">abcb</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">\", \"</span></span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">b</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">\" 和 \"</span></span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">abacaba</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">\" 是字串 \"</span></span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">abacaba</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">\"的字串。</span></span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">定义字串&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em></span>&nbsp;=&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>x</em>|</span></span>&nbsp;按字母程序大于&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>y</em></span>&nbsp;=&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>y</em>|</span></span>&nbsp;，如果<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>x</em>|</span>&nbsp;&gt;&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>y</em>|</span>&nbsp;且&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;=&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;=&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>, ...,&thinsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>y</em>|</span>&thinsp;=&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>y</em>|</span></span>, 或者存在一个整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em>&thinsp;&lt;&thinsp;|<em>x</em>|</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em>&thinsp;&lt;&thinsp;|<em>y</em>|</span>) 其中&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;=&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;=&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>, ...,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em></span>&thinsp;=&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em></span></span>&nbsp;且&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em>&thinsp;&thinsp;+&thinsp;&thinsp;1</span>&thinsp;&gt;&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em>&thinsp;&thinsp;+&thinsp;&thinsp;1</span></span>. 字符的比较按照ASCII码比较规则. 比如，字串\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ranger</span>\" 安字符比较规则大于 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">racecar</span>\" ，而 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">poster</span>\" 大于 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">post</span>\".</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">字串<span class=\"tex-span\" style=\"color: rgb(0, 0, 0); font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>s</em></span><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;=&nbsp;</span><span class=\"tex-span\" style=\"color: rgb(0, 0, 0); font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span class=\"tex-span\" style=\"color: rgb(0, 0, 0); font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>s</em>|</span></span><span style=\"line-height: 1.4em;\">是一个对称字符串&nbsp;</span><span style=\"line-height: 1.4em;\">&nbsp;，如果 s =&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>rev</em>(<em>s</em>)</span><span style=\"line-height: 1.4em;\">&nbsp;=&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>s</em>|</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>s</em>|&thinsp;-&thinsp;1</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1 </span></span><span style=\"line-height: 1.4em;\">。也就是说，将字符串的排列顺序从右往左颠倒，字符串保持一致，比如，\"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">racecar</span><span style=\"line-height: 1.4em;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">refer</span><span style=\"line-height: 1.4em;\">\" and \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">z</span><span style=\"line-height: 1.4em;\">\"。</span></p>','<p>&nbsp;</p>\n<div class=\"input-specification\" style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">输入一个非空只含英文字母的字符串，字符串长度不超过10。</p>\n</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px; line-height: 19.6px;\">输出输入字符串的最大对称子序列。</span></span></p>','radar','rr','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">字符串 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">radar</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" 的所有</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">对称子序列</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">: \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">a</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">d</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">r</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">aa</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">rr</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">ada</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">rar</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">rdr</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">raar</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" 和 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">radar</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\". 其中最大字串为 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">rr</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\".</span></p>\n<p>&nbsp;</p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px; line-height: 19.6px;\">binary search, bitmasks, brute force, greedy, implementation, strings</span></span></p>','','2016-07-11 22:13:00',2,256,'N',1,1,0),(1014,'埃弗拉的点','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">埃弗拉很喜欢点。最近他母亲给了他n个点，在一条直线OX上。埃弗拉想知道有多少种方法可以取出任意三个不同的点，其中两个距离最远的点相距不超过d。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">三个点的选取顺序与计算过程无关。</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行输入两个正整数:&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>d</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span>;&nbsp;1&thinsp;&le;&thinsp;<em>d</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>). 下一行包含n个正整数<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span>（<span style=\"line-height: 19.6px;\">表示点的x轴坐标），</span><span style=\"line-height: 1.4em;\">他们的绝对值不超过</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span><span style=\"line-height: 1.4em;\">&nbsp;。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">所有输入的x坐标值严格递增。</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">输出一个正整数，表示组的数量（三个点为一组，两个最远点的距离不超过d）。</p>','4 3\n1 2 3 4','4','0','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">满足例子的实例有 (1,2,3) &nbsp;(1,2,4) &nbsp;(2,3,4) &nbsp;(1 3 4).</p>\n<p>&nbsp;dp, greedy, number theory</p>','','2016-07-12 00:56:39',2,256,'N',1,3,0),(1015,'Ladder','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">You\'ve got an array, consisting of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span>. Also, you\'ve got&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>m</em></span>&nbsp;queries, the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th query is described by two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>. Numbers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;define a subsegment of the original array, that is, the sequence of numbers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;+&thinsp;1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;+&thinsp;2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span></span>. For each query you should check whether the corresponding segment is a ladder.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">A&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">ladder</span>&nbsp;is a sequence of integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k</em></span></span>, such that it first doesn\'t decrease, then doesn\'t increase. In other words, there is such integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>x</em>&thinsp;&le;&thinsp;<em>k</em>)</span>, that the following inequation fulfills:&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;&le;&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;&le;&thinsp;...&thinsp;&le;&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>x</em></span>&thinsp;&ge;&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>x</em>&thinsp;+&thinsp;1</span>&thinsp;&ge;&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>x</em>&thinsp;+&thinsp;2</span>...&thinsp;&ge;&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k</em></span></span>. Note that the non-decreasing and the non-increasing sequences are also considered ladders.</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The first line contains two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>m</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>n</em>,&thinsp;<em>m</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span>)</span>&nbsp;&mdash; the number of array elements and the number of queries. The second line contains the sequence of integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>), where number&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;stands for the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th array element.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The following&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>m</em></span>&nbsp;lines contain the description of the queries. The&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th line contains the description of the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th query, consisting of two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>n</em>)</span>&nbsp;&mdash; the boundaries of the subsegment of the initial array.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The numbers in the lines are separated by single spaces.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;lines, in the&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th line print word \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Yes</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" (without the quotes), if the subsegment that corresponds to the&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th query is the ladder, or word \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">No</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" (without the quotes) otherwise.</span></p>','8 6\n1 2 1 3 3 5 2 1\n1 3\n2 3\n2 4\n8 8\n1 4\n5 8','Yes\nYes\nNo\nYes\nNo\nYes','0','<p>dp,&nbsp;implementation,&nbsp;two pointers</p>','c 279','2016-07-13 18:56:18',2,256,'Y',NULL,0,0),(1016,'Beautiful Decomposition','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Valera considers a number&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">beautiful</span>, if it equals&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><em>k</em></span></span>&nbsp;or -<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><em>k</em></span></span>&nbsp;for some integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>k</em>&thinsp;&ge;&thinsp;0)</span>. Recently, the math teacher asked Valera to represent number&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;as the sum of beautiful numbers. As Valera is really greedy, he wants to complete the task using as few beautiful numbers as possible.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Help Valera and find, how many numbers he is going to need. In other words, if you look at all decompositions of the number&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;into beautiful summands, you need to find the size of the decomposition which has the fewest summands.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The first line contains string&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>s</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(1&thinsp;&le;&thinsp;|<em>s</em>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">6</span>)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">, that is the binary representation of number&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;without leading zeroes&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(<em>n</em>&thinsp;&gt;&thinsp;0)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print a single integer &mdash; the minimum amount of beautiful numbers that give a total of&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','111','2','0','<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In the sample&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap; color: rgb(34, 34, 34); line-height: 19.6px;\"><em>n</em>&thinsp;=&thinsp;7</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;and Valera can decompose it into sum&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap; color: rgb(34, 34, 34); line-height: 19.6px;\">2<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">3</span>&thinsp;+&thinsp;(&thinsp;-&thinsp;2<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">0</span>)</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>\n<p>games,greedy</p>','E 279','2016-07-13 19:29:03',2,256,'Y',NULL,0,0),(1017,'Bit++','<p>&nbsp;</p>\n<div style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">The classic programming language of Bitland is Bit++. This language is so peculiar and complicated.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">The language is that peculiar as it has exactly one variable, called&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">x</em></span>. Also, there are two operations:</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style: disc outside; font-size: 1em; line-height: 1.5em;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">Operation&nbsp;<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">++</span>&nbsp;increases the value of variable&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">x</em></span>&nbsp;by 1.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">Operation&nbsp;<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">--</span>&nbsp;decreases the value of variable&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">x</em></span>&nbsp;by 1.</li>\n</ul>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">A statement in language Bit++ is a sequence, consisting of exactly one operation and one variable&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">x</em></span>. The statement is written without spaces, that is, it can only contain characters \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">+</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">-</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">X</span>\". Executing a statement means applying the operation it contains.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">A programme in Bit++ is a sequence of statements, each of them needs to be executed. Executing a programme means executing all the statements it contains.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">You\'re given a programme in language Bit++. The initial value of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">x</em></span>&nbsp;is&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0</span>. Execute the programme and find its final value (the value of the variable when this programme is executed).</p>\n</div>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The first line contains a single integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;150)</span>&nbsp;&mdash; the number of statements in the programme.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Next&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;lines contain a statement each. Each statement contains exactly one operation (<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">++</span>&nbsp;or&nbsp;<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">--</span>) and exactly one variable&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em></span>&nbsp;(denoted as letter &laquo;<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">X</span>&raquo;). Thus, there are no empty statements. The operation and the variable can be written in any order.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print a single integer &mdash; the final value of&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>x</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','2\nX++\n--X','0','0','<p>implementation</p>','A 282','2016-07-13 19:40:42',2,256,'Y',NULL,0,0),(1018,'保罗的字符串','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">小保罗喜欢字符串，尤其喜欢长度为n的字符串。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">一天他想找到一个满足如下条件的字符串:</p>\n<ol style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">字符串由长度为n的小写字母组成，其中k个字母是不同的。</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">不存在两个相邻的字符串相同; 如果一个字符串&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>&thinsp;=&thinsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span>, 那么,<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&ne;&thinsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>&thinsp;+&thinsp;1</span>(1&thinsp;&le;&thinsp;<em>i</em>&thinsp;&lt;&thinsp;<em>n</em>)</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">满足条件1和2,取其中字母顺序排序最小的一个字符串。&nbsp;</li>\n</ol>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"line-height: 19.6px;\"><span style=\"line-height: 21px;\">字母顺序排序规则为：</span>定义字串&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em></span><span style=\"line-height: 19.6px;\">&nbsp;=&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em style=\"box-sizing: border-box;\">x</em>|</span></span><span style=\"line-height: 19.6px;\">&nbsp;按字母程序大于&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">y</em></span><span style=\"line-height: 19.6px;\">&nbsp;=&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em style=\"box-sizing: border-box;\">y</em>|</span></span><span style=\"line-height: 19.6px;\">&nbsp;，如果</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\">|<em style=\"box-sizing: border-box;\">x</em>|</span><span style=\"line-height: 19.6px;\">&nbsp;&gt;&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\">|<em style=\"box-sizing: border-box;\">y</em>|</span><span style=\"line-height: 19.6px;\">&nbsp;且&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;=&thinsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span style=\"line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;=&thinsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span><span style=\"line-height: 19.6px;\">, ...,&thinsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em style=\"box-sizing: border-box;\">y</em>|</span>&thinsp;=&thinsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em style=\"box-sizing: border-box;\">y</em>|</span></span><span style=\"line-height: 19.6px;\">, 或者存在一个整数&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">r</em></span><span style=\"line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">r</em>&thinsp;&lt;&thinsp;|<em style=\"box-sizing: border-box;\">x</em>|</span><span style=\"line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">r</em>&thinsp;&lt;&thinsp;|<em style=\"box-sizing: border-box;\">y</em>|</span><span style=\"line-height: 19.6px;\">) 其中&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;=&thinsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span style=\"line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;=&thinsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span><span style=\"line-height: 19.6px;\">, ...,&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"box-sizing: border-box;\">r</em></span>&thinsp;=&thinsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"box-sizing: border-box;\">r</em></span></span><span style=\"line-height: 19.6px;\">&nbsp;且&nbsp;</span><span class=\"tex-span\" style=\"box-sizing: border-box; line-height: 19.6px; font-size: 17.5px;\"><em style=\"box-sizing: border-box;\">x</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"box-sizing: border-box;\">r</em>&thinsp;&thinsp;+&thinsp;&thinsp;1</span>&thinsp;&gt;&thinsp;<em style=\"box-sizing: border-box;\">y</em><span class=\"lower-index\" style=\"box-sizing: border-box; font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"box-sizing: border-box;\">r</em>&thinsp;&thinsp;+&thinsp;&thinsp;1</span></span><span style=\"line-height: 19.6px;\">. 字符的比较按照ASCII码规则比较。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入两个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>k</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">6</span>,&thinsp;1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;26)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;&mdash; 分别代表字符串的长度和不同字符的个数。</span></p>','<p>&nbsp;</p>\n<div class=\"output-specification\" style=\"margin: 0px 0px 1em; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">输出一行符合要求的字符串；如果不存在输出 -1。</p>\n</div>','7 4','ababacd','0','<p>greedy</p>','','2016-07-13 19:53:31',2,256,'N',2,7,0),(1025,'村子里的房子','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">保罗喜欢他的村庄，村庄有n幢房子，分别标记为1~n。Little penguin Polo loves his home village. The village has&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;houses, indexed by integers from 1 to&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>. 每个房子有一个信箱，信箱里存放一个整数<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>n</em></span>).</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">保罗喜欢绕着村庄走，先走方式为，假设首先站在房子x，然后走到x信箱中整数指向的下一个房子<span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>x，</em></span></span><span style=\"line-height: 1.4em;\">然后再是下一个房子</span><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 9.84375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>x</em></span></span><span style=\"line-height: 1.4em;\">，以此类推。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">定义规则:</p>\n<ol style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">当保罗从第1到k幢房子（包含1和K）开始走起，他能走回第一幢房子。</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">当保罗从第k+1到n幢房子（包含k+1和n）开始走起，他一定不能走回第一幢房子。</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">当保罗从第一幢房子开始走起，他一定能通过非0步行走走回第一幢房子。</li>\n</ol>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">他需要算出有多少种行走方式能够满足上述定义的规则，打印出行走方式的数量除<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1000000007</span><span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>&thinsp;+&thinsp;7)</span><span style=\"line-height: 1.4em;\">的余数。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行是两个正整数</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>k</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;1000,&thinsp;1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;<em>min</em>(8,&thinsp;<em>n</em>)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) 用空格分离-----分别代表房屋数量和根据定义的k。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一个正整数-----实际答案模(mod)</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1000000007</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>&thinsp;+&thinsp;7)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">的结果。</span></p>','7 4','1728','0','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">combinatorics</span></p>','','2016-07-13 21:35:22',2,256,'N',1,1,0),(1019,'无聊的游戏','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">克鲁伊夫，安德鲁，约瑟夫 可以连续喜欢玩立方体游戏。这个游戏是三个人玩的，当约瑟夫不在时，<span style=\"line-height: 19.6px;\">克鲁伊夫和安德鲁完另一种游戏。</span></p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\"><span style=\"line-height: 19.6px;\">约瑟夫留给他俩一句话，这两句话由&ldquo;0&rdquo;或&ldquo;1&rdquo;组成，长度为</span><span style=\"color: #000000;\">2&middot;</span><em style=\"color: #000000;\">n</em><span style=\"line-height: 19.6px;\">。</span><span style=\"line-height: 19.6px;\">克鲁伊夫是先手，安德鲁是后手。每一手操作规则如下，一个玩家选择1到2*n之间的一个整数，而且这个数之前没有被选过，然后玩家记录下话中该正整数位置对应的值。</span></p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\"><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">假设克鲁伊夫的话是</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>&thinsp;=&thinsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2<em>n</em></span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">. 同样安德鲁的话为</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px;\">&thinsp;=&thinsp;</span></span><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px;\">...&nbsp;</span></span><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 13.125px;\">2</span></span><em><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 13.125px;\">n</span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;</span></span></em></span></span><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; color: #000000;\">。</span><span>如果克鲁伊夫选择k位置的值, 那么他就记下</span><span>&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k；</em></span></span><span>同样安德鲁选择r，那么他就记下</span><span>&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em></span></span><span>&nbsp;</span><span>。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">当没有玩家能够进行下一步操作时，游戏结束。游戏结束后克鲁伊夫拿出部分记录下的0、1字符，并且可以随意组合，安德鲁也是。结果数字可以是0开头。数字结果是谁能组成较大的数谁就获胜，如果最大的数相等那么就是平局。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">给到两个字符串&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>. 假设克鲁伊夫和安德鲁都是最佳的玩家，请算出游戏结果。</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行输入正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">6</span></span>). 第二行是克鲁伊夫的话&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;。第三行是约瑟夫的话&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">保证每句话话都是2&middot;<em>n</em>长度，且仅由\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">0</span>\" 和 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">1</span>\"组成。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">两个玩家都玩得足够的好，打印 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">First</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", 如果克鲁伊夫获胜，打印\"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Second</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" 如果安德鲁获胜，打印\"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Draw</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"如果游戏平局。输出中没有引号。</span></p>','3\n110110\n001001','First','0','<p>games、greedy</p>','','2016-07-13 23:32:43',2,256,'N',1,1,0),(1020,'Array','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Vitaly has an array of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;distinct integers. Vitaly wants to divide this array into three&nbsp;<span class=\"tex-font-style-bf\" style=\"font-weight: bold;\">non-empty</span>&nbsp;sets so as the following conditions hold:</p>\n<ol style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The product of all numbers in the first set is less than zero&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(&thinsp;&lt;&thinsp;0)</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The product of all numbers in the second set is greater than zero&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(&thinsp;&gt;&thinsp;0)</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The product of all numbers in the third set is equal to zero.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">Each number from the initial array must occur in exactly one set.</li>\n</ol>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Help Vitaly. Divide the given array.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The first line of the input contains integer&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(3&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;100)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">. The second line contains&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;space-separated distinct integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(|<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">3</span>)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;&mdash; the array elements.</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the first line print integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;&gt;&thinsp;0)</span>&nbsp;&mdash; the number of elements in the first set. Then print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;numbers &mdash; the elements that got to the first set.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the next line print integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;&gt;&thinsp;0)</span>&nbsp;&mdash; the number of elements in the second set. Then print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>&nbsp;numbers &mdash; the elements that got to the second set.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the next line print integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3</span>&thinsp;&gt;&thinsp;0)</span>&nbsp;&mdash; the number of elements in the third set. Then print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3</span></span>&nbsp;numbers &mdash; the elements that got to the third set.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The printed sets must meet the described conditions. It is guaranteed that the solution exists. If there are several solutions, you are allowed to print any of them.</p>','4\n-1 -2 -3 0','1 -1\n2 -3 -2\n1 0','1','<p>&nbsp;A300</p>\n<p class=\"p1\"><span class=\"s1\">brute force, constructive algorithms, implementation</span></p>','','2016-07-14 00:40:13',2,256,'Y',NULL,0,0),(1021,'Yaroslav and Sequence','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Yaroslav has an array, consisting of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(2&middot;<em>n</em>&thinsp;-&thinsp;1)</span>&nbsp;integers. In a single operation Yaroslav can change the sign of exactly&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;elements in the array. In other words, in one operation Yaroslav can select exactly&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;array elements, and multiply each of them by -1.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Yaroslav is now wondering: what maximum sum of array elements can be obtained if it is allowed to perform any number of described operations?</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Help Yaroslav.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The first line contains an integer&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;100)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">. The second line contains&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(2&middot;<em>n</em>&thinsp;-&thinsp;1)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;integers &mdash; the array elements. The array elements do not exceed&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;in their absolute value.</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In a single line print the answer to the problem &mdash; the maximum sum that Yaroslav can get.</span></p>','2\n50 50 50','150','0','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the first sample you do not need to change anything. The sum of elements equals&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">150</span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the second sample you need to change the sign of the first two elements. Then we get the sum of the elements equal to&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">100</span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">constructive algorithms</span></p>','C 301','2016-07-14 00:58:22',2,256,'Y',NULL,0,0),(1022,'The Closest Pair','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Currently Tiny is learning Computational Geometry. When trying to solve a problem called \"The Closest Pair Of Points In The Plane\", he found that a code which gave a wrong time complexity got Accepted instead of Time Limit Exceeded.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The problem is the follows. Given&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;points in the plane, find a pair of points between which the distance is minimized. Distance between<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>)</span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>)</span>&nbsp;is&nbsp;<img src=\"data/1022/1022.png\" alt=\"\" />.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The pseudo code of the unexpected code is as follows:</p>\n<pre style=\"margin-top: 1.5em; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: Consolas, \'Lucida Console\', \'Andale Mono\', \'Bitstream Vera Sans Mono\', \'Courier New\', Courier; line-height: 21px; white-space: pre-wrap; word-wrap: break-word; color: #880000;\"><br />input n<br />for i from 1 to n<br />    input the i-th point\'s coordinates into p[i]<br />sort array p[] by increasing of x coordinate first and increasing of y coordinate second<br />d=INF        //here INF is a number big enough<br />tot=0<br />for i from 1 to n<br />    for j from (i+1) to n<br />        ++tot<br />        if (p[j].x-p[i].x&gt;=d) then break    //notice that \"break\" is only to be<br />                                            //out of the loop \"for j\"<br />        d=min(d,distance(p[i],p[j]))<br />output d</pre>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Here,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>tot</em></span>&nbsp;can be regarded as the running time of the code. Due to the fact that a computer can only run a limited number of operations per second,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>tot</em></span>&nbsp;should not be more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;in order not to get Time Limit Exceeded.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">You are a great hacker. Would you please help Tiny generate a test data and let the code get Time Limit Exceeded?</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">A single line which contains two space-separated integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;and&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>k</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;2000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">).</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">If there doesn\'t exist such a data which let the given code get TLE, print \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">no solution</span>\" (without quotes); else print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;lines, and the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th line contains two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(|<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|,&thinsp;|<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>)</span>&nbsp;representing the coordinates of the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th point.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The conditions below must be held:</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">All the points must be distinct.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|,&thinsp;|<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">After running the given code, the value of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>tot</em></span>&nbsp;should be larger than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>.</li>\n</ul>','4 3','0 0\n0 1\n1 0\n1 1','0','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">A 311</span></p>\n<p class=\"p1\"><span class=\"s1\">constructive algorithms, implementation</span></p>','','2016-07-15 00:04:06',2,256,'Y',NULL,0,0),(1023,'杰拉德相等字串','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">杰拉德定义了一种新的字符串相等的概念。两个长度相等的字符串a和b如果相等，那么需要满足任意一个如下条件:</p>\n<ol style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">两个字符串完全相等。</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">如果把字符串a分割成两部分a1和a2，把字符串b分割成b1和b2，满足任意一个如下条件：<ol style=\"margin: 0px 0px 0px 1em; padding: 0px; list-style: lower-latin outside; font-size: 1em; line-height: 1.5em;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;= &nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>, 并且&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>&nbsp;=&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span></li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;=&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>, 并且&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>&nbsp;=&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span></li>\n</ol></li>\n</ol>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">现在杰拉德给出两个字符串，需要判断这两个字符串是否相等。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输入为两行长度相等的字符串，每个字符串的长度为1到 200 000，并且字符串由英文小写字母组成。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">YES</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" (没有引号), 如果两个字符串相等，输出 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">NO</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" (没有引号)。</span></p>','aaba\nabaa','YES','0','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一个字符串aaba分割成 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">aa</span>\" 和 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ba</span>\", 第二个字符串分割成 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ab</span>\" 和 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">aa</span>\". \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">aa</span>\"= \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">aa</span>\"; \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ab</span>\" =&nbsp;\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ba</span>\" 因为 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ab</span>\" = \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">a</span>\" + \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">b</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ba</span>\" = \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">b</span>\" + \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">a</span>\"。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">所以aaba和abaa相等。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">divide and conquer, hashing, sortings, strings</span></p>','','2016-07-15 00:44:37',2,256,'N',1,1,0),(1024,'索普的六边形','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">索普在生日那天得到一个特殊的六边形。他发现这个六边形每个内角都为120度. 他量了一下六边形每条边，发现每条边的长度都是整数（厘米）。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">索普开始在六边形里画线，这些线都平行于六边形的边，这些线能组成边长为1厘米的正三角形将六边形完全分割。现在索普想知道一共有多少个正三角形，完全分割六边形。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入共有6个正整数，每个正整数由空格分割</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1,</span>...,</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">6</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;1000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 代表六边形按顺时针读取的每条边的长度，输入能够保证这些长度能够构成六边形</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">打印出一个正整数，代表六边形中边长为1厘米的正三角形的个数。</span></p>','1 2 1 2 1 2','13','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">实例分割图如下:</span></p>\n<p><img src=\"/data/1024/1024.png\" alt=\"\" />&nbsp;</p>\n<p>&nbsp;</p>\n<p>brute force,geometry,math</p>','','2016-07-16 17:15:48',2,256,'N',4,6,0),(10001,'Good Substrings','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Smart Beaver recently got interested in a new word game. The point is as follows: count the number of distinct good substrings of some string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>. To determine if a string is good or not the game uses rules. Overall there are&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;rules. Each rule is described by a group of three<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>p</em>,&thinsp;<em>l</em>,&thinsp;<em>r</em>)</span>, where&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is a string and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>l</em>&thinsp;&le;&thinsp;<em>r</em>)</span>&nbsp;are integers. We&rsquo;ll say that string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;complies with rule&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>p</em>,&thinsp;<em>l</em>,&thinsp;<em>r</em>)</span>, if the number of occurrences of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;in string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;lies between&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em></span>, inclusive. For example, string \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ab</span>\", complies with rules (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ab</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2</span>) and (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">aab</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>), but does not comply with rules (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">cd</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2</span>) and (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">abab</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>).</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">A&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">substring</span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>l</em>...&nbsp;<em>r</em>]</span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>l</em>&thinsp;&le;&thinsp;<em>r</em>&thinsp;&le;&thinsp;|<em>s</em>|)</span>&nbsp;of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>&thinsp;=&thinsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>s</em>|</span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>s</em>|</span>&nbsp;is a length of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>) is string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em></span><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em>&thinsp;+&thinsp;1</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em></span></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Consider a&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">number of occurrences&nbsp;</span>of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;in string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;as a number of pairs of integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em>,&thinsp;<em>r</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>l</em>&thinsp;&le;&thinsp;<em>r</em>&thinsp;&le;&thinsp;|<em>p</em>|)</span>&nbsp;such that&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em>[<em>l</em>...&nbsp;<em>r</em>]&thinsp;=&thinsp;<em>t</em></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">We&rsquo;ll say that string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;is good if it complies with all&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;rules. Smart Beaver asks you to help him to write a program that can calculate the number of distinct good substrings of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>. Two substrings&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>x</em>...&nbsp;<em>y</em>]</span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>z</em>...&nbsp;<em>w</em>]</span>&nbsp;are cosidered to be distinct iff&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>x</em>...&nbsp;<em>y</em>]&thinsp;&ne;&thinsp;<em>s</em>[<em>z</em>...&nbsp;<em>w</em>]</span>.</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The first line contains string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>. The second line contains integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>. Next&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;lines contain the rules, one per line. Each of these lines contains a string and two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>, separated by single spaces (<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;|<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|</span>). It is guaranteed that all the given strings are non-empty and only contain lowercase English letters.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The input limits for scoring 30 points are (subproblem G1):</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;and the maximum length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;200</span>.</li>\n</ul>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The input limits for scoring 70 points are (subproblems G1+G2):</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;and the maximum length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;2000</span>.</li>\n</ul>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The input limits for scoring 100 points are (subproblems G1+G2+G3):</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;and the maximum length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;50000</span>.</li>\n</ul>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print a single integer &mdash; the number of good substrings of string&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>s</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','ltntlnen\n3\nn 0 0\nttlneenl 1 4\nlelllt 1 1','2','0','<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In the second test only substrings &laquo;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: &quot;courier new&quot;, monospace; color: rgb(34, 34, 34); line-height: 19.6px;\">e</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&raquo; and &laquo;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: &quot;courier new&quot;, monospace; color: rgb(34, 34, 34); line-height: 19.6px;\">t</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&raquo; are good.</span></p>\n<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">string suffix structures</span></p>','','2016-07-17 02:17:12',4,256,'Y',NULL,0,0),(10004,'维多利亚和她的鞋子','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">维多利亚是个非常爱美的女孩子，尤其对鞋子非常热衷，她的家里藏了很多鞋子。最近她突然觉得不光外表要美丽，家中专门放鞋的房间也要整洁。她决定周一清晨整理所有的鞋子。但是房间里的鞋子太多，她完全无法在短时间里把属于一对的鞋子整理到一起，迫于有限的学识，她无法知道最少需要整理多少个鞋子才能将房间整理完全。</p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">房间是的构造是矩形的，并且被分割成了<em style=\"font-size: 17.5px; line-height: 19.6px;\">n</em><span style=\"font-size: 17.5px; line-height: 19.6px;\">&thinsp;&times;&thinsp;</span><em style=\"font-size: 17.5px; line-height: 19.6px;\">m</em><span style=\"line-height: 19.6px;\">个大小相等的矩形，每个矩形放了一个鞋子。每一双鞋子有一个唯一的正整数标示从</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">1</span><span style=\"line-height: 19.6px;\">&nbsp;到 (n*m)/2,也就是说，每一个矩形用坐标</span><span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">(<em>i</em>,&thinsp;<em>j</em>)</span><span style=\"line-height: 19.6px;\">表示，这个坐标对应的值为鞋子的正整数唯一标示号。</span><span style=\"line-height: 19.6px;\">维多利亚相信只要把所有标示号相同的鞋子能够相邻的摆放到一起，那么房间整理就完成了。我们假设两个矩形</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">(<em>i</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>j</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>)</span><span style=\"line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">(<em>i</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;<em>j</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>)</span><span style=\"line-height: 19.6px;\">是相邻的，如果</span><span style=\"font-size: 17.5px; line-height: 19.6px;\">|</span><em style=\"font-size: 17.5px; line-height: 19.6px;\">i</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><span style=\"font-size: 17.5px; line-height: 19.6px;\">&thinsp;-&thinsp;</span><em style=\"font-size: 17.5px; line-height: 19.6px;\">i</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span><span style=\"font-size: 17.5px; line-height: 19.6px;\">|&thinsp;+&thinsp;|</span><em style=\"font-size: 17.5px; line-height: 19.6px;\">j</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><span style=\"font-size: 17.5px; line-height: 19.6px;\">&thinsp;-&thinsp;</span><em style=\"font-size: 17.5px; line-height: 19.6px;\">j</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span><span style=\"font-size: 17.5px; line-height: 19.6px;\">|&thinsp;=&thinsp;1。</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">输入第一行为两个正整数<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>n</em></span><span style=\"line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>m，</em></span><span style=\"line-height: 1.4em;\">空格分隔，对应房间的大小。接下来是n行每行m个空格分隔的正整数，每个正整数代表一双唯一的鞋子的编号。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">输入保证:</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>n</em>&middot;<em>m</em></span>&nbsp;是偶数。</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">所有的数字表示房间里每一双唯一的鞋子的标识号，从&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">1</span>&nbsp;到&nbsp;<span style=\"line-height: 19.6px;\">&nbsp;(n*m)/2。</span></li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">每个从&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">1</span>&nbsp;到&nbsp;<span style=\"line-height: 19.6px;\">&nbsp;(n*m)/2 的数字出现两次。</span></li>\n</ul>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一个正整数，表示最少需要移动位置的鞋子数。</span></p>','3 4\n1 3 2 6\n2 1 5 6\n4 4 5 3','4','0','<p><img src=\"/data/10004/10004.png\" alt=\"\" /></p>\n<p>&nbsp;</p>\n<p>flows、graph matchings</p>','','2016-07-17 12:22:24',8,256,'N',5,6,0),(10014,'秘密任务','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">保罗在一个秘密组织工作了很长时间，在该组织的庇护下他经常在最贵的酒店吃最好吃的食物。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">又一次保罗得到了一个重要任务，要去获得最新的英国科学家关于语言的研究成果。这项研究被加密了并且被锁在了一个很大的保险箱里。保罗的牙齿很硬，组织相信保罗打开保险箱没有问题。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">保罗到了现场，发现他的牙齿无法打开保险箱。此时他得到一个来自组织的消息，用牙齿打开保险箱没有必要，组织的得到一个可靠的消息来源，加密密码是一串不以0开始的数字字串。这串字串的提示如下：</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">如果&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;= \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">?</span>\", 那么密码的第&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th 个数字可以是任意0到9的数字(包含&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0</span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">9</span>);</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">如果&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;是一个数字 [<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0</span>&nbsp;,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">9]</span>, 那么表示密码的第 i 个位置的数字就是<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;;</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">如果提示包含字符从\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">A</span>\" 到 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">J</span>\"的字符, 那么拥有相同字符的位置对于相同的数字，不同字符对应不同的数字；</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">密码的长度和提示的长度一样。</li>\n</ul>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">比如, 提示 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">?JGJ9</span>\" ，那么符合提示的密码有: \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">51919</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">55959</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">12329</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">93539</span>\" 等等, 不符合提示的密码组合有: \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">56669</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">00111</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">03539</span>\" 和 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">13666</span>\".</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">获得这个情报以后，组织要求保罗通过提示，秘密且低调的打开保险箱。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">保罗在组织学校是一个优秀的学院，但毕业之后，他的水平大不如前了。他想知道根据提示有多少种可能的密码组合，来判断是否有足够的时间来打开保险箱然后回家看他最喜欢的电视剧。</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">输入第一行是一个字符串&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>s</em></span>&nbsp;&mdash; 代表保险箱提示码. 字串&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>s</em></span>&nbsp;由这些字符组成:&nbsp;<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px;\">?, 0-9, A-J</span>. 保证第一个字符不为0。&nbsp;&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">1&thinsp;&le;&thinsp;|<em>s</em>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">这里&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">|<em>s</em>|</span>&nbsp;代表字符串S的长度。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出可能的密码组合个数。</span></p>','1?AA','100','0','<p>math</p>','','2016-07-18 00:43:37',1,256,'N',1,1,0),(112,'请快说结果','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">冬天里的一个寒冷的夜晚，漂亮的Alice和帅气的Bob两人座在火堆旁，互相取暖，两人一话不说，光顾思考着一些有趣的问题。突然Alice给了Bob一个正整数n，说到:</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">打乱正整数n里的数字，并且算出使新数字是所有组合里最小的那个数，而且这个数的开头数字不可以为0。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Bob认为时机到了，立马说出了答案。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Alice不知道Bob给的答案是不是对，想让他的计算机学长立马告诉她结果，因为Bob已经等不及的要知道结果了。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输入第一行是一个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">0&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) 不以0开头。第二行是一个正整数</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">0&thinsp;&le;&thinsp;<em>m</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 是Bob给出的答案，可能会以0开头。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出&nbsp;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">OK</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;如果Bob的答案是正确的，反之输出&nbsp;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">WRONG_ANSWER</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;。</span></p>','3310\n1033','OK\n','0','<p>implementation sorting</p>','','2016-07-19 15:25:38',2,256,'N',59,254,0),(113,'剪刀石头布','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">A、B、C三人玩剪刀石头布游戏，通常这个游戏是两个人玩的，现在三个人玩规则如下，当一个人的手势赢了另外两个人，那么这个人就赢了。否则，重新一轮。请写一个程序，找出赢的人。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输入第一行是A的手势，第二行是B的手势，第三行是C的手势。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出F如果A赢了；输出M如果B赢了；输出S如果C赢了；输出？如果没有赢的人。</span></p>','rock\npaper\nscissors','？','0','<p>implementation schedules</p>','','2016-07-19 16:46:40',2,256,'N',77,178,0),(1026,'星际联盟','<p>&nbsp;</p>\n<div style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">在一个遥远的星系存在着n个星球，星球被标记为1到n。一天这n个星球的总统想要组成一个星际联盟，而每个总统都要和其他星球的每一个总统沟通联盟方案。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">每两个星球的通信是互相可达的，通信拨号时间计为<span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 19.6px;\">&nbsp;。整个星系共有n个通信信道，所有的n个星球通过这n个通信信道组成一个统一的通信网络。这意味着任意一个星球v可以和星球u进行通信，通过通信转接星球</span><span style=\"font-size: 1em; line-height: 1.4em;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span style=\"font-size: 1em; line-height: 1.4em;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span><span style=\"font-size: 1em; line-height: 1.4em;\">, ...,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>m</em></span></span><span style=\"font-size: 1em; line-height: 1.4em;\">&nbsp;，经过</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>u</em></span><span style=\"font-size: 1em; line-height: 1.4em;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span style=\"font-size: 1em; line-height: 1.4em;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span style=\"font-size: 1em; line-height: 1.4em;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span><span style=\"font-size: 1em; line-height: 1.4em;\">, ...,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>m</em>&thinsp;-&thinsp;1</span></span><span style=\"font-size: 1em; line-height: 1.4em;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>m</em></span></span><span style=\"font-size: 1em; line-height: 1.4em;\">的</span><span style=\"line-height: 21px;\">通信信道</span><span style=\"font-size: 1em; line-height: 1.4em;\">&nbsp;，那么星球v和u的拨号时间为这些通信信道拨号时间的总和。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">每个总统必须一对一的和其他每个总统进行通信，通信信道是独占的。考虑到事务的重要性，每两个星球的通信总是选取拨号时间最短的那条线路，每两个星球的实际沟通时间很短，整个通信时间包括沟通时间可以计为拨号时间，且沟通<span style=\"line-height: 21px;\">内容只会涉及这两个星球相关的信息，只有从目标星球那里才能得知目标星球的信息，除此之外没有其他途径。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">信息委员会需要设计沟通计划，首先他们要算出每个星球要完成所有和其他星球的沟通需要多少时间。</p>\n</div>','<p>&nbsp;</p>\n<div class=\"input-specification\" style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">输入第一行是一个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">n</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">3&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">n</em>&thinsp;&le;&thinsp;200000</span>) 代表星系有n个星球和n条通信线路。接下来n行，每行3个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">a</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">b</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">t</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">a</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub>,&thinsp;<em style=\"font-style: italic;\">b</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub>&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">n</em>,&thinsp;<em style=\"font-style: italic;\">a</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub>&thinsp;&ne;&thinsp;<em style=\"font-style: italic;\">b</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub>,&thinsp;1&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">t</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub>&thinsp;&le;&thinsp;10<sup class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">3</sup></span>) 代表星球<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 19.6px;\">和</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 19.6px;\">&nbsp;的通信拨号时间为</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 19.6px;\">&nbsp;，这两个星球间不存在其他通信线路。</span></p>\n</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出n个正整数，空格分隔，代表每个星球总统的需要通信的总时间。</span></p>','3\n1 2 3\n2 3 2\n1 3 1','4 5 3','0','<p>dp,trees,two point</p>','48G - Galaxy Union','2016-07-19 23:43:34',3,256,'Y',1,7,0),(1027,'条子游戏','<p><span style=\"color: #222222;\">加西亚和佩罗塔发明了一个游戏。加西亚有一块长条由 </span><span class=\"tex-span\" style=\"font-size: 17.5px;\">1&thinsp;&times;&thinsp;<em>n</em></span><span style=\"color: #222222;\">&nbsp;个方块组成，并且涂成的白色和黑色。然后佩罗塔可以开始游戏了，每一步游戏操作，佩罗塔可以选取任意相邻的两个颜色相同的方块，并且只能涂成白色和黑色两种颜色。佩罗塔的目标是要把长条涂成相邻方块的颜色都不相同，他要知道最少需要几步操作才能完成。</span></p>','<p><span style=\"color: #222222;\">输入第一行是一个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>n</em></span><span style=\"color: #222222;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;1000</span><span style=\"color: #222222;\">) 代表长条的长度。第二行含有n个字符，代表长条的初始颜色，0代表白色方块，1代表黑色方块。&nbsp;</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">如果佩罗塔不能找到答案输出-1；否则输出最少需要操作的步数。</span></p>','5\n10001','1','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">可以选取第二块和第三块，第二块涂成白色，第三块涂成黑色。</span></p>\n<p>brute force，dp，implementation</p>','','2016-07-20 11:08:45',2,256,'N',1,1,0),(114,'选择相同对','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">给定一个字符串S，S的长度为N。任务是找出其中相同字符的配对。比如：</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">1.&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>i</em>,&thinsp;<em>j</em>&thinsp;&le;&thinsp;<em>N</em></span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">2.&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>S</em>[<em>i</em>]&thinsp;=&thinsp;<em>S</em>[<em>j</em>]</span>, 第&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th 个字符等于第 &nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>j</em></span>-th个字符.</p>','<p>&nbsp;</p>\n<div class=\"input-specification\" style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">第一行输入一个字符串<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">S</em></span>, 由小写拉丁字符和数字字符组成，保证S的长度不超过<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">10<sup class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</sup></span>。</p>\n&nbsp;</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一个正整数，表示满足要求的字符对的数量。</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">字符对&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(<em>i</em>,&thinsp;<em>j</em>)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(<em>j</em>,&thinsp;<em>i</em>)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;被认为是不同的字符对。</span></p>','great10','7','0','<p>strings</p>','','2016-07-20 12:15:18',2,256,'N',33,55,0),(1028,'舞蹈课','<p>&nbsp;</p>\n<div style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">n个学生在学舞蹈，每个学生的跳舞等级为<em style=\"font-style: italic;\">a</em><em style=\"font-style: italic;\">i。</em><span style=\"font-size: 1em; line-height: 1.4em;\">课程一开始学生从左到右排成一排，队伍中至少保证有一对男女，优先跳舞的规则如下:首先相邻的是男女学生，再是两个学生的等级差距最小，如果有多组同时满足条件，那么选择最左边的一组男女同学。选出的同学离开队列，剩下的同学按原来的顺序合成新的队列，继续选取下一组。跳舞的水平只由</span><em style=\"font-style: italic;\">a</em><em style=\"font-style: italic;\">i</em><span style=\"font-size: 1em; line-height: 1.4em;\">&nbsp;决定。请一一找出跳舞组合的练习顺序。</span></p>\n</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;2&middot;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 代表学生人数。接下来第二行输入n个由符号B、G组成的字符串，没有空格。B代表男孩，G代表女孩。 第三行是n个正整数</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">7</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 代表每个学生的跳舞等级，按从左到右顺序排列。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输出正整数k，代表跳舞组合的数量，接下来k行，每行输出两个正整数（从小到大排列），代表学生一开始在队列里从左到右的序号。当一组组合离开队列后，剩下的学生序号不会重排。</span></p>','4\nBGBG\n4 2 4 3','2\n3 4\n1 2','0','<p>data structures</p>','','2016-07-20 13:07:43',2,256,'N',2,5,0),(1029,'邮箱地址','<p class=\"p1\">有时打电话拼邮箱地址的时候，当读到<span class=\"s1\">\'.\'</span>的时候会读成<span class=\"s2\"><strong>dot</strong></span><span class=\"s3\"><strong>，</strong></span>当读到<span class=\"s1\">&lsquo;@&rsquo;</span>的时候会读成<span class=\"s2\"><strong>at</strong></span>。比如会有这种读法<span class=\"s2\"><strong>vasyaatgmaildotcom</strong></span>。你的任务是把这串字符转成<span class=\"s1\">(vasya@gmail.com)</span>。</p>\n<p class=\"p1\">邮箱地址的组成是由<span class=\"s1\">&lsquo;.&rsquo;</span>、<span class=\"s1\">&lsquo;@&rsquo;</span>和小写的拉丁字母，不以<span class=\"s1\">\'.\'</span>作为开头和结尾，也不以<span class=\"s1\">&lsquo;@&rsquo;</span>作为开头和结尾，而且邮箱地址中只会有一个<span class=\"s1\">&lsquo;@&rsquo;</span>，可以包含<span class=\"s1\">0</span>个或多个<span class=\"s1\">&lsquo;.&rsquo;</span>。</p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">&nbsp;</p>\n<p class=\"p1\">所以<span class=\"s1\">, </span>两种字符需要被替换，<span class=\"s1\">dot</span>被替换成<span class=\"s1\">&lsquo;.&rsquo; ; at </span>被替换成<span class=\"s1\">&lsquo;@&rsquo;</span>，替换的结果要尽可能的短，如果有多个长度相同的，选择按<span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">ASCII</span>字母排列顺序最小的那个。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入为邮箱地址的拼读字串。保证这是一个标准邮箱地址的拼读，所有的\'.\'都被换成dot，所有的&lsquo;@&rsquo;都被换成at。输入不为空且长度不超过100的字符串。</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">输出长度最短的邮箱地址，如果有几个长度相同的答案，选择按<span style=\"line-height: 19.6px;\">ASCII字母表排序最小的一个（</span><span style=\"line-height: 19.6px;\">按</span><span style=\"line-height: 19.6px;\">ASCII字母表比较可以使用</span><span style=\"line-height: 19.6px;\">&lt;来比对两个字符串</span><span style=\"line-height: 19.6px;\">）。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">ASCII 字母表的排位顺序为<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">. @ ab</span>...<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">z</span></p>','例子一：vasyaatgmaildotcom\n\n例子二：dotdotdotatdotdotat\n\n例子三：aatt','例子一：vasya@gmail.com\n\n例子二：dot..@..at\n\n例子三：a@t','0','<p>expression parsing、implementation</p>','','2016-07-20 15:53:08',2,256,'N',2,9,0),(10002,'Alyona and the Tree','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Alyona decided to go on a diet and went to the forest to get some apples. There she unexpectedly found a magic rooted tree with root in the vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>, every vertex and every edge of which has a number written on.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The girl noticed that some of the tree\'s vertices are&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">sad</span>, so she decided to play with them. Let\'s call vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em></span>&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">sad</span>&nbsp;if there is a vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>u</em></span>&nbsp;in subtree of vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em></span>&nbsp;such that&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>dist</em>(<em>v</em>,&thinsp;<em>u</em>)&thinsp;&gt;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>u</em></span></span>, where&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>u</em></span></span>&nbsp;is the number written on vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>u</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>dist</em>(<em>v</em>,&thinsp;<em>u</em>)</span>&nbsp;is the sum of the numbers written on the edges on the path from&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em></span>&nbsp;to&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>u</em></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span class=\"tex-font-style-it\" style=\"font-style: italic;\">Leaves</span>&nbsp;of a tree are vertices connected to a single vertex by a single edge, but the root of a tree is a&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">leaf</span>&nbsp;if and only if the tree consists of a single vertex&nbsp;&mdash; root.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Thus Alyona decided to remove some of tree leaves until there will be no any sad vertex left in the tree. What is the minimum number of leaves Alyona needs to remove?</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the first line of the input integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span>) is given&nbsp;&mdash; the number of vertices in the tree.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the second line the sequence of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>) is given, where&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;is the number written on vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The next&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em>&thinsp;-&thinsp;1</span>&nbsp;lines describe tree edges:&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em><span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><em>th</em></span></span>&nbsp;of them consists of two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>n</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;-&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>&thinsp;&le;&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>)</span>, meaning that there is an edge connecting vertices&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em>&thinsp;+&thinsp;1</span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;with number&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;written on it.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print the only integer&nbsp;&mdash; the minimum number of leaves Alyona needs to remove such that there will be no any sad vertex left in the tree.</span></p>','9\n88 22 83 14 95 91 98 53 11\n3 24\n7 -8\n1 67\n1 64\n9 65\n5 12\n6 -80\n3 8','5','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The following image represents possible process of removing leaves from the tree:</span></p>\n<p><img src=\"/data/10002/10002.png\" alt=\"\" />&nbsp;</p>\n<p>dfs and similar、dp、trees</p>\n<p><span style=\"font-family: verdana, arial, sans-serif; font-size: 17.5px; text-align: center;\">C 682</span></p>','','2016-07-21 01:04:34',1,256,'Y',NULL,0,0),(116,'老虎和仓鼠','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">一天马戏城要举办一场表演，仓鼠和老虎要在一起表演。他们围着舞台自由的围成了一圈。训练师遇到了一个难题，他想要交换动物的位置使得仓鼠站在一起，老虎站在一起。当训练师选出两个动物，交换它们的位置的时候，仓鼠很紧张，因为老虎很多而且离他们很近。所以训练师想要用尽可能少的交换，达成仓鼠老虎各站一边的目的。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输入第一行是个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;1000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) 表示舞台中动物的总数。输入第二行是动物位置的描述，由字母</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"H\" 和 \"T\" 表示，</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"H\" 代表仓鼠 \"T\"代表老虎。输入保证老虎仓鼠都至少有一只，动物们站成一个圈，最后一个动物和第一个动物紧挨着站着。</span></p>','<p>&nbsp;</p>\n<div class=\"output-specification\" style=\"margin: 0px 0px 1em; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">输出一个正整数，表示训练师需要动物换位的最少次数。</p>\n</div>','第一个例子：\n3\nHTH\n\n第二个例子：\n9\nHTHTHTHHT','第一个例子：0\n\n第二个例子：2','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一个例子不需要任何交换。第二个例子，交换第2和第5个动物位置，以及第9和第7个动物位置。</span></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">two pointers</span></p>','','2016-07-21 10:38:18',2,256,'N',1,7,0),(1030,'Toys','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Little Masha loves arranging her toys into piles on the floor. And she also hates it when somebody touches her toys. One day Masha arranged all her&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;toys into several piles and then her elder brother Sasha came and gathered all the piles into one. Having seen it, Masha got very upset and started crying. Sasha still can\'t calm Masha down and mom is going to come home soon and punish Sasha for having made Masha crying. That\'s why he decides to restore the piles\' arrangement. However, he doesn\'t remember at all the way the toys used to lie. Of course, Masha remembers it, but she can\'t talk yet and can only help Sasha by shouting happily when he arranges the toys in the way they used to lie. That means that Sasha will have to arrange the toys in every possible way until Masha recognizes the needed arrangement. The relative position of the piles and toys in every pile is irrelevant, that\'s why the two ways of arranging the toys are considered different if can be found two such toys that when arranged in the first way lie in one and the same pile and do not if arranged in the second way. Sasha is looking for the fastest way of trying all the ways because mom will come soon. With every action Sasha can take a toy from any pile and move it to any other pile (as a result a new pile may appear or the old one may disappear). Sasha wants to find the sequence of actions as a result of which all the pile arrangement variants will be tried exactly one time each. Help Sasha. As we remember, initially all the toys are located in one pile.</span></p>','<p>&nbsp;</p>\n<div class=\"input-specification\" style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">The first line contains an integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">n</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">n</em>&thinsp;&le;&thinsp;10</span>) &mdash; the number of toys.</p>\n</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In the first line print the number of different variants of arrangement of toys into piles. Then print all the ways of arranging toys into piles in the order in which Sasha should try them (i.e. every next way must result from the previous one through the operation described in the statement). Every way should be printed in the following format. In every pile the toys should be arranged in ascending order of the numbers. Then the piles should be sorted in ascending order of the numbers of the first toys there. Output every way on a single line. Cf. the example to specify the output data format. If the solution is not unique, output any of them.</span></p>','3','5\n{1,2,3}\n{1,2},{3}\n{1},{2,3}\n{1},{2},{3}\n{1,3},{2}','0','<p>brute force、combinatorics</p>\n<p>44I special judge</p>','','2016-07-21 13:04:51',5,256,'Y',NULL,0,0),(1031,'School','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">学校里有n个学生，每个学生只有一个朋友，每个人有新的消息就会打电话给他的朋友，定义<span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>g</em>(<em>i</em>) </span><span style=\"line-height: 1.4em;\">是学生</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 1.4em;\">&nbsp;</span><span style=\"line-height: 1.4em;\">的朋友，朋友关系不是互相的，也就是说</span><em>g</em><span>(</span><em>i</em><span>)</span><span style=\"line-height: 1.4em;\">&nbsp;</span><span style=\"line-height: 19.6px;\">的朋友&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>g</em>(<em>g</em>(<em>i</em>))</span><span style=\"line-height: 1.4em;\">&nbsp; 不是&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\">。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">在第<span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 19.6px;\">&nbsp;天，学生</span><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i </em></span><span style=\"line-height: 1.4em;\">得到价值为</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 1.4em;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&ge;&thinsp;1</span><span style=\"line-height: 1.4em;\">) 的消息。他打电话给他的朋友，此时这个消息的价值就变成</span><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span><span>&thinsp;-&thinsp;1。</span><span style=\"line-height: 1.4em;\">他的朋友也打电话把消息告诉了他的朋友，而消息的价值就变成</span><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span><span>&thinsp;-&thinsp;2，</span><span style=\"line-height: 1.4em;\">这种消息传递方式一直进行着直到消息的价值变成0。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Let us note that during a day one and the same person may call his friend and tell him one and the same news with different ratings. Thus, the news with the rating of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;will lead to as much as&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;calls.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Your task is to count the values of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>res</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;&mdash; how many students learned their first news on day&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The values of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;are known initially, whereas&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;is determined from the following formula:</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><em>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</em><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i&nbsp;</em></span><em>&nbsp;= ((</em><em style=\"line-height: 19.6px;\">v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i&nbsp;</em></span><em>+&nbsp;</em><em style=\"line-height: 19.6px;\">res</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span><em>&nbsp;-1) mod n) +1&nbsp;</em></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">where mod stands for the operation of taking the excess from the cleavage,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 21px;\"><em>res</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">0</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">&nbsp;is considered equal to zero and&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 21px;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">&nbsp;&mdash; some given integers.</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The first line contains two space-separated integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;and&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">2&thinsp;&le;&thinsp;<em>n</em>,&thinsp;<em>m</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; the number of students and the number of days. The second line contains&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;space-separated integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>g</em>(<em>i</em>)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>g</em>(<em>i</em>)&thinsp;&le;&thinsp;<em>n</em>,&thinsp;<em>g</em>(<em>i</em>)&thinsp;&ne;&thinsp;<em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; the number of a friend of the&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th student. The third line contains&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;space-separated integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">7</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">). The fourth line contains&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;space-separated integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">7</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">).</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;lines containing one number each. The&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th line should contain&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>res</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;&mdash; for what number of students the first news they\'ve learned over the&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;days in question, was the news number&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">. The number of the news is the number of the day on which it can be learned. The days are numbered starting from one in the order in which they are given in the input file. Don\'t output&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>res</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">0</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','3 4\n2 3 1\n1 2 3 4\n1 2 3 4\n\n8 6\n7 6 4 2 3 5 5 7\n10 4 3 8 9 1\n1 1 1 2 2 2','1\n1\n1\n0\n\n1\n1\n1\n2\n1\n1','0','<p>dp dsu</p>','B 45','2016-07-21 13:59:34',2,256,'Y',NULL,0,0),(1032,'导演撰名','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">保罗是一个导演，他知道去一个男主角的名字有多么重要。他列了一张有n个名和n个姓的表库。他可以接受任何名字和姓的匹配。他需要的全名显示格式如：\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\"><span class=\"tex-span\" style=\"font-size: 19.25px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>Name</em><span class=\"lower-index\" style=\"font-size: 14.4375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 19.25px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>Surname</em><span class=\"lower-index\" style=\"font-size: 14.4375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 19.25px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>Name</em><span class=\"lower-index\" style=\"font-size: 14.4375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 19.25px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>Surname</em><span class=\"lower-index\" style=\"font-size: 14.4375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 19.25px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">...</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 19.25px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>Name</em><span class=\"lower-index\" style=\"font-size: 14.4375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span><span class=\"tex-span\" style=\"font-size: 19.25px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>Surname</em><span class=\"lower-index\" style=\"font-size: 14.4375px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span></span>\", i.e. 所有全名间用&ldquo;，&rdquo;分割，名和姓之间空格分割。 所有名和姓都按照ASCII字母顺序选取，且都只能选择一次。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输入第一行为一个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;100</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 代表姓的数量和名的数量。接下来n行是名，在接下来n行是姓。输入保证2n个名和姓都不同。每一个名和姓都非空且长度不超过10的拉丁字母。</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">名和姓的</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一个字母是大写，其余字母都小写。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一行，按照全名的输出格式显示，最后一个名字后面没有&ldquo;，&rdquo;。</span></p>','4\nAnn\nAnna\nSabrina\nJohn\nPetrov\nIvanova\nStoltz\nAbacaba\n','Ann Abacaba, Anna Ivanova, John Petrov, Sabrina Stoltz','0','<p>constructive algorithms、greedy</p>','','2016-07-21 15:10:59',2,256,'N',1,2,0),(10003,'斑马和老虎','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">有一次法鲁西要带m头斑马和m头老虎尽快的过河。船只能载n头动物。在一个地方（岸的任意一边或船上）老虎的数量如果大于斑马的数量，那么老虎会吃了斑马，法鲁西会很难过</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;。当法鲁西划船过河时，如果船上没有动物，那么他会寂寞也会很难过。当船抵达河岸的时候，所有的动物先同时下船，然后法鲁西再选一些动物上船。</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;留下的动物不能被吃。所有如果要法鲁西不难过，他最少需要划船几次？&nbsp;</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输入第一行两个空格分隔的正整数</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>m</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>m</em>,&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 代表一种动物的数量和船的容量。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">如果不能把动物都安全送上岸，或者法鲁西难过 输出-1；否则输出一个正整数，代表法鲁西需要过河的次数。</span></p>','第一个例子：\n3 2\n\n第二个例子：\n33 3','第一个例子：\n11\n\n第二个例子：\n-1','0','<p>greedy</p>','','2016-07-21 20:18:38',2,256,'N',1,2,0),(1033,'停车位','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">在城市里停车是个大问题。假设有一条&nbsp;</span><em style=\"color: #222222;\">L&nbsp;</em><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">米长的停车道，每辆车需要严格靠停车线右测平行停放。一个司机要停车必须保证离后排车的距离不小于</span><em style=\"color: #222222;\">b</em><span style=\"color: #222222;\">米，</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">离前排车的距离不小于</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>f</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">米（如果前排或后排没有车，车可以贴停车道的起始和末尾边停放）。给车道引入坐标值，车道起始点为0，末尾点为L。</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;每辆车驶入的时候总是寻找坐标值最小的可停放的点，如果没有可停放的点，那么车就驶离车道。</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;有时候有些车会离开停车位，那么这个位置就空出来可供其他车停放。车道上不能同时行驶两辆车，编写一个程序模拟停车位的使用过程。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入三个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>L</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>b</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>f</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">10&thinsp;&le;&thinsp;<em>L</em>&thinsp;&le;&thinsp;100000,&thinsp;1&thinsp;&le;&thinsp;<em>b</em>,&thinsp;<em>f</em>&thinsp;&le;&thinsp;100</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">)。第二行输入输入是一个正整数</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;100</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) 表示对停车道的使用请求，每个请求的描述由接下来的n行输入表示，每行输入是两个正整数，第一个数字代表请求类型，如果是1，表示车驶入停车位，车的长度由第二个数字表示；第一个数字如果是2，表示有车驶离条车道，第二个数字表示一个请求序号，这个请求保证是之前发生过的车驶入请求。车的长度为从</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;到&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">的正整数。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出的内容对应的是所有类型为1的车驶入车道请求，输出一行-1 如果驶入的车找不到停车点，除此之外输出车尾部停的坐标点的值。</span></p>','第一个例子：\n30 1 2\n6\n1 5\n1 4\n1 5\n2 2\n1 5\n1 4\n第二个例子：\n30 1 1\n6\n1 5\n1 4\n1 5\n2 2\n1 5\n1 4\n第三个例子：\n10 1 1\n1\n1 12','第一个例子：\n0\n6\n11\n17\n23\n第二个例子：\n0\n6\n11\n17\n6\n第三个例子：\n-1','0','<p>data structures、implementation</p>','','2016-07-21 22:22:56',2,256,'N',1,1,0),(10005,'熊和监狱','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">有一个&nbsp;<em>n</em>&thinsp;&times;&thinsp;<em>n&nbsp;</em>的网格划分的监狱牢房，每个牢房要么是空的用&ldquo;.&rdquo;表示，要么被封了用&ldquo;X&rdquo;表示。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">两个空的紧挨着（有一边重合）的牢房是相连的。两个牢房&nbsp;&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>)</span>&nbsp;(第&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;行第and column&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>列） 和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>)</span>&nbsp;是联通的如果存在一串空的牢房从<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>)</span>开始， 到&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>)</span>结束，任意两个连续的牢房是相连的。相连的块就是一组空的牢房其中任意两个牢房是联通的。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">有一只大灰熊，他能摧毁任何牢房的墙，简单讲，你能选择一个<em>k</em>&thinsp;&times;&thinsp;<em>k</em><span style=\"line-height: 1.4em;\">的牢房区域，熊能打通这个牢房区域。但是你只有一次使用它的机会。被选中的</span><em>k</em>&thinsp;&times;&thinsp;<em>k</em><span style=\"line-height: 1.4em;\">区域一定是在整个网格中，也有可能熊不需要打通任何牢房如果所有牢房已经都是空的。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">你喜欢大的联通区域，请让熊帮你打开最大的联通区域。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">&nbsp;</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行输入两个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;500</span>)&nbsp;&mdash; 代表整个正方网格的边长大小和熊要打通的正方区域边长大小。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">接下来n行，每一行n个字符，每个字符要么是<span style=\"line-height: 19.6px;\">\'</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">.</span><span style=\"line-height: 19.6px;\">\'代表空的牢房，</span><span style=\"line-height: 1.4em;\">要么是</span><span style=\"line-height: 1.4em;\">&nbsp;\'</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">X</span><span style=\"line-height: 1.4em;\">\' 代表被封的牢房。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一个正整数，</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">代表熊打通</span><em>k</em>&thinsp;&times;&thinsp;<em>k&nbsp;</em><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">个牢房后能形成的最大联通区域里牢房的数量。</span></p>','5 2\n..XXX\nXX.XX\nX.XXX\nX...X\nXXXX.','10','0','<p><span style=\"color: #222222;\">比如熊能打通的区域大小是&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">2&thinsp;&times;&thinsp;2</span><span style=\"color: #222222;\">. 打通下图中红色边框的牢房，那么就能得到10个标记为蓝色的联通牢房</span></p>\n<p><img src=\"/data/10005/10005.png\" alt=\"\" /></p>\n<p>dfs and similar、dsu、implementation</p>','','2016-07-21 23:39:20',3,256,'N',3,3,0),(1034,'LRU','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">While creating high loaded systems one should pay a special attention to caching. This problem will be about one of the most popular caching algorithms called LRU (Least Recently Used).</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Suppose the cache may store no more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;objects. At the beginning of the workflow the cache is empty. When some object is queried we check if it is present in the cache and move it here if it\'s not. If there are more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;objects in the cache after this, the least recently used one should be removed. In other words, we remove the object that has the smallest time of the last query.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Consider there are&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;videos being stored on the server, all of the same size. Cache can store no more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;videos and caching algorithm described above is applied. We know that any time a user enters the server he pick the video&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>&nbsp;with probability&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>. The choice of the video is independent to any events before.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The goal of this problem is to count for each of the videos the probability it will be present in the cache after&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">100</span></span>&nbsp;queries.</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The first line of the input contains two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;20</span>)&nbsp;&mdash; the number of videos and the size of the cache respectively. Next line contains&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;real numbers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;1</span>), each of them is given with no more than two digits after decimal point.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">It\'s guaranteed that the sum of all&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;is equal to&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>.</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">Print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>n</em></span>&nbsp;real numbers, the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>i</em></span>-th of them should be equal to the probability that the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>i</em></span>-th video will be present in the cache after&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">100</span></span>&nbsp;queries. You answer will be considered correct if its absolute or relative error does not exceed&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">&thinsp;-&thinsp;6</span></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; color: #222222;\"><span style=\"font-size: 14px; line-height: 1.4em;\">Namely: let\'s assume that your answer is&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; line-height: 1.4em;\"><em>a</em></span><span style=\"font-size: 14px; line-height: 1.4em;\">, and the answer of the jury is&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; line-height: 1.4em;\"><em>b</em></span><span style=\"font-size: 14px; line-height: 1.4em;\">. The checker program will consider your answer correct, &nbsp; if &nbsp;|a-b|/max(1,b) &lt;= &nbsp;</span>10<span class=\"upper-index\">-6</span></p>','sample 1:\n3 1\n0.3 0.2 0.5\n\nsample 2:\n2 1\n0.0 1.0\n\nsample 3:\n3 2\n0.3 0.2 0.5\n\nsample 4:\n3 3\n0.2 0.3 0.5','sample1: 0.3 0.2 0.5\nsample2: 0.0 1.0 \nsample3: 0.675 0.4857142857142857 0.8392857142857143\nsample4: 1.0 1.0 1.0 ','1','<p>bitmasks、dp、probabilityes</p>','','2016-07-22 11:44:27',2,256,'Y',NULL,0,0),(1035,'子集','<div class=\"input-specification\" style=\"margin: 0px; padding: 0px; color: #222222;\">&nbsp;</div>\n<div style=\"margin: 0px; padding: 0px; color: #222222;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">程序员璐璐最近开始学习数据结构。老师给了她一个任务，在一组固定数量的数字集合里找出只出现一次的最大的数。请帮璐璐找到这个数。</p>\n</div>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行包含两个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span>,&thinsp;1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;<em>n</em></span>) &mdash; 分别代表数组里所有元素的个数，和子集里元素的个数。&nbsp;</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">接下来n行：第&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th 行包含一个正整数 <span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;-&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>).</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em>&ndash;<em>k</em>&thinsp;+&thinsp;1</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;个数，每个数一行: 第&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th 行的数表示子集</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>&thinsp;+&thinsp;1</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;&hellip;&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>&thinsp;+&thinsp;<em>k</em>&thinsp;-&thinsp;1</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">里最大的一个数，且这个数只出现一次。如果不存这个数，输出 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Nothing</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"。</span></p>','第一个例子：\n5 3\n1\n2\n2\n3\n3\n第二个例子：\n6 4\n3\n3\n3\n4\n4\n2','第一个例子：\n1\n3\n2\n\n第二个例子：\n4\nNothing\n3','0','<p>data structures、implementation</p>','','2016-07-22 15:19:38',1,256,'N',3,3,0),(1036,'移动点','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Anton 和 Dasha 喜欢玩方格纸。Vova 推荐他们玩一种称之为&ldquo;dot&rdquo;的新游戏，规则如下：</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">方格纸上画了一个坐标系。一个点初始位置为&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>x</em>,&thinsp;<em>y</em>)</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">每一步点的移动是由向量控制的，向量在游戏中是给定的，每个玩家每局游戏还可以使用一次将点对着直线 y=x对称反射的操作。</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">Anton 和&nbsp;Dasha 每次轮流。Anton 先手。</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">当玩家把点移动到一个坐标点相对原点距离大于d的时候就输了。</li>\n</ul>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">请帮助他们找到胜利者。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入4个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>x</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>y</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>d</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">&thinsp;-&thinsp;200&thinsp;&le;&thinsp;<em>x</em>,&thinsp;<em>y</em>&thinsp;&le;&thinsp;200,&thinsp;1&thinsp;&le;&thinsp;<em>d</em>&thinsp;&le;&thinsp;200,&thinsp;1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;20</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 点的初始坐标，向量的数量和判断游戏胜负的距离。输入保证初始点相对原点的距离大于d。接下来n行是两个非负正整数</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;和&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">0&thinsp;&le;&thinsp;<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;200</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; 代表玩家可以选择的移动向量，输入保证所有向量非0且都是不同的。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">假设两个玩家的玩法没有任何失误，输出 \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Anton</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\",如果Anton赢得比赛，反之输出\"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Dasha</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"&nbsp;。</span></p>','第一个例子：\n0 0 2 3\n1 1\n1 2\n\n第二个例子：\n0 0 2 4\n1 1\n1 2','第一个例子：\nAnton\n\n第二个例子：\nDasha','0','<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一个例子, Anton 先手将点移动到 (1,2), Dasha 就输了. 第二个例子，Dasha在第二步的时候能将点移动到 (2，3), Anton 就输了, 这个时候Antona唯一的选择是对着直线&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: &quot;times new roman&quot;, sans-serif; white-space: nowrap; color: rgb(34, 34, 34); line-height: 19.6px;\"><em>y</em>&thinsp;=&thinsp;<em>x </em></span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">做映射， Dasha 接下来也可以用相同的做法将点再移回(2，3)。</span></p>\n<p>dp、games</p>','','2016-07-22 17:03:50',3,256,'N',1,1,0),(1037,'哈利波特和分院帽','<p>&nbsp;</p>\n<div style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">我们知道<span style=\"color: #333333; font-family: arial; font-size: 13px; line-height: 20.02px;\">霍格沃兹魔法学校有四个学院</span><span style=\"font-size: 1em; line-height: 1.4em;\">: Gryffindor, Hufflepuff, Ravenclaw 和 Slytherin. 魔法学员会在第一年被分到四个不同学院。学生按项目字母顺序被安排带上分院帽，结果沉思后，帽子会庄严宣布学生要进入的学院名&nbsp;。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">帽子会根据学生的综合素质: 勇敢和高尚的学生被送到Gryffindor, 聪明和精明的学生被送到Ravenclaw, 坚韧和诚实的学生被送到Hufflepuff，奸诈和阴险的学生被送到Slytherin。然而，一年级学生Hermione Granger 十分担心接下来的分院过程，她研究的分院帽的分院机制，发现远比想象的要简单。如果该学生的亲戚已经在<span style=\"color: #333333; font-family: arial; font-size: 13px; line-height: 20.02px;\">霍格沃兹魔法学校学习，那么这个学生会被送到他亲戚所在学院。在极端情况，如果这些亲戚在不同学院学习或者像</span><span style=\"line-height: 19.6px;\">Hermione父母那样不在学院学习，那么学生会被分派到当前被分派学员最少的学院，如果有几个学院拥有一样少的学员，那么这个学生可以从这些学院中挑一个自己想去的。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">Hermione 已经询问了名字顺序在她前面的所有学生的亲属所在学院，现在她和她的朋友Harry Potter 和 Ron Weasley 想推算出她能进那个学院。</p>\n</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入一个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">). 名字排名在Hermione前面的学生个数.第二行是由n个字符组成的字符串，如果第</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th个学生的所有亲属都在一个学院学习，那么第</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th 字符就是该学院名字的开头字母，否则</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>i</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">-th 字符就是</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;\"?\".</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出所有 Hermione 可能被送进的学院。学院名字排序根据开头字母顺序，每个名字占一行。&nbsp;</span></p>','第一个例子：\n11\nG????SS???H\n\n第二个例子：\n2\nH?','第一个例子：\nGryffindor\nRavenclaw\n\n第二个例子：\nGryffindor\nRavenclaw\nSlytherin','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">在第二个例子中，只有两个学生在 Hermione前面。第一个学生被送到了 Hufflepuff. 第二个学生从学员最少的学院中选择一个，分别为：Gryffindor, Slytherin and Ravenclaw. 如果他选择 Gryffindor, 那么Hermione 只能选择 Ravenclaw 或 Slytherin, 如果他选择Ravenclaw, 那么Hermione 将选择 Gryffindor 或 Slytherin, 如果他选择 Slytherin, 那么Hermione 将选择 Gryffindor 或 Ravenclaw. 最终，可能的情况会是1) in Gryffindor, 2) in Ravenclaw, 3) in Slytherin。</span></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">brute force、dfs and similar、hashing</span></p>','','2016-07-23 01:53:52',2,256,'N',1,1,0),(1038,'僵尸脑生长','<p>&nbsp;</p>\n<div style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">关于僵尸脑子的研究有了新的进展。每个僵尸是由一个脑子生长出来的，之后脑子再进化成更复杂的结构。实际，只要僵尸吃一个脑子，就会长出一个新的脑子，新的脑子会和任意一个老的脑子通过一根脑连接器连在一起，形成一个新的脑网络。研究员想要监测僵尸脑延迟（任意两个脑子间最长需要的脑连接数），写一个程序模拟僵尸脑神经系统进化过程，计算每一阶段的脑延迟。</p>\n</div>','<p>&nbsp;<span style=\"color: #222222;\">第一行输入一个正整数，表示最终神经系统的脑子数</span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px;\">2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;200000</span>)。<span style=\"color: #222222;\">第二行输入开始是脑子的进化过程，根据每个脑子生长顺序给脑子编号</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">1,&thinsp;2,&thinsp;...,&thinsp;<em>n</em></span>&nbsp;(<span style=\"color: #222222;\">僵尸是由一个脑子开始进化的，第一个脑子是 1，顺序的后面生长出的脑子是</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">2,&thinsp;3,&thinsp;...,&thinsp;<em>n</em></span>&nbsp;)。 之后&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>n</em>&thinsp;-&thinsp;1</span>&nbsp;行，每一行一个正整数&nbsp;<em style=\"color: #222222;\">p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em; color: #222222;\">k ,</span>表示第k个脑子加入脑神经，和它接入的脑子是<em style=\"color: #222222;\">p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em; color: #222222;\">k，</span><span class=\"lower-index\"><em style=\"color: #222222; font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em; color: #222222; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">k</span><em>&nbsp;</em></span><span style=\"color: #333333; font-family: arial; font-size: 13px; line-height: 20.02px;\">&isin; </span><span style=\"line-height: 21px;\">{1,2,...,k-1}。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em>&thinsp;-&thinsp;1</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;个正整数，由空格分隔，每个正整数表示第k个脑子加入后，大脑延迟数的值，</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px;\">k</em><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px;\">&thinsp;=&thinsp;2,&thinsp;3,&thinsp;...,&thinsp;</span></span><em><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px;\">n</span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px;\">。</span></span></em></span></p>','6\n1\n2\n2\n1\n5','1 2 2 3 4','0','<p>trees</p>','','2016-07-23 14:24:22',2,256,'N',1,1,0),(10006,'航海最短距离','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">你有一个新工作，很有趣，你是船船长。你的第一个任务是将船从一个点移到另一个点，而且要花费最小的成本。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">众所周知，两点间最短的距离是连接两点的线段。很遗憾，有时两个点之间有一座岛，船不能直线行驶。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">你只能将船行驶到安全点上，安全点的定义为连接两个目标点的线段上的点或者是岛的边界。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">但你很幸运，你拥有一些聪明而强壮的工人能帮助你，他们能帮你以1英镑每单元距离的成本在海中行驶；能以2英镑每单元距离在岛上推着船（他们非常强壮）移动。钱会被所有工人评分，所以工人的数量不在考虑范围内。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">现在你有一张地图，你要花最少的费用完成航行，你从点(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>xStart</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>yStart</em></span>)开始，结束点为 (<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>xEnd</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>yEnd</em></span>)，两个点是不同的。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">岛是一个凸多边形形状，不存在2个以上的顶点在一条直线上，同样开始点和结束点不会在多边形内或边上，多边形的点会以逆时针的方向排序。</p>','<p>&nbsp;第一行输入4个正整数,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">xStart</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">yStart</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">xEnd</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">yEnd</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;-&thinsp;100&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">xStart</em>,&thinsp;<em style=\"font-style: italic;\">yStart</em>,&thinsp;<em style=\"font-style: italic;\">xEnd</em>,&thinsp;<em style=\"font-style: italic;\">yEnd</em>&thinsp;&le;&thinsp;100</span>). 第二行是一个正整数<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">n</em></span>, 代表多边形的顶点数(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">3&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">n</em>&thinsp;&le;&thinsp;30</span>), 第三行输入是&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">n</em></span>&nbsp;对正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">x</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">y&nbsp;</em></span>坐标点 (<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;-&thinsp;100&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">x</em>,&thinsp;<em style=\"font-style: italic;\">y</em>&thinsp;&le;&thinsp;100</span>), 所有的点两两不同。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一个数，代表所花费的最小费用，该数精确到小数点后9位。</span></p>','第一个例子：\n1 7 6 7\n4\n4 2 4 12 3 12 3 2\n\n第二个例子：\n-1 0 2 0\n4\n0 0 1 0 1 1 0 1','第一个例子：\n6.000000000\n\n第二个例子：\n3.000000000','0','<p>geometry、shortest paths</p>','','2016-07-23 17:52:08',2,256,'N',1,4,0),(10007,'基因突变','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">科学家对奥林匹亚星球的基本生物基因做了深入的研究，发现该星球的生物基因可由前K个英文字母表示。对每组基因对<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>,&thinsp;<em>j</em></span></span>&nbsp;&mdash; 表示两种基因元素相邻出现在基因里会引起致病基因的风险指数，<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>&nbsp;&mdash; 代表第一个基因元素的序号，&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>j</em></span>&nbsp;&mdash;&nbsp;<span style=\"line-height: 19.6px;\">代表第二个基因元素的序号</span>. 基因元素 \'A\' 的序号是 1, \'B\' 的序号是 2 ，以此类推。 比如,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3,&thinsp;2</span></span>&nbsp;代表基因片段 \'CB\' 的<span style=\"line-height: 19.6px;\">致病风险指数</span><span style=\"line-height: 1.4em;\">. 生物的的</span><span style=\"line-height: 19.6px;\">致病风险指数是所有相邻基因元素的致病风险指数的总和。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">科学家已经获得了一串基因，对这个基因做突变实验，突变的过程是移除其中的一些基因元素，突变会引起新的额外的致病风险。对每种移除的基因元素，科学家定义&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;&mdash; 表示移除所有基因元素&nbsp;<em>i</em>&nbsp;后增加的致病风险指数。比如,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">4</span></span>&nbsp;代表移除基因元素<span style=\"line-height: 19.6px;\">\'D\'后增加的</span><span style=\"line-height: 19.6px;\">致病风险指数。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">科学家们想从一个基本基因中发现一些不同的基因，这些基因的<span style=\"line-height: 19.6px;\">致病风险指数不高于</span><span style=\"line-height: 1.4em;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>T</em></span><span style=\"line-height: 1.4em;\">. 科学家门只使用上述基因突变的方式获取新基因。只要代表基因类型的字符组成的字符串是不同的，两种基因就不同，每个基因至少包含一个基因元素。</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行输入有三个正整数<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>N</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>N</em>&thinsp;&le;&thinsp;200&thinsp;000</span>) &mdash; 代表基因字符串总长度,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>K</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>K</em>&thinsp;&le;&thinsp;22</span>) &mdash; 基因元素种类的个数，&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>T</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>T</em>&thinsp;&le;&thinsp;2&middot;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>) &mdash; 允许的最大的致病风险指数。第二行输入生物的基因字串，由<em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">K</em>各英文字母组成的长度为<em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">N</em><span style=\"line-height: 1.4em;\">。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第三行是&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>K</em></span>&nbsp;个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>K</em></span></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;是移除所有种类为<span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 19.6px;\">-th 的基因元素后，增加的致病风险指数。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">接下来&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>K</em></span>&nbsp;行是一个矩阵，每个矩阵元素由<em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em>,&thinsp;<em>j</em></span><span style=\"line-height: 1.4em;\">表示。</span><span style=\"line-height: 1.4em;\">第&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 1.4em;\">-th 行有&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>K</em></span><span style=\"line-height: 1.4em;\">&nbsp;可正整数. 第&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>j</em></span><span style=\"line-height: 1.4em;\">-th 列第&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 1.4em;\">-th 行的值代表（i,j）基因元素对的</span><span style=\"line-height: 19.6px;\">致病风险指数，矩阵不一定是对称矩阵。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">所有的输入都是正整数, 没有负数，所有的数除了<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>T</em></span>&nbsp;没有大于<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>的。输入保证计算得出的任何生物<span style=\"line-height: 19.6px;\">致病风险指数小于</span><span style=\"line-height: 1.4em;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">31</span></span><span style=\"line-height: 1.4em;\">.</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出满足</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">致病风险指数小于&nbsp;</span><em style=\"color: rgb(34, 34, 34); font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">T&nbsp;</em><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">的所有突变基因的个数。</span></p>','5 3 13\nBACAC\n4 1 2\n1 2 3\n2 3 4\n3 4 10','5','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">满足条件的所有的突变基因，括号里的值为致病风险指数</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">: BACAC (11), ACAC (10), BAA (5), B (6), AA (4)。</span></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">bitmasks、dp、math</span></p>','','2016-07-24 15:30:24',3,256,'N',1,1,0),(1039,'城堡密码','<p>&nbsp;</p>\n<div style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">凯尔在一座城堡前，进入城堡需要密码，这个密码有点特别。</p>\n<p style=\"margin: 0px 0px 1em !important; padding: 0px; font-size: 1em; line-height: 1.4em;\">密码输入设备是一个&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&times;&thinsp;<em style=\"font-style: italic;\">n</em></span>&nbsp;的长方形器件，有n个槽，从左到右标记为1到n。每个槽有ON 和 OFF 两个状态。初始状态都为OFF，凯尔只有把 第&nbsp;<em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>-th,&nbsp;<em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>-th,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">...</span>,&nbsp;<em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">k</span>-th 个位置的槽设为ON，其他槽为OFF&nbsp;。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">凯尔被给到一个数组&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">a</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</sub></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">...</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">a</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">l</em></sub></span>。每一步操作,他先挑选&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">i</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">i</em>&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">l</em></span>), 然后选择&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">a</em><sub class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em style=\"font-style: italic;\">i</em></sub></span>&nbsp;个连续的槽, 切换这些槽的状态 (i.e. ON<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&rarr;&thinsp;</span>OFF, OFF<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&rarr;&thinsp;</span>ON).</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">凯尔只能通过上述的操作才能打开锁，请问他至少需要几步操作才能打开锁。</p>\n</div>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行输入3个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10000,&thinsp;1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;10,&thinsp;1&thinsp;&le;&thinsp;<em>l</em>&thinsp;&le;&thinsp;100</span>), 空格分隔。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第二行输入&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;个正整数<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>, ...,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;&lt;&thinsp;<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;&lt;&thinsp;...&thinsp;&lt;&thinsp;<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>k</em></span>&thinsp;&le;&thinsp;<em>n</em></span>),&nbsp;<span style=\"line-height: 19.6px;\">空格分隔。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第三行输入&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em></span>&nbsp;个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>, ...,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>n</em></span>),<span style=\"line-height: 19.6px;\">空格分隔。</span>一些&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;元素有可能重复。</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出打开锁需要的最少的操作步骤，输出-1如果不可能打开锁。</span></p>','第一个例子：\n10 8 2\n1 2 3 5 6 7 8 9\n3 5\n\n第二个例子：\n3 2 1\n1 2\n3','第一个例子：\n2\n\n第二个例子：\n-1','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一个例子中，第一步: 选择 1st, 2nd, 3rd 个槽，切换状态；第二步，选择5th, 6th, 7th, 8th, 9th 个槽，切换状态。</span></p>\n<p>&nbsp;</p>\n<p>bitmasks、dp、shortest path</p>','','2016-07-24 17:46:22',1,256,'N',1,1,0),(10008,'紧急撤离','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">在一个核反应推研究站里有一个核反应实验失控，即将爆炸。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"line-height: 19.6px;\">研究站划分了</span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em>&thinsp;&times;&thinsp;<em>n</em></span>&nbsp;个房间，每间&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&times;&thinsp;1</span>&nbsp;大小. 每个房间要么用作实验室，要么用作存放反应堆机器，研究站可能有几个反应堆机器，但只有一个会爆炸。反应堆房间是封闭的，人不能通过，但是人可以通过实验室，每两个相邻（有共同的一条边）的实验室间有一个过道，可以过人。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">在每个实验室里有一些科学家和一些救生胶囊。科学家躲到胶囊里就能得救，一个胶囊只能藏一个科学家。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">即将爆炸的反应堆，正流出一种有毒、带有放射性的液体，流向相邻的房间里，一旦房间有放射性液体，就被感染了。液体通过过道。感染一个实验室的时间为一分钟。假设此刻一个房间被感染了，那么下一分钟，和它相邻的实验室也被感染。<span style=\"line-height: 19.6px;\">反应堆房间是封闭的，不会感染液体，也不会扩散液体。一旦实验室被感染，那么实验室里没有躲进胶囊的科学家就会身亡。</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">离爆炸有足足&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;分钟时间。每个科学家需要一分钟通过过道进入另一个没有被感染的相邻实验室，每个过道可以双向的走任意个人。科学家在房间里移动的时间和进入胶囊的时间可以不计。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">计算出能得救的最多的科学家人数。</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">第一行输入两个正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;和&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>t</em>&thinsp;&le;&thinsp;60</span>)。接着n行，每行n个字符，这n行表示科学家位置的分布。接着一行空行。再接着n行，每行n个字符，这n行表示胶囊的位置。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">在两个坐标矩阵里字符\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">Y</span>\"表示正常工作的反应堆，\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">Z</span>\" 表示损坏且失去控制的反应堆。两个坐标矩阵里所有反应堆房间的描述是一样的，只有一个损坏的反应堆。数字 \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">0</span>\" - \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">9</span>\" 代表是实验室，在第一个矩阵里数字代表这个实验室里的科学家人数，<span style=\"line-height: 19.6px;\">在第二个矩阵里数字代表这个实验室里的胶囊的数量。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">输出一个正整数，代表做多能得救的科学家数量。</span></p>','第一个例子：\n3 3\n1YZ\n1YY\n100\n\n0YZ\n0YY\n003\n\n第二个例子：\n4 4\nY110\n1Y1Z\n1Y0Y\n0100\n\nY001\n0Y0Z\n0Y0Y\n0005','第一个例子：\n2\n\n第二个例子：\n3','0','<p><span style=\"color: #222222;\">In the second sample the events could take place as follows:</span></p>\n<p><span style=\"color: #222222;\"><img src=\"/data/10008/10008.png\" alt=\"\" /></span></p>\n<p>flows、graphs、shortest paths</p>','','2016-07-25 00:48:10',1,256,'N',1,2,0),(1040,'成绩平均分','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">教育改革后，学生需要学习两门课，理学和文学。结果几年的学习，小明得到了n个不同学期的成绩。老师在考评成绩的时候，不会记录具体课程的成绩，只记录一个平均总成绩。</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">现在小明要把每个成绩都给严格的父母看，父母只知道有a个理学成绩和b个文学成绩(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em>&thinsp;+&thinsp;<em>b</em>&thinsp;=&thinsp;<em>n</em></span>)。小明想要最大化平均总成绩<em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><span style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">&thinsp;+&thinsp;</span><em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span><span style=\"line-height: 1.4em;\">，其中</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span><span style=\"line-height: 19.6px;\">&nbsp;是理学的平均成绩，</span><em style=\"font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span><span style=\"line-height: 19.6px;\">是文学的平均成绩，所以小明要决定哪些成绩属于理学，哪些成绩属于文学。</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">第一行输入一个正整数&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">),&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;代表总共的成绩数量。第二行输入两个正整数&nbsp;</span><em style=\"color: rgb(34, 34, 34); font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">a</em><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">（</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">理学成绩数量），</span><em style=\"color: rgb(34, 34, 34); font-family: &quot;times new roman&quot;, sans-serif; font-size: 17.5px; line-height: 19.6px; white-space: nowrap;\">b</em><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">（文学成绩数量）</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>a</em>,&thinsp;<em>b</em>&thinsp;&le;&thinsp;<em>n</em>&thinsp;-&thinsp;1,&thinsp;<em>a</em>&thinsp;+&thinsp;<em>b</em>&thinsp;=&thinsp;<em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">)。第三行输入一个正整数序列&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>t</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;5</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">), 代表每一们课的成绩。</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">输出一行正整数&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>f</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>f</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>f</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n&nbsp;</em></span></span>, &nbsp;&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>f</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>f</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;2</span>) 代表第&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th 个成绩所属的学科分类（1代表理学，2代表文学）如果有几个结果，输出ASCII顺序最小的那个序列。&nbsp;</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px; line-height: 1.4em;\">序列&nbsp;</span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px; line-height: 1.4em;\">&nbsp;</span></span><span style=\"line-height: 19.6px;\">ASCII顺序</span><span style=\"line-height: 1.4em;\">小于</span><span style=\"line-height: 1.4em;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>q</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>q</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>q</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span><span style=\"line-height: 1.4em;\">&nbsp;的定义为，如果存在 &nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>j</em></span><span style=\"line-height: 1.4em;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>j</em>&thinsp;&le;&thinsp;<em>n</em></span><span style=\"line-height: 1.4em;\">) ，&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;=&thinsp;<em>q</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 1.4em;\">&nbsp;，那么所有&nbsp;</span><span class=\"tex-span\"><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px; line-height: 1.4em; white-space: nowrap;\">1&thinsp;&le;&thinsp;</span></span><em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 1.4em; white-space: nowrap;\">i</em><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px; line-height: 1.4em; white-space: nowrap;\">&thinsp;&lt;&thinsp;</span></span><em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 1.4em; white-space: nowrap;\">j</em><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px; line-height: 19.6px;\">时，</span></span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 1.4em;\">p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>j</em></span><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 17.5px; line-height: 1.4em;\">&thinsp;&lt;&thinsp;</span></span><em style=\"font-family: \'times new roman\', sans-serif; font-size: 17.5px; line-height: 1.4em;\">q</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em><span style=\"font-family: \'times new roman\', sans-serif;\"><span style=\"font-size: 13.125px; line-height: 0;\">j</span></span><span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"font-size: 14px; line-height: 19.6px;\">。</span></span></em></span></span></p>','第一个例子：\n5\n3 2\n4 4 5 4 4\n\n第二个例子：\n4\n2 2\n3 5 4 5\n\n第三个例子：\n6\n1 5\n4 4 4 5 4 4','第一个例子：\n1 1 2 1 2\n\n第二个例子：\n1 1 2 2\n\n第三个例子：\n2 2 2 1 2 2','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In the first sample the average score in the first subject is equal to 4, and in the second one &mdash; to 4.5. The total average score is 8.5.</span></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">math、sorting</span></p>','','2016-07-25 13:16:51',