m.in);\n		primeFactors(scan.nextInt());\n		\n		for (Integer i : keys) {\n			buffer.append(i+\"(\"+factors.get(i)+\")\");\n		}\n		\n		System.out.println(buffer.toString());\n\n	}\n\n}'),(1013,'import java.util.Scanner;\n\npublic class Main {\n   \n	static int N;\n	static int K;\n	public static void main(String[] args) {\n		Scanner scan = new Scanner(System.in);\n		N = scan.nextInt();\n		K = scan.nextInt();\n		\n		int survior = 1;\n		for(int i=2;i<=N;i++){\n			survior = (survior+K)%i;\n			if(survior == 0)//the i-th position\n				survior = i;\n		}\n		System.out.print(survior);\n	}\n    \n}'),(1014,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		// TODO Auto-generated method stub\n		ArrayList<String> results = new ArrayList<String>();\n		Scanner scan = new Scanner(System.in);// 接收控制台输入的信息\n		while(scan.hasNext()){\n			int day = scan.nextInt();\n			if(day==0)\n				break;\n			int dMoney = getDailyMoney(day);\n			int money =0;\n			for(int i=1;i<=dMoney;i++){\n				money+=i*i;\n			}\n			money+=(day-dMoney*(dMoney+1)/2)*(dMoney+1);\n			results.add(day+\" \"+money);\n		}\n		\n		for(int i=0;i<results.size()-1;i++){\n			System.out.println(results.get(i));\n		}\n		System.out.print(results.get(results.size()-1));\n	}\n    \n	static int getDailyMoney(int day){\n		int num = day*2;\n		int money = (int)Math.pow(num,0.5);\n		if(money*(money+1)>num)\n			return money-1;\n		return money;\n	}\n}'),(1015,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	static ArrayList<Integer> results = new ArrayList<Integer>();\n\n	public static void main(String argv[]) {\n\n		Scanner scan = new Scanner(System.in);\n		while (scan.hasNext()) {\n			String str = scan.nextLine();\n			try {\n				String[] pairs = str.split(\" \");\n				if (pairs == null || pairs.length != 2) {\n					break;\n				}\n				results.add(getLengthOfN(Integer.valueOf(pairs[0]), Integer.valueOf(pairs[1])));\n\n			} catch (NumberFormatException e) {\n				break;\n			}\n		}\n		scan.close();\n\n		for (int i = 0; i < results.size(); i++) {\n			System.out.println(results.get(i));\n		}\n\n	}\n\n	public static int gys(int a, int b) // gongyueshu\n	{\n		if (a == 0)\n			return b;\n		return gys(b % a, a);\n	}\n\n	public static int getLengthOfN(int n, int k) {\n		int temp = gys(n, k);\n		k = k / temp;\n		if (((k & 1) == 0) || ((k % 5) == 0)) {\n			return 0;\n		}\n\n		n = n / temp;\n		int c = 0, i = 0;\n		do {\n			c = (c * 10 + 1) % k;\n			i++;\n		} while (c != 0);\n		return i;\n	}\n}\n'),(1016,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) throws Exception {\n\n		Scanner scan = new Scanner(System.in);\n		String line = scan.nextLine();\n		int testCases = Integer.parseInt(line);\n\n		line = scan.nextLine(); // read the empty line\n\n		while (testCases-- > 0) {\n\n			line = scan.nextLine();\n			if (line.length() == 0) {\n				testCases++;\n				continue;\n			}\n\n			int n = Integer.parseInt(line);\n			String[] names = new String[n];\n\n			for (int i = 0; i < n; i++)\n				names[i] = scan.nextLine();\n\n			ArrayList<Integer[]> results = new ArrayList<Integer[]>();\n\n			while (true) {\n\n				line = scan.nextLine();\n				if (line == null || line.length() == 0)\n					break;\n\n				line = line.trim();\n				Integer[] ballot = new Integer[n];\n\n				String[] parts = line.split(\"\\\\s+\");\n\n				for (int i = 0; i < parts.length; i++)\n					ballot[i] = Integer.parseInt(parts[i]) - 1;\n\n				results.add(ballot);\n\n			}\n\n			Boolean[] blacklist = new Boolean[n];\n			for (int i = 0; i < n; i++) {\n				blacklist[i] = false;\n			}\n\n			ArrayList<Integer> winners = new ArrayList<Integer>();\n\n			while (true) {\n\n				Integer[] sum = new Integer[n];\n				for (int i = 0; i < n; i++)\n					sum[i] = 0;\n\n				int max = 0;\n				int maxChoice = -1;\n\n				for (int i = 0; i < results.size(); i++) {\n					Integer[] r = results.get(i);\n					int choice = -1;\n					for (int j = 0; j < n; j++) {\n						if (!blacklist[r[j]]) {\n							choice = r[j];\n							break;\n						}\n					}\n\n					sum[choice]++;\n					if (sum[choice] > max) {\n						max = sum[choice];\n						maxChoice = choice;\n					}\n				}\n\n				if (max * 2 > results.size()) {\n					winners.add(maxChoice);\n					break;\n				} else {\n\n					int min = results.size();\n					for (int i = 0; i < n; i++) {\n						if (!blacklist[i] && (sum[i] < min))\n							min = sum[i];\n					}\n\n					for (int i = 0; i < n; i++) {\n						if ((!blacklist[i]) && (sum[i] == min)) {\n							if (min == max) {\n								winners.add(i);\n							} else {\n								blacklist[i] = true;\n							}\n						}\n					}\n\n					if (min == max)\n						break;\n\n				}\n\n			}\n\n			for (int i = 0; i < winners.size(); i++) {\n				System.out.println(names[winners.get(i)]);\n			}\n\n			if (testCases > 0)\n				System.out.println();\n\n		}\n\n	}\n\n}\n'),(1017,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) throws Exception {\n\n		Scanner scan = new Scanner(System.in);// 接收控制台输入的信息\n		String line = scan.nextLine();\n		int testCases = Integer.parseInt(line);\n\n		line = scan.nextLine(); // read the empty line\n\n		while (testCases-- > 0) {\n\n			line = scan.nextLine();\n			if (line.length() == 0) {\n				testCases++;\n				continue;\n			}\n\n			int n = Integer.parseInt(line);\n			String[] names = new String[n];\n\n			for (int i = 0; i < n; i++)\n				names[i] = scan.nextLine();\n\n			ArrayList<Integer[]> results = new ArrayList<Integer[]>();\n\n			while (true) {\n                if(!scan.hasNext())\n                	break;\n				line = scan.nextLine();\n				if (line == null || line.length() == 0)\n					break;\n\n				line = line.trim();\n				Integer[] ballot = new Integer[n];\n\n				String[] parts = line.split(\"\\\\s+\");\n\n				for (int i = 0; i < parts.length; i++)\n					ballot[i] = Integer.parseInt(parts[i]) - 1;\n\n				resu