;\n			buildCom(scan, m, inLines, inNums);\n\n			System.out.print(\"Run #\");\n			System.out.print(run);\n			System.out.print(\": \");\n\n			if (goodLines.toString().compareTo(inLines.toString()) == 0) {\n				System.out.println(\"Accepted\");\n			} else if (goodNums.toString().compareTo(inNums.toString()) == 0) {\n				System.out.println(\"Presentation Error\");\n			} else {\n				System.out.println(\"Wrong Answer\");\n			}\n\n		}\n\n	}\n\n	static void buildCom(Scanner reader, int numberOfLines, StringBuilder lines, StringBuilder nums) throws Exception {\n		String line;\n		for (int i = 0; i < numberOfLines; i++) {\n			line = reader.nextLine();\n			lines.append(line + \'\\n\');\n\n			for (int j = 0; j < line.length(); j++) {\n				if (Character.isDigit(line.charAt(j))) {\n					nums.append(line.charAt(j));\n				}\n			}\n		}\n		return;\n\n	}\n\n}'),(1019,'#include <cstdio>\nlong long int num[100005];\nchar sign[100005], temp[4];\nint lv[100005], signlv[260];\nint topn, tops;\nlong long int number;\nlong long int f(char s) {\n	switch (s) {\n	case \'+\':\n		return (num[topn] + num[topn + 1]) % 10000;\n	case \'*\':\n		return (num[topn] * num[topn + 1]) % 10000;\n	default:\n		return -1;\n	}\n	return -1;\n}\nvoid init() {\n	lv[0] = -1;\n	signlv[\'+\'] = 1;\n	signlv[\'*\'] = 2;\n	return ;\n}\nvoid solve() {\n	char tt;\n	while ((tt = getchar()) != \'\\n\') {\n		switch (tt) {\n		case \'+\':\n		case \'*\': {\n			num[++topn] = number;\n			number = 0;\n			if (lv[tops] < signlv[tt])\n				++tops;\n			else\n				num[--topn] = f(sign[tops]);\n			sign[tops] = tt;\n			lv[tops] = signlv[tt];\n			break;\n		}\n		default: {\n			number = number * 10 + tt - \'0\';\n			break;\n		}\n		}\n	}\n	num[++topn]= number;\n	while (tops)\n		num[--topn] = f(sign[tops--]);\n	return ;\n}\nvoid output() {\n	bool flag = false;\n	temp[0] = num[1] % 10;\n	temp[1] = (num[1] /= 10) % 10;\n	temp[2] = (num[1] /= 10) % 10;\n	temp[3] = (num[1] /= 10) % 10;\n	if (!temp[0] && !temp[1] && !temp[2] && !temp[3]) {\n		putchar(