ep(x,a,b) for (int x=a;x<=b;x++)\n#define Drp(x,a,b) for (int x=a;x>=b;x--)\n#define Cross(x,a) for (int x=Hd[a];~x;x=Nx[x])\n#define ll long long\n#define INF (1<<29)\n#define PII pair<int,int>\n#define PDD pair<double,double>\n#define mk(a,b) make_pair(a,b)\n#define fr first\n#define sc second\nusing namespace std;\ninline ll IN(){\n	ll x=0;int ch=getchar(),f=1;\n	while (!isdigit(ch)&&(ch!=\'-\')&&(ch!=EOF)) ch=getchar();\n	if (ch==\'-\'){f=-1;ch=getchar();}\n	while (isdigit(ch)){x=(x<<1)+(x<<3)+ch-\'0\';ch=getchar();}\n	return x*f;\n}\ninline void OUT(ll x){\n	if (x<0) putchar(\'-\'),x=-x;\n	if (x>=10) OUT(x/10),putchar(x%10+\'0\');\n		else putchar(x+\'0\');\n}\nconst int N=6405,M=64005;\nint n,m;\nconst int Ps[4][2]={{0,1},{0,-1},{-1,0},{1,0}};\nint ID(int i,int j){return (i-1)*m+j;}\nint Cnt,To[M],Nx[M],Cs[M],Fl[M],Hd[N]; \nvoid AddEdge(int u,int v,int cost,int f){\n	To[Cnt]=v;Nx[Cnt]=Hd[u];Cs[Cnt]= cost;Fl[Cnt]=f;Hd[u]=Cnt++;\n	To[Cnt]=u;Nx[Cnt]=Hd[v];Cs[Cnt]=-cost;Fl[Cnt]=0;Hd[v]=Cnt++;\n}\nint Pr[N],Ds[N],S,T,Ans,a[85][85];\nbool Vs[N];\nqueue<int>Q;\nbool SPFA(){\n	memset(Ds,60,sizeof Ds);\n	Ds[S]=0;\n	Q.push(S);\n	while (!Q.empty()){\n		int u=Q.front();Q.pop();\n		Vs[u]=0;\n		Cross(i,u){\n			int v=To[i];\n			if (Fl[i]&&Ds[u]+Cs[i]<Ds[v]){\n				Ds[v]=Ds[u]+Cs[i],Pr[v]=i;\n				if (!Vs[v]){Q.push(v);Vs[v]=1;}\n			}\n		}\n	}\n	return Ds[T]<500000000;\n}\nvoid Edmonds_Karp(){\n	while (SPFA()){\n		int Nw=T,Mx=INF;\n		while (Nw!=S){\n			Mx=min(Mx,Fl[Pr[Nw]]);\n			Nw=To[Pr[Nw]^1];\n		}\n		Ans+=Mx*Ds[T];\n		Nw=T;\n		while (Nw!=S){\n			Fl[Pr[Nw]]-=Mx;\n			Fl[Pr[Nw]^1]+=Mx;\n			Nw=To[Pr[Nw]^1];\n		}\n	}\n}\nint main(){\n	n=IN(),m=IN();\n	Rep(i,1,n) Rep(j,1,m) a[i][j]=IN();\n	S=0,T=n*m+1;\n	memset(Hd,-1,sizeof Hd);\n	Rep(i,1,n) Rep(j,1,m){\n		int Tp=ID(i,j);\n		if ((i+j)&1) AddEdge(Tp,T,0,1);\n			else AddEdge(S,Tp,0,1);\n		Rep(k,0,3){\n			int Ni=i+Ps[k][0],Nj=j+Ps[k][1]; \n			if (Ni>=1&&Ni<=n&&Nj>=1&&Nj<=m){\n				if (a[Ni][Nj]==a[i][j]) AddEdge(Tp,ID(Ni,Nj),0,1);\n					else AddEdge(Tp,ID(Ni,Nj),1,1);\n			}\n		}\n	}\n	Edmonds_Karp();\n	OUT(Ans);\n}'),(1037,'#include<cstdio>\n#include<algorithm>\n#include<queue>\n#define mp make_pair\n#define pii pair<int,int>\n#define M 300010\n#define inf 0x37373737\nusing namespace std;\nconst int N = 301010;\nstruct MCMF{\n	int h[N] , dis[N] , ing[N] , pre[N] , s , t , n;\n	int to[M] , ne[M] , cap[M] , cost[M] , e;\n	void ini(){\n		fill(h,h+N,-1);\n		e = 0;\n	}\n	void liu(int u,int v,int c,int w){\n		to[e] = v , ne[e] = h[u] , cap[e] = c , cost[e] = w;\n		h[u] = e++;\n	}\n	void link(int u,int v,int c,int w){\n		liu(u,v,c,w);\n		liu(v,u,0,-w);\n	}\n	bool spfa(){\n		queue<int> Q;\n		fill(ing,ing+n,0);\n		fill(pre,pre+n,-1);\n		fill(dis,dis+n,inf);\n		ing[s] = true , dis[s] = 0;\n		Q.push(s);\n		while(!Q.empty()){\n			int c = Q.front();Q.pop();ing[c] = false;\n			for(int k=h[c];~k;k=ne[k]){\n				int v = to[k];\n				if(cap[k] <= 0) continue;\n				if(dis[c] +  cost[k] < dis[v]){\n					dis[v] = dis[c] + cost[k];\n					pre[v] = k;\n					if(!ing[v]) Q.push(v) , ing[v] = true;\n				}\n			}\n		}\n		return dis[t] != inf;\n	}\n	int flow , mincost;\n	pii run(int _s,int _t,int _n){\n		s = _s , t = _t , n = _n;\n		flow = mincost = 0;\n		while(spfa()){\n			int pl = inf , p , k;\n			for(p=t;p!=s;p=to[k^1]){\n				k = pre[p];\n				pl = min(pl,cap[k]);\n			}\n			for(p=t;p!=s;p=to[k^1]){\n				k = pre[p];\n				cap[k] -= pl;\n				cap[k^1] += pl;\n			}\n			mincost += pl * dis[t];\n			flow += pl;\n		}\n		return mp(flow,mincost);\n	}\n};\nMCMF mcmf;\nint n,m,i,j,a[100][100],s,t;\nint o(int x,int y)\n{\n	return (x-1)*m+y;\n}\nint main()\n{\n	scanf(\"%d%d\",&n,&m);\n	mcmf.ini();\n	s=0;t=n*m+1;\n	for (i=1;i<=n;i++)\n	for (j=1;j<=m;j++)\n	{\n		scanf(\"%d\",&a[i][j]);\n		if ((i+j)%2==0)\n		mcmf.link(s,o(i,j),1,0);\n		else\n		mcmf.link(o(i,j),t,1,0);\n	}\n	for (i=1;i<=n;i++)\n	for (j=1;j<=m;j++)\n	if ((i+j)%2==0)\n	{\n		if (i+1<=n) mcmf.link(o(i,j),o(i+1,j),1,a[i][j]==a[i+1][j]?0:1);\n		if (i-1>0) mcmf.link(o(i,j),o(i-1,j),1,a[i][j]==a[i-1][j]?0:1);\n		if (j+1<=m) mcmf.link(o(i,j),o(i,j+1),1,a[i][j]==a[i][j+1]?0:1);\n		if (j-1>0) mcmf.link(o(i,j),o(i,j-1),1,a[i][j]==a[i][j-1]?0:1);\n	}\n	printf(\"%d\\n\",mcmf.run(s,t,n*m+10).second);\n}'),(1038,'#include <queue>\n#include <cstdio>\n#include <algorithm>\nusing namespace std;\n#define S 0\n#define T (n*m+1)\n#define INF 1000000000\n#define ID(x, y) (((x)-1)*m+(y))\n#define Rep(x, a, b) for(int x=a; x<=b; x++)\nconst int dx[4]={0,0,1,-1};\nconst int dy[4]={1,-1,0,0};\nint head[10000], Dis[10000], cnt, c[100][100], Pre[10000], n, m, inq[10000], Cost;\nstruct data{\n	int from, to, next, cap, flow, cost;\n}edge[1000000];\nvoid AddEdge(int u, int v, int c, int w){\n	edge[cnt]=(data){ u, v, head[u], c, 0, +w }; head[u]=cnt++;\n	edge[cnt]=(data){ v, u, head[v], 0, 0, -w }; head[v]=cnt++;\n}\nqueue<int> Q;\nbool Spfa(){\n	Rep(i, S, T) Dis[i]=INF, Pre[i]=-1;\n	Q.push(S); Dis[S]=0;\n	while(!Q.empty())\n	{\n		int u=Q.front(); Q.pop(); inq[u]=0;\n		for(int i=head[u]; ~i; i=edge[i].next)\n		{\n			int v=edge[i].to;\n			if(Dis[v]>Dis[u]+edge[i].cost && edge[i].cap>edge[i].flow)\n			{\n				Dis[v]=Dis[u]+edge[i].cost; Pre[v]=i;\n				if(!inq[v]) inq[v]=1, Q.push(v);\n			}\n		}\n	}\n	return Dis[T]<1e9;\n}\nvoid Ext(){\n	int flow=1e9;\n	for(int i=Pre[T]; ~i; i=Pre[edge[i].from]) flow=min(flow, edge[i].cap-edge[i].flow);\n	for(int i=Pre[T]; ~i; i=Pre[edge[i].from]) edge[i].flow+=flow, edge[i^1].flow-=flow;\n	Cost+=Dis[T]*flow;\n}\nint main(){\n	scanf(\"%d%d\", &n, &m);\n	Rep(i, 1, n) Rep(j, 1, m) scanf(\"%d\", &c[i][j]);\n	Rep(i, S, T) head[i]=-1;\n	Rep(i, 1, n) Rep(j, 1, m) if((i&1)==(j&1))\n	{\n		AddEdge(S, ID(i, j), 1, 0);\n		Rep(d, 0, 3)\n		{\n			int x=i+dx[d], y=j+dy[d];\n			if(!x || !y || x>n || y>m) continue;\n			if(c[i][j]^c[x][y]) AddEdge(ID(i, j), ID(x, y), 1, 1);\n			else AddEdge(ID(i, j), ID(x, y), 1, 0);\n		}\n	}else AddEdge(ID(i, j), T, 1, 0);\n	while(Spfa()) Ext();\n	printf(\"%d\\n\", Cost);\n}'),(1039,'//by yjz\n#include<bits/stdc++.h>\nusing namespace std;\n#define debug(x) cerr<<#x<<\"=\"<<x<<endl;\n#define FF first\n#define SS second\n#define PB push_back \n#define MP make_pair\ntypedef long long ll;\nconst ll INF=1<<28;\nconst ll LINF=1ll<<61;\n//My own input/output stream\n#define geti(x) x=getnum()\n#define getii(x,y) geti(x),geti(y)\n#define getiii(x,y,z) getii(x,y),geti(z)\n#define puti(x) putnum(x),putsp()\n#define putii(x,y) puti(x),putnum(y),putsp()\n#define putiii(x,y,z) putii(x,y),putnum(z),putsp()\n#define putsi(x) putnum(x),putendl()\n#define putsii(x,y) puti(x),putnum(y),putendl()\n#define putsiii(x,y,z) putii(x,y),putnum(z),putendl()\ninline ll getnum()\n{\n	register ll r=0;register bool ng=0;register char c;c=getchar();\n	while(c!=\'-\'&&(c<\'0\'||c>\'9\'))c=getchar();\n	if(c==\'-\')ng=1,c=getchar();\n	while(c!=\' \'&&c!=\'\\n\')r=r*10+c-\'0\',c=getchar();\n	if(ng)r=-r;return r;\n}\ntemplate <class T> inline void putnum(T x)\n{\n	if(x<0)putchar(\'-\'),x=-x;\n	register short a[20]={},sz=0;\n	while(x>0)a[sz++]=x%10,x/=10;\n	if(sz==0)putchar(\'0\');\n	for(int i=sz-1;i>=0;i--)putchar(\'0\'+a[i]);\n}\ninline void putsp(){putchar(\' \');}\ninline void putendl(){putchar(\'\\n\');}\ninline char mygetchar(){register char c=getchar();while(c==\' \'||c==\'\\n\')c=getchar();return c;}\nstruct KM\n{\n	int n;\n	int lx[5011],ly[5011],slk[5011];\n	int mkx[5011],mky[5011];\n	int mx[5011],my[5011];\n	int head[20000],nxt[20000],to[20000],cost[20000],tot;\n	void init(int _n)\n	{\n		n=_n;\n		tot=0;\n		memset(head,0,sizeof(head));\n	}\n	void add_edge(int x,int y,int c)\n	{\n		nxt[++tot]=head[x];\n		head[x]=tot;\n		to[tot]=y;\n		cost[tot]=c;\n	}\n	int que[5011],qb,qe,pre[5011];\n	void findroute(int y)\n	{\n		for(int x,z;y!=-1;y=z)\n		{\n			x=pre[y];z=mx[x];\n			mx[x]=y;\n			my[y]=x;\n		}\n	}\n	inline void push(int y,int cur)\n	{\n		mkx[my[y]]=mky[y]=cur;\n		que[qe++]=my[y];\n	}\n	void bfs(int cur)\n	{\n		memset(slk,127,sizeof(slk));\n		qb=qe=0;\n		que[qe++]=cur;\n		mkx[cur]=cur;\n		while(true)\n		{\n			for(;qb<qe;qb++)\n			{\n				int x=que[qb];\n				for(int i=head[x];i;i=nxt[i])\n				{\n					int y=to[i];\n					if(mky[y]==cur)continue;\n					if(lx[x]+ly[y]==cost[i])\n					{\n						pre[y]=x;\n						if(my[y]==-1)\n						{\n							findroute(y);\n							return;\n						}\n						push(y,cur);\n					}\n					else if(lx[x]+ly[y]-cost[i]<slk[y])\n					{\n						pre[y]=x;\n						slk[y]=lx[x]+ly[y]-cost[i];\n					}\n				}\n			}\n			int delta=INF;\n			for(int i=1;i<=n;i++)if(mky[i]!=cur)delta=min(delta,slk[i]);\n			for(int i=1;i<=n;i++)\n			{\n				if(mkx[i]==cur)lx[i]-=delta;\n				if(mky[i]==cur)ly[i]+=delta;\n				else if(slk[i]!=INF)slk[i]-=delta;\n			}\n			for(int y=1;y<=n;y++)\n			{\n				if(slk[y]==0)\n				{\n					if(my[y]==-1)\n					{\n						findroute(y);\n						return;\n					}\n					push(y,cur);\n				}\n			}\n		}\n	}\n	int solve()\n	{\n		memset(lx,0,sizeof(lx));\n		memset(ly,0,sizeof(ly));\n		memset(mx,-1,sizeof(mx));\n		memset(my,-1,sizeof(my));\n		for(int i=1;i<=n;i++)bfs(i);\n		int ans=0;\n		for(int i=1;i<=n;i++)\n		{\n			for(int j=head[i];j;j=nxt[j])\n			{\n				if(to[j]==mx[i])\n				{\n					ans+=cost[j];\n					break;\n				}\n			}\n		}\n		return ans;\n	}\n}km;\nint n,m,a[100][100],id[100][100];\nbool f[100][100];\nconst int dx[4]={1,-1,0,0};\nconst int dy[4]={0,0,1,-1};\nint main()\n{\n	getii(n,m);\n	for(int i=1;i<=n;i++)\n	{\n		for(int j=1;j<=m;j++)\n		{\n			geti(a[i][j]);\n		}\n	}\n	int tot1=0,tot2=0;\n	for(int i=1;i<=n;i++)\n	{\n		f[i][1]=f[i-1][1]^1;\n		for(int j=2;j<=m;j++)f[i][j]=f[i][j-1]^1;\n		for(int j=1;j<=m;j++)\n		{\n			if(f[i][j])id[i][j]=++tot1;\n			else id[i][j]=++tot2;\n		}\n	}\n	km.init(tot1);\n	for(int i=1;i<=n;i++)\n	{\n		for(int j=1;j<=m;j++)\n		{\n			if(!f[i][j])continue;\n			for(int k=0;k<4;k++)\n			{\n				int ni=i+dx[k],nj=j+dy[k];\n				if(ni>=1&&nj>=1&&ni<=n&&nj<=m)\n				{\n					km.add_edge(id[i][j],id[ni][nj],-(a[i][j]!=a[ni][nj]));\n				}\n			}\n		}\n	}\n	cout<<-km.solve();\n	return 0;\n}'),(1040,'#include <bits/stdc++.h>\n\nusing namespace std;\n#define DEBUG_ON 1\n\n#define INF 0x3f3f3f3f\n#define NSYNC ios::sync_with_stdio(false);\n#define FOR(i,a,b) for(int i=a; i<(b); ++i)\n#define FOR0(i,b) for(int i=0; i<(b); ++i)\n#define TRAV(it,c) for(__typeof((c).begin()) it=(c).begin(); it!=(c).end(); ++it)\n#define RTRAV(it,c) for(__typeof((c).rbegin()) it=(c).rbegin(); it!=(c).rend(); ++it)\n#define DBG(x) if(DEBUG_ON) cout << #x << \" == \" << x << endl\n#define DBGP(x) if(DEBUG_ON) cout << \"(\" << (x).first << \", \" << (x).second << \")\" << endl\n#define pb(x) push_back(x)\n#define mp(x,y) make_pair(x,y)\n#define R(x) scanf(\" %d\",&(x))\n#define RR(x,y) scanf(\" %d %d\",&(x), &(y))\n#define RRR(x,y,z) scanf(\" %d %d %d\",&(x), &(y),&(z))\n#define CLR(v) memset(v, 0, sizeof(v))\n#define SET(v) memset(v, -1, sizeof(v))\n\ntypedef long long ll;\ntypedef int int_type;\ntypedef pair<int_type, int_type> pii;\ntypedef vector<int_type> vi;\ntypedef vector<vi> vii;\n\n#include <algorithm>\nusing namespace std;\n\n#define N 6450\n#define M (2*64500) // dobro do número de arestas\n#define INF 0x3f3f3f3f\n\nint vt, ve[M], re[M], ze[M], nextt[M];\nint in[N], head[N], path[N], dis[N], qu[N], lim[N];\n\nvoid init() {\n  vt = 1;\n  memset(head, 0, sizeof(head));\n}\n\nvoid add(int x, int y, int cap, int wei = 0) {\n  // aresta x->y é armazenada em [vt+1] e [vt+2]\n  ve[++vt] = y; re[vt] = cap; ze[vt] = wei;\n  nextt[vt] = head[x]; head[x] = vt;\n  ve[++vt] = x; re[vt] = 0; ze[vt] = -wei;\n  nextt[vt] = head[y]; head[y] = vt;\n}\n\nint mfmc(int s, int t, int n, int &fcost) {\n  int flow = fcost = 0;\n  while (1) {\n    int qt = 0, k = 0;\n    qu[qt++] = s;\n    for (int i = 0; i < n; i++)\n      dis[i] = lim[i] = INF;\n    dis[s] = 0;\n    \n    while (k != qt) {\n      if (k == N) k = 0;\n      int x = qu[k++];\n      for (int i = head[x]; i; i = nextt[i]) // ve[i]: adjs de x\n        if (re[i] && dis[x] + ze[i] < dis[ve[i]]){\n          dis[ve[i]] = dis[x] + ze[i];\n          path[ve[i]] = i;\n          lim[ve[i]] = min(lim[x], re[i]);\n          if (!in[ve[i]]) {\n            if (qt == N) qt = 0;\n            qu[qt++] = ve[i];\n            in[ve[i]] = 1;\n          }\n        }\n      in[x] = 0;\n    }\n    \n    if (dis[t] == INF) break;\n    int f = lim[t];\n    for (int p = t; p != s; p = ve[path[p] ^ 1]) {\n      re[path[p]] -= f; re[path[p] ^ 1] += f; // novo residual\n    }\n    fcost += f * dis[t];\n    flow += f;\n  }\n  return flow;\n}\n\n/** Código abaixo apenas para Min Cut **/\n\n/* mark[v] = true, se v esta no mesmo lado de u no corte */\nbool mark[N];\n\nvoid DFS(int u) {\n  mark[u] = true;\n  for (int i = head[u]; i; i = nextt[i]) {\n    if (i % 2) continue;\n    int v = ve[i];\n    if (!mark[v] && re[i] > 0) {\n      DFS(v);\n    }\n  }\n }\n\nvoid mincut(int s, int t, int n) {\n  memset(mark, 0, sizeof(mark));\n  DFS(s);\n  /* Arestas do corte */\n  for (int i = 0; i < n; i++)\n    for (int j = head[i]; j; j = nextt[j]) {\n      if (j % 2) continue;\n      int v = ve[j];\n      if (mark[i] && !mark[v])\n        printf(\"%d %d\\n\", i, v);\n    }\n}\n\n// /**** Exemplo simples de uso ****/\n// int main() {\n//   int n, m;\n//   while (scanf(\"%d %d\",&n,&m) == 2) {\n//     int from, to, cp, co;\n//     init();\n//     for (int i = 0; i < m; i++) {\n//       scanf(\"%d %d %d %d\",&from,&to,&cp, &co);\n//       add(from, to, cp, co);\n//     }\n//     int s=0, t=1;\n//     int fcost, flow=mfmc(s,t,n,fcost);\n//     printf(\"Fluxo: %d\\nCusto: %d\\n\",flow,fcost);\n\n//     for (int i = 1; i <= m; i++) {\n//       printf(\"f(%d->%d) = %d\\n\",ve[2*i+1],ve[2*i],re[2*i+1]);\n//       printf(\"r(%d->%d) = %d\\n\",ve[2*i+1],ve[2*i],re[2*i]);\n//     }\n\n//     mincut(s, t, n);\n//   }\n//   return 0;\n// }\n\nint grid[100][100];\nint dx[] = {0,0,1,-1};\nint dy[] = {1,-1,0,0};\n\ninline int getid(int i, int j) {\n	return i*80 + j + 1;\n}\n\nint main() {\n	NSYNC;\n	int nn,mm;\n	cin >> nn >> mm;\n	FOR0(i,nn) FOR0(j,mm) {\n		cin >> grid[i][j];\n	}\n	int qsz = nn*mm/2;\n	init();\n	FOR0(i,nn) FOR0(j,mm) {\n		if((i+j)&1) {\n			// cap[0][getid(i,j)] = 1;\n			add(0,getid(i,j),1);\n			FOR0(k,4) {\n				int nx = i + dx[k];\n				int ny = j + dy[k];\n				if(nx>=0 && nx<nn && ny>=0 && ny<mm) {\n					// cap[getid(i,j)][getid(nx,ny)] = 1;\n					// cost[getid(i,j)][getid(nx,ny)] = grid[i][j]==grid[nx][ny] ? 0 : 1;\n					add(getid(i,j),getid(nx,ny),1,grid[i][j]==grid[nx][ny] ? 0 : 1);\n				}\n			}\n		}\n		else {\n			add(getid(i,j),6401,1);\n			// cap[getid(i,j)][6401] = 1;\n		}\n	}\n	int s = 0;\n	int t = 6401;\n	int n = 6402;\n	int fcost;\n	int flow = mfmc(s,t,n,fcost);	\n	cout << fcost << endl;\n	// while(true);\n	return 0;\n}'),(1041,'#include <cstdio>\n#include <cstring>\n#include <algorithm>\ntemplate <typename T> inline void tension(T &a, const T &b){if (a>b) a=b;}\ntemplate <typename T> inline bool tensionv(T &a, const T &b){return a>b?a=b, true:false;}\ninline unsigned int getuint(){\n	char w=getchar();\n	while (w<\'0\'||\'9\'<w) w=getchar();\n	unsigned int ans=0;\n	for (;\'0\'<=w&&w<=\'9\';w=getchar()) ans=ans*10+w-\'0\';\n	return ans;\n}\nconst int dx[]={1, -1, 0, 0};\nconst int dy[]={0, 0, 1, -1};\nint a[233][233], id[233][233];\nint V, S, T;\nconst int MAXV=233333, MAXE=233333;\nstruct Edge{int t, next, cap, v;} G[MAXE];int head[MAXV], e=1;\ninline void add_double_edge(int x, int y, int z, int v){\n	//printf(\"%d %d %d %d\\n\", x, y, z, v);\n	G[++e].t=y, G[e].next=head[x], head[x]=e;G[e].cap=z, G[e].v=v;\n	G[++e].t=x, G[e].next=head[y], head[y]=e;G[e].cap=0, G[e].v=-v;\n}\nstruct ZKW_Min_Cost_Flow{\n	int dist[MAXV], inq[MAXV];\n	std::pair<int, int> heap[MAXE];int heap_size;\n	void SPFA(){\n		memset(dist+1, 0x3f, sizeof(*dist)*V), heap[heap_size++]=std::make_pair(-(dist[T]=0), T), std::push_heap(heap, heap+heap_size);\n		for (int d, x;heap_size;){\n			d=-heap->first, x=heap->second, std::pop_heap(heap, heap+heap_size--);\n			if (d!=dist[x]) continue;\n			for (int i=head[x];i;i=G[i].next) if (G[i^1].cap&&tensionv(dist[G[i].t], dist[x]-G[i].v))\n				heap[heap_size++]=std::make_pair(-dist[G[i].t], G[i].t), std::push_heap(heap, heap+heap_size);\n		}\n	}\n	int dfs(int x, int aug){\n		if (x==T) return aug;inq[x]=1;\n		int now=aug;\n		for (int i=head[x];i;i=G[i].next) if (!inq[G[i].t]&&G[i].cap&&dist[x]==dist[G[i].t]+G[i].v){\n			int flow=dfs(G[i].t, std::min(aug, G[i].cap));\n			if (flow){\n				G[i].cap-=flow, G[i^1].cap+=flow, now-=flow;\n				if (!now) break;\n			}\n		}\n		return aug-now;\n	}\n	bool modify_label(){\n		int t=0x3f3f3f3f;\n		for (int x=1;x<=V;x++) if (inq[x]) for (int i=head[x];i;i=G[i].next) if (!inq[G[i].t]&&G[i].cap) tension(t, dist[G[i].t]+G[i].v-dist[x]);\n		if (t==0x3f3f3f3f) return false;\n		for (int i=1;i<=V;i++) if (inq[i]) dist[i]+=t;\n		return true;\n	}\n	int min_cost_flow(){\n		SPFA();\n		int ans=0;\n		for (;;){\n			for (int t;;){\n				memset(inq+1, 0, sizeof(*inq)*V);\n				if (t=dfs(S, 0x3f3f3f3f)) ans+=dist[S]*t; else break;\n			}\n			if (!modify_label()) break;\n		}\n		return ans;\n	}\n} MCF;\nint main(){\n	//freopen(\"ex.in\", \"r\", stdin);\n	int n=getuint(), m=getuint();\n	for (int i=1;i<=n;i++) for (int j=1;j<=m;id[i][j++]=++V) a[i][j]=getuint();\n	S=++V, T=++V;\n	for (int i=1;i<=n;i++) for (int j=1;j<=m;j++) if (i+j&1){\n		add_double_edge(S, id[i][j], 1, 0);\n		for (int f=0;f<4;f++){\n			int x=i+dx[f], y=j+dy[f];\n			if (x<1||x>n||y<1||y>m) continue;\n			add_double_edge(id[i][j], id[x][y], 1, a[i][j]!=a[x][y]);\n		}\n	} else add_double_edge(id[i][j], T, 1, 0);\n	printf(\"%d\\n\", MCF.min_cost_flow());\n	return 0;\n}'),(1042,'#include <bits/stdc++.h>\n\nusing namespace std;\n\nint sz=0,vcounter=10;\nlong long p[100005];\nbool mk[5000];\nchar s[100005],ncad[100005];\n\nint main()\n{\n\n    scanf(\"%s\", s);\n    int len = strlen(s);\n    for(int i=0;i<len;i++)\n    {\n        if(mk[s[i]] && s[i] != \'?\') continue;\n        ncad[sz++] = s[i];\n        mk[s[i]] = true;\n    }\n    int len1 = strlen(ncad),t=0;\n    long long sol = 1;\n    if(ncad[0] == \'?\') sol = 9;\n    if(ncad[0] >= \'A\' && ncad[0] <= \'J\')\n    {\n        sol = 9;\n        vcounter = 9;\n    }\n    for(int i=1;i<len1;i++)\n    {\n        if(ncad[i] >= \'A\' && ncad[i] <= \'J\')\n        {\n            sol*=vcounter;\n            vcounter--;\n        }\n        if(ncad[i] == \'?\') t++;\n    }\n\n    cout<<sol;//(\"%I64d\", sol);\n    for(int i=1;i<=t;i++)\n        printf(\"0\");\n\n    return 0;\n}'),(1043,'#include <iostream>  \n#include <cstdio>  \n#include <string.h>  \n#include <cstdlib>  \n  \n#define MAXN 10000  \n  \n  \nint lastdigit(char* buf) {  \n    const int mod[20] = { 1, 1, 2, 6, 4, 2, 2, 4, 2, 8, 4, 4, 8, 4, 6, 8, 8, 6,  \n            8, 2 };  \n    int len = strlen(buf), a[MAXN], i, c, ret = 1;  \n    if (len == 1){  \n        return mod[buf[0] - \'0\'];  \n    }  \n    for (i = 0; i < len; i++){  \n        a[i] = buf[len - 1 - i] - \'0\';  \n    }  \n    for (; len; len -= !a[len - 1]) {  \n        ret = ret * mod[a[1] % 2 * 10 + a[0]] % 5;  \n        for (c = 0, i = len - 1; i >= 0; i--){  \n            c = c * 10 + a[i];  \n            a[i] = c / 5;  \n            c %= 5;  \n        }  \n    }  \n    return ret + ret % 2 * 5;  \n}  \n  \n  \nint main(){  \n    char n[MAXN];  \n    while(scanf(\"%s\",&n)!=EOF){  \n        printf(\"%d\\n\",lastdigit(n));  \n    }  \n  \n    return 0;  \n}'),(1044,'#include<bits/stdc++.h>\n \nusing namespace std;\n\nchar c;\nstring  a,b;\nint i,j;\nint main()\n{\n	cin>>a>>b;\n	sort(a.begin(),a.end());\n	if(a.size()!=1)\n		if(a[0]==\'0\') swap(a[0],a[1]);\n	if(a==b) cout<<\"OK\";\n	else cout<<\"WRONG_ANSWER\";\n	return 0;\n}\n'),(1045,'#include <iostream>\nusing namespace std;\nbool cmp(string s1, string s2)\n{\n if (s1==\"rock\"&&s2==\"scissors\") return true;\n if (s1==\"scissors\"&&s2==\"paper\") return true;\n if (s1==\"paper\"&&s2==\"rock\") return true;\nreturn false;\n}\nint main()\n{string s1,s2,s3;\n cin>>s1>>s2>>s3;\n if (cmp(s1,s2)&&cmp(s1,s3)) {cout<<\"F\"; return 0;}\n if (cmp(s2,s1)&&cmp(s2,s3)) {cout<<\