nt a;\n        int input1;\n        int input2;\n        Scanner scanner = new Scanner(System.in);\n        input1 = scanner.nextInt();\n        input2 = scanner.nextInt();\n\n        for (int i = 1; i <= input1; i++) {\n            a = fun(input1, input2, i);\n            if (i == input1){\n                System.out.print(a+1);\n            }\n\n        }\n    }\n    static int fun(int m,int k,int i){\n\n        if(i==1)\n            return (m+k-1)%m;\n        else\n            return (fun(m-1,k,i-1)+k)%m;\n\n    }\n}\n'),(1921,'import java.util.Scanner;\npublic class Main {\n\n    public static void main(String[] args) {\n        int n;\n        int a=0;\n        Scanner input = new Scanner(System.in);\n        n = input.nextInt();\n        if (n > 2 ) {\n            for (int i = 2; i < (n/2); i++) {\n                int k = n % i;\n                if (k == 0) {\n                    System.out.print(\"NO\");\n                    a=1;\n                    break;\n                }\n            }\n        }else if(n==2){\n            System.out.print(\"YES\");\n            a=1;\n        }else{\n            System.out.print(\"NO\");\n            a=1;\n        }\n        if(a==0){\n                System.out.print(\"YES\");\n            }\n        }\n    }'),(1922,'import java.util.Scanner;\npublic class Main{\n    public static void main(String[] args){\n        Scanner imput=new Scanner(System.in);\n            int a=imput.nextInt();\n        if(a==2){\n            System.out.println(\"YES\");\n        }\n            for(int i=2;i<a;i++) {\n                if (a % i != 0) {\n                    System.out.println(\"YES\");\n                    break;\n                } else {\n                    System.out.println(\"NO\");\n                    break;\n                }\n            }\n    }\n}\n\n'),(1923,'    import java.util.Scanner;\n     \n    \n\n    public class Main {\n        public static void main(String[] args){\n            Scanner sd = new Scanner(Sys