法isPrime,判定传入的参数N是否为素数\n     * @param N 传入参数\n     * @return 返回bool类型值 N是否为素数的结果\n     */\n    static boolean isPrime(int N){\n        boolean q=true;\n        if(N<2){\n           return false;\n        }\n        else\n\n    {\n        for (int i = 2; i <=Math.sqrt(N); i++) {\n            int res = N % i;\n            if (res == 0) {\n                q=false;\n                break;\n            }\n            }\n        }\n        return q;\n    }\n\n}'),(1971,'import java.util.Scanner;\n\n/**\n * Created by zhangqian on 2016/7/27.\n */\npublic class Main{\n    public static  void main(String[] args){\n        Scanner s=new Scanner(System.in);\n        int N=s.nextInt();\n        if(isPrime(N)) {\n            System.out.println(\"YES\");\n        } else{\n            System.out.println(\"N0\");\n        }\n        s.close();\n        }\n\n    /**\n     * 方法isPrime,判定传入的参数N是否为素数\n     * @param N 传入参数\n     * @return 返回bool类型值 N是否为素数的结果\n     */\n    static boolean isPrime(int N){\n        boolean q=true;\n        if(N<2){\n           return false;\n        }\n        else\n\n    {\n        for (int i = 2; i <=Math.sqrt(N); i++) {\n            int res = N % i;\n            if (res == 0) {\n                q=false;\n                break;\n            }\n            }\n        }\n        return q;\n    }\n\n}\n'),(1972,'import java.util.Scanner;\n\npublic class Main{\n      static int s = 0;\n    public static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        int n=sc.nextInt();\n        int sum=hanoiTower(n,\'a\',\'b\',\'c\');\n        System.out.println(sum);\n    }\n    public static int hanoiTower(int n ,char a,char b,char c) {\n        if (n == 1)\n            s++;\n        else {\n            hanoiTower(n - 1, a, c, b);\n            s++;\n            hanoiTower(n - 1, b, a, c);\n        }\n            return s;\n    }\n}\n'),(1973,'package com.company;\n\nimport java.util.Scanner;\n\npublic class Main {\n    public static void m