b.equals(c))\n            System.out.print(\"YES\");\n        else {\n            System.out.print(\"NO\");\n        }\n\n    }\n    public static String reverse3(String s) {\n        char[] array = s.toCharArray();\n        String reverse = \"\";\n        for (int i = array.length - 1; i >= 0; i--) {\n            reverse += array[i];\n        }\n        return reverse;\n    }\n}'),(2087,'import java.util.Scanner;\n\npublic class Main {\n\n    public static void main(String[] args) {\n        Scanner s1 = new Scanner(System.in);\n        String str1 = s1.nextLine();\n        String str2 = s1.nextLine();\n        // write your code here\n        String str3 = reverse(str1);\n        if (str2.equals(str3)) {\n            System.out.println(\"YES\");\n        } else\n            System.out.println(\"NO\");\n\n\n    }\n\n    public static String reverse(String s) {\n\n        int length = s.length();\n        String reverse = \"\";\n        for (int i = 0; i < length; i++)\n            reverse = s.charAt(i) + reverse;\n\n        return reverse;\n    }\n}\n'),(2088,'import java.util.InputMismatchException;\nimport java.util.Scanner;\n\n\npublic class Main {\n       \n        public static void main(String[] args) {\n            Scanner scanner = new Scanner(System.in);\n            try {\n                int number = scanner.nextInt();\n                if (number>0){\n                int result = 1;\n                for (int i=2 ;i<=number ; i++){\n                    result =  result * i;\n                }\n\n                String q = String.valueOf(result);\n                String[] ww = q.split(\"\");\n\n                for (int i=ww.length-1 ; i>=0; i-- ){\n                    int dd = Integer.parseInt(ww[i]);\n                    if (dd ==0){\n\n                    }else {\n                        System.out.print(dd);\n                        break;\n                    }\n                }\n                }\n            }catch (InputMismatchException exception){\n\n            }\n\n        }\n}\n'),(2089,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner in = new Scanner(System.in);\n        String  a = in.next();\n        String b = in.next();\n        String c = reverse(a);\n        if (b.equals(c))\n            System.out.println(\"YES\");\n        else\n            System.out.println(\"NO\");\n    }\n\n    public static String reverse(String s) {\n         char[] array = s.toCharArray();\n        String reve = \"\";\n        for (int i = array.length - 1; i >= 0; i--){\n            reve += array[i];\n        }\n        return  reve;\n    }\n }\n\n'),(2090,'                                                                                                                        \nimport java.util.Map;                                                                                                   \nimport java.util.Scanner;                                                                                               \nimport java.util.TreeMap;                                                                                                                                                                                                                  \npublic class Main{                                                                                                    \n    public static void main(String args[]){                                                                             \n        TreeMap<Integer,Integer> map = new TreeMap<Integer,Integer>();                                                  \n        String str = \"\";                                                                                                \n        Scanner scanner = new Scanner(System.in);                                                                       \n        int n = scanner.nextInt();                                                                                 