 (inList.get(i) > inList.get(j + 1)) {\n                    x = inList.get(i);\n                    inList.set(i, inList.get(j + 1));\n                    inList.set(j + 1, x);\n                }\n            }\n        }\n        int y = 0;\n        int z = 1;\n        while (( z<inList.size())&&(inList.get(0)==0)) {\n            if (inList.get(z)!=0)\n                y=inList.get(0);\n            inList.set(0,inList.get(z));\n            inList.set(z,y);\n            z+=1;\n        }\n        long result = 0;\n        int firstNoZeroDigit = 0;\n        for (int i = 0; i < inList.size(); i++) {\n            firstNoZeroDigit = inList.get(i);\n            /*if (i==0&&firstNoZeroDigit==0){\n                continue;\n            }*/\n\n            result = 10*result + firstNoZeroDigit;\n        } //把数组中的单个数字组成一个整数\n        return result;\n    }\n}\n'),(2128,'package yy;\nimport java.util.Scanner;\npublic class Ge{\n    public static void main(String[] args){\n        Scanner in=new Scanner(System.in);\n        String a=in.next();\n        String b=in.next();\n        String c=reverse(a);\n        if(b.equals(c))\n            System.out.println(\"YES\");\n        else\n            System.out.println(\"NO\");\n    }\n    public static String reverse(String s){\n            char[] array=s.toCharArray();\n            String reve=\"\";\n        for(int i=array.length-1;i>=0;i--){\n            reve += array[i];\n        }\n        return reve;\n    }\n}'),(2129,'import java.util.Scanner;\n\npublic class Main{\n    public static void main(String args[]) {\n        Scanner input = new Scanner(System.in);\n        int n = input.nextInt();\n        //调用Decomposition\n        deccomposition(n);\n\n    }\n\n    //分解质因数\n    public static void deccomposition(int n) {\n        int count = 0;//记录相同质数的个数\n        if (n <= 1) {\n            System.out.println(\"无法分解质因数！\");\n        } else {\n            System.out.print(n + \"=\");\n            int k = 2;\n            while (k <= n) 