ublic static void main(String args[]) {\n        Scanner input = new Scanner(System.in);\n//        System.out.println(\"请输入需要分解的数\");\n        int n = input.nextInt();\n        //调用Decomposition\n        deccomposition(n);\n\n    }\n\n    //分解质因数\n    public static void deccomposition(int n) {\n        int count = 0;//记录相同质数的个数\n        if (n <= 1) {\n            System.out.println(\"无法分解质因数！\");\n        } else {\n//            System.out.print(n + \"=\");\n            int k = 2;\n            while (k <= n) {\n\n                if (0 == n % k && isPrime(k)) {\n                    n = n / k;//如果n能整除k，则将相除的结果赋给n\n                    count++;//质因数为同一个数计数器count自增\n                    continue;//继续for循环，找出相同的质因数\n                }\n                if (count >= 1) {//保证k在自增过程中不输出指数为0的质因数\n                    System.out.print(k + \"(\" + count + \")\");//输出指数的一种简单形式\n                }\n                k++;//k自增，以找到合数的所有约数\n                count = 0;//k自增后使count为0，避免输出所有的k值\n            }\n            System.out.print(k + \"(\" + count + \")\");\n        }\n    }\n\n\n    //判断是否为素数\n\n    public static boolean isPrime(int n) {\n        for (int i = 2; i < Math.sqrt(n); i++) {\n            if (n % i == 0) {\n                return false;\n            }\n        }\n        return true;\n    }\n}\n\n//                if (!isPrime(k) || 0 != n % k) {\n//                    ++k;\n//                    count = 0;\n//                    continue;\n//                } else {\n//                    count = count + 1;\n//                }\n//                n /= k;\n//            }\n//            if(count >= 1) {\n//                System.out.print(k + \"(\" + count + \")\");\n//            }\n//'),(2146,'    import java.util.Scanner;\n     \n    \n\n    public class Main {\n        public static void main(String[] args){\n            Scanner sd = new Scanner(System.in);\n            int N = sd.nextInt();\n            if (isPrime(N)){\n                System.out.println(\"YES\");\n