e();\n        int num = Integer.parseInt(s);\n        list = primelist(num);\n        decomposition(num);\n        Map<Integer,Integer> map = new HashMap<Integer,Integer>();\n        for (Integer i : factorList){\n            if (map.containsKey(i)){\n                map.put(i,map.get(i)+1);\n            }else {\n                map.put(i,1);\n            }\n\n        }\n        System.out.print(num+\"=\");\n        for (Integer key : map.keySet()){\n            System.out.print(key);\n            System.out.print(\"(\"+map.get(key)+\")\");\n        }\n\n\n}\n\n    private static void decomposition(int num) {//获得质因数\n        if (isPrime(num)){\n            factorList.add(num);\n            return;\n        }\n        if (list.size()==0){\n            return;\n        }\n        int currentPrime = list.get(0);\n        if (num%currentPrime==0){\n            factorList.add(currentPrime);\n            decomposition(num/currentPrime);\n        }else {\n            list.remove(0);\n            decomposition(num);\n        }\n    }\n\n    private static List<Integer> primelist(int num) { //获得小于当前数的所有素数\n        for (int i=2;i<=num;i++){\n            if(isPrime(i)){\n                list.add(i);\n            }\n        }\n        return list;\n    }\n\n    private static boolean isPrime(int num) {  //判断是否为素数\n        for (int i=2;i<=Math.sqrt(num);i++){\n            if (num%i==0){\n                return false;\n            }\n        }\n        return true;\n    }\n\n}\n'),(2191,'import java.util.Scanner;\n\n/**\n * Created by huangzhiwei on 16/7/27.\n */\npublic class Main {\n    public static void main(String[] args[]){\n        System.out.println(result());\n    }\n    public static  String result() {\n\n        Scanner sca1 = new Scanner(System.in);\n        String str1 = sca1.next();\n        Scanner sca2 = new Scanner(System.in);\n        String str2 = sca2.next();\n        int firstnumber = str1.length();\n        int lastnumber = str2.length();\n        if (firstn