Value(int index, int value) {\n        if (index >= 0 && index < size) {\n            ring[index] = value;\n        }\n    }\n\n    public void next(int offset) {\n        current = (current + offset) % size;\n    }\n\n    public int getCurrentData() {\n        return ring[current];\n    }\n\n\n    public void deleteCurent() {\n        for (int i = current + 1; i < size; i++) {\n            ring[i - 1] = ring[i];\n        }\n        size--;\n    }\n\n    public void setCurrent(int current) {\n        this.current = current % size;\n    }\n\n    public int getSize() {\n        return size;\n    }\n\n    public static void main(String[] args) {\n        Scanner scan = new Scanner(System.in);\n        Scanner scan1 = new Scanner(System.in);\n        int n = scan.nextInt();\n        int x = scan1.nextInt();\n        IntRing r = new IntRing(n);\n        for (int i = 0; i < n; i++) {\n            r.setNodeValue(i, i + 1);\n        }\n        r.setCurrent(n);\n        while (r.getSize() > 1) {\n            r.next(x);\n            r.deleteCurent();\n        }\n        System.out.println(r.getCurrentData());\n    }\n}'),(2197,'\nimport java.util.Scanner;\n\n/**\n * Created by huangzhiwei on 16/7/27.\n */\npublic class Main {\n    public static void main(String[] args[]){\n        System.out.println(result());\n    }\n    public static  String result() {\n\n        Scanner sca1 = new Scanner(System.in);\n        String str1 = sca1.next();\n        String str2 = sca1.next();\n        int firstnumber = str1.length();\n        int lastnumber = str2.length();\n        if (firstnumber != lastnumber) {\n            return \"NO\";\n        }\n        lastnumber =lastnumber-1;\n        for (int i = 0; i < firstnumber; i++) {\n            if (str1.charAt(i) != str2.charAt(lastnumber) ) {\n                return \"NO\";\n            }\n            lastnumber = lastnumber - 1;\n        }\n        return \"YES\";\n\n    }\n}'),(2198,'\npublic class Main {\n    public static void main(Str