\n        }\n        size--;\n    }\n\n    public void setCurrent(int current) {\n        this.current = current % size;\n    }\n\n    public int getSize() {\n        return size;\n    }\n\n    public static void main(String[] args) {\n        Scanner scan = new Scanner(System.in);\n        int n = scan.nextInt();\n        int x = scan.nextInt();\n        IntRing r = new IntRing(n);\n        for (int i = 0; i < n; i++) {\n            r.setNodeValue(i, i + 1);\n        }\n        r.setCurrent(n);\n        while (r.getSize() > 1) {\n            r.next(x);\n            r.deleteCurent();\n        }\n        System.out.println(r.getCurrentData());\n    }\n}'),(2237,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n        int n, sum = 0;\n        while(scanner.hasNext()) {\n            n = scanner.nextInt();\n            sum += n;\n            if(n<0){\n                break;\n            }\n        }\n        System.out.println(sum);\n    }\n\n}\n'),(2238,'import java.util.Scanner;\n\npublic class Main {\n    public static void main(String[] args){\n        Scanner sc=new Scanner(System.in);\n        String s = sc.nextLine();\n        String c = sc.nextLine();\n        s = (new StringBuffer(s)).reverse().toString();\n        if (s.equals(c)){\n            System.out.println(\"YES\");\n        }else{\n            System.out.println(\"NO\");\n        }\n    }\n}'),(2239,'import java.util.Scanner;\npublic class Main {\n\n    public static void main(String[] args){ \n       \n        Main a = new Main();\n        a.D();\n    }\n    public String A=null;\n    public String B=null;\n    public String C=null;\n    public void D(){\n        Scanner in =  new Scanner(System.in);\n        A = in.next();\n        B = in.next();\n        C = in.next();\n        if(A.equals(\"rock\")){\n            if(B.equals(\"scissors\")&&C.equals(\"scissors\"))\n                System.out.println(\"F\