] args) {\n        //输入被翻转字符串\n        Scanner input=new Scanner(System.in);\n        String x=input.nextLine();\n        //reverse方法将字符串翻转\n        x=reverse(x);\n        //输入待检测字符串\n        Scanner two=new Scanner(System.in);\n        String y=two.nextLine();\n        //判断输入与正确答案是否相等\n        if(x.equals(y))\n        System.out.println(\"YES\");//如果相等\n        else\n            System.out.println(\"NO\");//如果不等\n\n    }\n    public static String reverse(String s){\n        int length=s.length();//字符数组长度为字符串长度\n        char[] n=new char[length];//定义字符数组\n        for(int i=0;i<length;i++)\n            n[i]=s.charAt(length-i-1);//倒序输入字符\n        return String.valueOf(n);//返回string类型n的值\n    }\n\n}'),(2255,'\nimport java.io.InputStream;\nimport java.util.Scanner;\n\npublic class Main {\n    public static void main(String[] args) {\n        char tmp = 0;\n        Scanner sc = new Scanner(System.in);\n\n        int first = sc.nextInt();\n\n        int second = sc.nextInt();\n        char[] chars = Integer.toString(first).toCharArray();\n        for(int i = 0; i < chars.length; i++){\n            for(int j = i; j<chars.length; j++){\n                if(chars[j] < chars[i]){\n                    tmp = chars[i];\n                    chars[i] = chars[j];\n                    chars[j] = tmp;\n                }\n            }\n        }\n        if(chars[0] == \'0\'){\n            for(int i = 1; i<chars.length; i++){\n                if(chars[i]!=0){\n                    tmp = chars[i];\n                    chars[i] = chars[0];\n                    chars[0] = tmp;\n                    break;\n                }\n            }\n        }\n        String sorted = new String(chars);\n        String result = Integer.toString(second);\n\n        if(sorted.equals(result)){\n            System.out.println(\"OK\");\n        }else{\n            System.out.println(\"WRONG_ANSWER\");\n        }\n\n    }\n}'),(2256,'import java.util.Scanner;\n\n\npublic class Main{\n    static int i=1;\n 