 { //获得小于当前数的所有素数\n        for (int i=2;i<=num;i++){\n            if(isPrime(i)){\n                list.add(i);\n            }\n        }\n        return list;\n    }\n\n    private static boolean isPrime(int num) {  //判断是否为素数\n        for (int i=2;i<num;i++){\n            if (num%i==0){\n                return false;\n            }\n        }\n        return true;\n    }\n\n}\n\n'),(2260,'\nimport java.util.ArrayList;\nimport java.util.Arrays;\nimport java.util.Scanner;\nimport java.util.List;\n\n\npublic class Main {\n    private static int count=0;\n    public static void main(String[] args){\n        Scanner scanner=new Scanner(System.in);\n        System.out.println(\"\");\n        int n=scanner.nextInt();\n        System.out.println(\"\");\n        int m=scanner.nextInt();\n        boolean []tag = new boolean[n];\n        for(int i=0;i<n;i++)\n        tag[i]=true;\n        int count=0;\n        int index=1;\n        int k=n;\n        while(k>=1){\n            if(tag[index]==true){\n                count++;\n                if(count==m){\n                    count=0;\n                    tag[index]=false;\n                    k--;\n\n                    System.out.println(index);\n\n                }\n\n            }\n            index++;\n            if (index==n)index=0;\n        }\n\n        }\n\n\n    }\n'),(2261,'import java.util.Scanner;\n\npublic class Main{\n    static int i=1;\n    public static void main(String args[]){\n        Scanner sc=new Scanner(System.in);\n        long a=sc.nextInt();\n        long h=sc.nextInt();\n        long c=a;\n        long sum=0;\n        long d;\n        for (;a>=10;){\n           a= a/10;\n            i++;\n        }\n        long [] b=new long[i];\n        if (i==1){\n            sum=c;\n        }\n        else{\n            for (int j=0;j<i;j++){\n                b[j]=c%10;\n                c=c/10;\n            }\n        }\n        for (int m=0;m<i-1;m++){\n            long l=0;\n                for(int n=m+1;n<i;n