\n\npublic class Main {\n   private static int count=0;\n    public static void main(String[] args) {\n        Scanner scanner=new Scanner(System.in);\n        System.out.println(\"\");\n        int n=scanner.nextInt();\n        System.out.println(\"\");\n        int m=scanner.nextInt();\n        sortP(n,m);\n    }\n        private static void sortP(int n, int m) {\n            if(n==1){\n                System.out.println(n);\n            } else\n                     f1(n, m);   }\n            private static void f1(int n, int m)\n            {\n                int[] arr = new int[n];\n                for(int j=0;j<n;j++)\n                {\n                    for(int i = 0;i<m;i++)\n                    {\n                        count++;\n                        if(j>0)\n                        {\n                            measure(j, arr);\n                        }\n                          if(count>n)\n                          {\n                              count=1;\n                            measure(j,  arr);     }\n                    }\n                            arr[j]=count;\n                }\n                  System.out.println(\"\"+arr[n-1]);\n            }\n                private static void measure(int n,int[] arr) {\n                    for(int s = 0;s<n;s++){\n                        for(int w=0;w<n;w++){\n                            if(count==arr[w]) count++;\n                        }\n                    }\n                }\n}'),(2428,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        int m;\n        int n = 2;\n        Scanner scanner = new Scanner(System.in);\n        m = scanner.nextInt();\n        while (n < m) {\n           if (m % n == 0) break;\n        n++;}\n        if (m==n)\n            System.out.println(\"YES\");\n      else\n            System.out.println(\"NO\");\n}\n}\n'),(2429,'import java.util.Scanner;\n\n/**\n * Created by yuan on 2016/7/27.\n */\npublic class Main