g[b] != 0) {\n                    int temp = rang[b];\n                    rang[b] = rang[0];\n                    rang[0] = temp;\n                    break;\n                }\n            }\n            break;\n            }\n        }\n        int sum = 0;\n        int suum = 0;\n        for (int i = 0; i < rang.length; i++) {\n            sum = sum * 10 + rang[i];\n            suum = suum * 10 + gang[i];\n        }\n        if(sum==suum){\n            System.out.println(\"OK\");\n        }else{\n            System.out.println(\"WRONG_ANSWER\");\n        }\n    }\n}\n'),(2489,'import java.util.Scanner;\npublic class Main {\n    static int a=0;\n    static int b=0;\n    static int c=0;\n\n    public static void fenjie(int n) {\n\n        for (int i=2;i <=n;i++) {\n            if (i == n) {\n                if(i==2) a++;\n                if(i==3) b++;\n                if(i==5) c++;\n\n               // System.out.print(i);\n                return;\n            }\n            if (n > i && (n % i == 0)) {\n              //  System.out.print(i+\"*\");\n                fenjie(n / i);\n                if(i==2) a++;\n                if(i==3) b++;\n                if(i==5) c++;\n                break;\n            }\n        }\n    }\n    public static void main(String[] args) {\n        Scanner input = new Scanner(System.in);\n        int n = input.nextInt();\n        fenjie(n);\n        System.out.print(n+\"=\");\n        if(a!=0)  System.out.print(\"2(\"+a+\")\");\n        if(b!=0)  System.out.print(\"3(\"+b+\")\");\n        if(c!=0)  System.out.print(\"5(\"+c+\")\");\n\n\n\n    }\n}'),(2490,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        int count2 = 0;\n        int count5 = 0;\n        int zeroNum=0;\n        Scanner input = new Scanner(System.in);\n        int N = input.nextInt();\n        //遍历所有的数\n        for (int number = 1; number <= N; number++) {\n            int dynmicNumber = number;\n            while 