long a=result;\n        String aS=String.valueOf(a);\n        char[ ]asC= aS.toCharArray();\n        for(int i=asC.length-1;i>0;i--){\n          if(asC[i]!=\'0\')\n          {\n              System.out.println(asC[i]);\n              break;\n          }\n\n        }\n\n    }\n\n\n\n\n    public static long factorialRecursive(int n) {\n        // 阶乘对整数才有意义\n        if (n < 0) {\n            return -1;\n        }\n\n        // 0！=1，（0 的阶乘是存在的）\n        if (n == 0) {\n            return 1;\n        }\n\n        if (n < 2)\n            return n * 1;\n        return n * factorialRecursive(n - 1);\n    }\n}'),(2581,'import java.io.BufferedInputStream;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.Scanner;\npublic class Main {\n    private static class Node{\n        int No;\n        Node next;\n        public Node(int No){\n            this.No=No;\n        }\n    }\n    public static void main(String[] args) {\n        int totalNum,cycleNum;\n        List<Integer> list = new ArrayList<Integer>();\n        Scanner cin = new Scanner(new BufferedInputStream(System.in));\n        System.out.println(\"\");\n        totalNum=cin.nextInt();\n        System.out.println(\"\");\n        cycleNum=cin.nextInt();\n        Node header = new Node(1);\n        Node pointer = header;\n        for(int i=2;i<=totalNum;i++){\n            pointer.next = new Node(i);\n            pointer = pointer.next;\n        }\n        pointer.next= header;\n        pointer=header;\n        while(pointer != pointer.next){\n            int i =2;\n            while(i<cycleNum){\n                pointer = pointer.next;\n                i++;\n            }\n            pointer.next=pointer.next.next;\n            pointer=pointer.next;\n        }\n        System.out.println(\"\"+pointer.No);\n    }\n}'),(2582,'\n/**\n * Created by Mr.Tang on 2016/7/27.\n */\npublic class Main {\n    public static void main(String[] args){\n\n        java.util.Scanner input = new  java.util.Scanner(Syste