ingBuffer str=new StringBuffer(\"\");\n        for(int n=0;n<b.length();n++){\n            intList.add(Integer.parseInt(String.valueOf(b.charAt(n))));\n        }while(intList.size()!=0){\n            for(int n=0;n<intList.size();n++) {\n                int flag = intList.get(n);\n                if (flag <= m) {\n                    m = intList.get(n);\n                    temp = n;\n                }\n            }str.append(intList.get(temp));\n            intList.remove(temp);\n            m=9;\n        }\n        String str1=str.toString();\n        if(str1.compareTo(c)==0) {\n         System.out.print(\"OK\");\n        }else{\n            System.out.print(\"WRONG_ANSWER\");\n        }\n    }\n}\n'),(2706,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n        int a = scanner.nextInt();\n        int b = scanner.nextInt();\n        int c = scanner.nextInt();\n        int tem = 1;\n        while(b >= 2) {\n            if (a > c) a %= c;\n            if( tem > c ) tem %= c;\n            if(b % 2 == 0){\n                a = a * a;\n                b /= 2;\n            } else{\n                -- b;\n                tem = a * tem;\n                a = a * a;\n                b /= 2;\n            }\n        }\n        tem = (a*tem)%c;\n        System.out.println(tem);\n	}\n}'),(2707,'import java.util.Scanner;\n\npublic class TTTT{\n    public static void main(String[] args){\n        Scanner in = new Scanner(System.in);\n        int i=0;\n        int sum = 0;\n        while(in.hasNextBigInteger()){\n            i=in.nextInt();\n            sum=sum+i;\n\n        }\n        System.out.println(sum);\n    }\n}'),(2708,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\n\npublic class Main {\n    public static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        BigDecimal in = sc.nextBigDecimal();\n        BigDecimal result =  factorial(in);\n\n        System.out.println(result);\n        BigDecimal a=result;\n        String aS=String.valueOf(a);\n        char[ ]asC= aS.toCharArray();\n        for(int i=asC.length-1;i>0;i--){\n          if(asC[i]!=\'0\')\n          {\n              System.out.println(asC[i]);\n              break;\n          }\n\n        }\n\n    }\n\n\n\n\n    public static BigDecimal factorial(BigDecimal n){\n        BigDecimal bd1 = new BigDecimal(1);//BigDecimal类型的1\n        BigDecimal bd2 = new BigDecimal(2);//BigDecimal类型的2\n        BigDecimal result = bd1;//结果集，初值取1\n        while(n.compareTo(bd1) > 0){//参数大于1，进入循环\n            result = result.multiply(n.multiply(n.subtract(bd1)));//实现result*（n*（n-1））\n            n = n.subtract(bd2);//n-2后继续\n        }\n        return result;\n    }\n}'),(2709,'import java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/27.\n */\npublic class Main{\n    public static void main(String[] args){\n\n        Scanner scnaner = new Scanner(System.in);\n\n        int number = scnaner.nextInt();\n        int m = scnaner.nextInt();\n\n        int n = integeReverse(number);\n\n        if(m==n){\n            System.out.println(\"OK\");\n        }else{\n            System.out.println(\"WRONG_ANSWER\");\n        }\n        scnaner.close();\n    }\n    public static  int integeReverse(int number) {\n        ArrayList<Integer> intList = new ArrayList<Integer>();\n\n        while (true) {\n\n            int mod = number % 10;\n            intList.add(mod);\n\n            number /= 10;\n            if (number == 0)\n                break;\n        }\n        Collections.sort(intList);\n        int result = 0;\n        int num = 1;\n        boolean isFirst = true;\n        int firstNoZeroDigit = 0;\n\n        for (int i = 0; i < intList.size(); i++) {\n            firstNoZeroDigit = intList.get(i);\n            if (firstNoZeroDigit != 0) {\n                if (num>1&isFirst==true) {\n                    firstNoZeroDigit = firstNoZeroDigit * num;\n                }\n                isFirst = false;\n            }\n            if (isFirst) {\n                num = num *10;\n                continue;\n            }\n            result = result * 10 + firstNoZeroDigit;\n        }\n       return result;\n    }\n\n}\n\n'),(2710,'\nimport java.util.*;\n\npublic class Main {\n    public static void main(String[] args) {\n        Scanner scan = new Scanner(System.in);\n        String s=scan.nextLine();\n        String t=scan.nextLine();\n        scan.close();\n        String[] split = s.split(\"\");\n        int[] arr = new int[split.length];\n\n        for (int i=0; i<split.length;i++) {\n            int num= Integer.parseInt(split[i]);\n            arr[i]= num;\n        }\n\n        int temp;\n        for (int i=0;i<arr.length-1;i++){\n            for (int j=0;j<arr.length-1-i;j++){\n                if (arr[j]>arr[j+1]){\n                    temp = arr[j];\n                    arr[j] = arr[j+1];\n                    arr[j+1] = temp;\n                }\n            }\n        }\n\n        for (int i=0;i<arr.length-1;i++){\n            if(arr[i]==0){\n                continue;\n            }else {\n                temp = arr[i];\n                arr[i] = arr[0];\n                arr[0] = temp;\n                break;\n            }\n        }\n\n        String c= \"\";\n        for (int i : arr){\n            c+=i;\n        }\n            if (c.equals(t)){\n                System.out.println(\"OK\");\n            }else {\n                System.out.println(\"WRONG_ANSWER\");\n            }\n\n\n    }\n}\n\n\n'),(2711,'import java.util.Scanner;\npublic class Main {\n\n	/**\n	 * @param args\n	 */\n	public static void main(String[] args) {\n		// TODO Auto-generated method stub\n		Scanner scanner=new Scanner(System.in);\n		int a=scanner.nextInt();\n		System.out.println(factorial(a));\n		\n\n	}\n	public static int factorial(int number){\n		int result=1;\n		for (int i=number;i>0;i--){\n			result*=i;\n			\n		}\n		while(result%10==0){\n			int s=result/10;\n			result=s;\n		}\n		result=result%10;\n		return result;\n		\n	}\n\n}\n'),(2712,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args){\n        Scanner in = new Scanner(System.in);\n        StringBuilder mn = new StringBuilder(in.next());\n        StringBuilder mn2 = new StringBuilder(in.next());\n        StringBuilder mn3 = mn.reverse();\n        if (mn2.toString().compareTo(mn3.toString())==0){\n            System.out.println(\"YES\");\n        }else {\n            System.out.println(\"NO\");\n        }\n    }\n}\n'),(2713,'import java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/27.\n */\npublic class Main{\n    public static void main(String[]args){\n        Scanner s=new Scanner(System.in);\n        int a;\n        a=s.nextInt();\n        int b;\n        b=s.nextInt();\n        int sum=a+b;\n        s.close();\n        System.out.print(sum);\n    }\n}'),(2714,'import java.util.Scanner;\nimport java.lang.String;\npublic class Main {\n    public static void main(String args[]) {\n        Scanner sc = new Scanner(System.in);\n        int n = sc.nextInt();\n        int p[] = new int[n];\n        for (int i = 0; i < n; i++) {\n            p[i] = sc.nextInt();\n        }\n        double f = 0;\n        if (n >= 1 && n <= 100) {\n            for (int j = 0; j < p.length; j++) {\n                        f += p[j];\n                    }\n        }\n        f = f / n;\n        System.out.println(f);\n    }\n}'),(2715,'import java.util.Arrays;\nimport java.util.Scanner;\nimport java.lang.String;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        String a = sc.nextLine();\n        char[] cha = a.toCharArray();\n        int k = cha.length;\n        int[] rang = new int[k];\n        String g = sc.nextLine();\n        char[] sha = g.toCharArray();\n        int y =