 mod = n%i;\n                while (mod == 0) {\n                    //判断当前map中是否存在质数i\n                    int count = 0;\n                    if (primeMap.containsKey(i)) {\n                        primeMap.put(i, primeMap.get(i) +1);\n\n                    }else{\n                        primeMap.put(i, 1);\n                    }\n                    n = n/i;\n                    mod = n%i;\n                    count++;\n                    System.out.print(i + \"(\" + count + \")\");\n                    if (mod != 0) {\n                        System.out.print(n + \"(\" + count + \")\");\n                        break;\n                    }\n\n\n                }\n\n            }\n\n        }\n\n\n    }\n\n    public static int isPrime(int a) {\n            for (int i = 2; i <= Math.sqrt(a); i++) {\n                if (a % i == 0) {\n                    return i;\n                }\n            }\n\n        return -1;\n    }\n}\n'),(2740,'import java.math.BigInteger;\nimport java.util.*;\npublic class Main {\n    public static void main(String args[]){\n        int num;\n        BigInteger result;\n        Scanner scan = new Scanner(System.in);\n        num = scan.nextInt();\n        if(num == 0){\n            result = BigInteger.ZERO;\n        }\n        else {\n              if(num == 1){\n                 result = BigInteger.ONE;\n              }\n              else{\n                   result = BigInteger.valueOf(2).pow(num).subtract(BigInteger.ONE);\n              }\n        }\n        System.out.print(result);\n    }\n}\n'),(2741,'public class df {\n    public static void main(String[]args){\n        int nextValue;\n        int sum =0;\n        Scanner r=new Scanner(System.in);\n        r.useDelimiter(\"\\n\");\n        while(r.hasNextInt()){\n            nextValue= r.nextInt();\n            sum= sum+ nextValue ;\n        }\n        System.out.println(sum);\n        r.close();\n\n\n    }\n}\n'),(2742,'import java.lang.reflect.Array;\nimport java.util.Arr