;\n               }\n            }\n        }\n        StringBuilder sb = new StringBuilder();\n        //HashMap的遍历\n        Iterator it = primeMap.entrySet().iterator();\n        while(it.hasNext()){\n            Map.Entry entry = (Map.Entry) it.next();\n            int  key = (Integer) entry.getKey();\n            int val = (Integer) entry.getValue();\n            String string = key+\"(\"+val+\")\";\n            sb.append(string);\n        }\n    return sb.toString();\n    }\n    /**\n     * 判断输入值是否为素数\n     * @param N\n     * @return\n     */\n\n   public static  int isPrime(int N){\n       for(int i=2;i<=Math.sqrt(N);i++){\n           int res = N%i;\n           if(res==0)\n               return 1;\n       }\n       return -1;\n   }\n\n}\n'),(2747,'package Arithmetic;\n\nimport java.util.Scanner;\n\n/**\n * Created by lenovo on 2016/7/28.\n */\npublic class Main{\n    public static void main(String args[]){\n        int i;\n        int s = 0;\n        Scanner input = new Scanner(System.in);\n        int n = input.nextInt();\n        int m = input.nextInt();\n        for(i = 2;i <= n; i++){\n            s = (s + m)%i;\n        }\n        System.out.print(s + 1);\n    }\n}\n'),(2748,'import java.util.Arrays;\nimport java.util.HashMap;\nimport java.util.Map;\nimport java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner input = new Scanner(System.in);\n        int inputValue = input.nextInt();\n        primeRefactorying(inputValue);\n    }\n    private static String primeRefactorying(int N){\n        HashMap<Integer,Integer> primeMap=new HashMap<>();\n        int inputValue=N;\n        int sqrt=(int)Math.sqrt(N);\n        for (int i = 2; i <=sqrt ; i++) {\n            if(N<=1)\n                break;\n            if (isPrime(i) == -1) {\n                int mod = N % i;\n                while ( mod== 0) {\n                    if (primeMap.containsKey(i)) {\n                        primeMap.put(i, primeMap.get(i) + 1);\n                    } else  {\n                        primeMap.put(i, 1);\n                    }\n                    N = N / i;\n                    mod=N%i;\n                    //if(isPrime(N)==-1)\n                       // primeMap.put(N,1);\n                    if(mod!=0){\n                        break;\n                    }\n                }\n            }\n        }\n        System.out.print(inputValue+\"=\");\n        if(isPrime(inputValue)==-1)\n           System.out.print(inputValue+\"(1)\");\n\n        Object[] key_arr = primeMap.keySet().toArray();\n        Arrays.sort(key_arr);\n        for  (Object key : key_arr) {\n            primeMap.get(key);\n        }\n\n        for(Map.Entry<Integer, Integer> me: primeMap.entrySet()) {\n            System.out.print(me.getKey()+\"(\"+me.getValue()+\")\");\n\n        }\n        return null;\n    }\n    private static int isPrime(int N){\n        for(int i = 2; i<= Math.sqrt(N); i++){\n            int res=N%i;\n            if(res==0)\n                return i;\n        }\n        return -1;\n    }\n}\n'),(2749,'import java.util.Scanner;\n\npublic class Main {\n    public static void main(String[] args){\n        Scanner sc=new Scanner(System.in);\n        String s1=sc.nextLine();\n        String[] f=s1.split(\"\");\n        int[] a=new int[s1.length()];\n        String s2=sc.nextLine();\n        //  String s2=\"12345\";\n        try {\n            String sum = \"\";\n            int length = s1.length();\n            for (int i = 0; i < s1.length(); i++) {\n                a[i] = Integer.valueOf(f[i + 1]);\n            }\n\n            for (int i = 0; i < length - 1; i++) {\n                int l = 0;\n                for (int n = i + 1; n < length; n++) {\n                    if (a[i] > a[n]) {\n                        l = a[i];\n                        a[i] = a[n];\n                        a[n] = l;\n                        //             System.out.println(\"OK\");\n                    }\n               