               primateMap.put(i,primateMap.get(i)+1);\n                    }else {\n                        primateMap.put(i,1);\n                    }\n                    N=N/i;\n                    mod = N%i;\n                    if (mod != 0){\n                        break;\n                    }\n                }\n\n            }\n        }\n\n\n        for (HashMap.Entry<Integer,Integer> entry:primateMap.entrySet()\n                ) {\n\n            System.out.print(entry.getKey());\n            System.out.print(\"(\" +entry.getValue()+\")\");\n\n        }\n        // System.out.print(primateMap.entrySet());\n\n        return  null;\n    }\n\n    /**\n     * 方法isPrime，判定传入的参数N 是否为素数\n     * @return\n     */\n    private static int isPrime(int N){\n        int sqrt = (int)Math.sqrt(N);\n        for (int i = 2; i <= sqrt; i++) {\n            int res = N%i;\n            if (res ==0)\n                return 1;\n        }\n        return -1;\n    }\n\n\n}\n\n'),(2783,'import java.util.Scanner;\nimport java.text.DecimalFormat;\n\n\n/**\n * Created by huangzhiwei on 16/7/28.\n */\npublic class Main {\n    public static void main(String argus[]){\n        DecimalFormat df = new DecimalFormat(\"##.0000\");\n        Scanner scan =new Scanner(System.in);\n        int n = scan.nextInt();\n        int array[] = new int[100];\n        for (int i =0;i<100;i++){\n            array[i] = -1;\n        }\n        double capacity = 0;\n        for (int i =0;i<n;i++){\n            capacity = capacity+scan.nextDouble();\n        }\n        double p = capacity/(n);\n        String str =  df.format(p);\n        System.out.print(str);\n\n    }\n\n}'),(2784,'import java.util.Scanner;\nimport java.text.DecimalFormat;\n\n\n/**\n * Created by huangzhiwei on 16/7/28.\n */\npublic class Main {\n    public static void main(String argus[]){\n        DecimalFormat df = new DecimalFormat(\"##.0000\");\n        Scanner scan =new Scanner(System.in);\n        int n = scan.nextInt();\n        int