ner;\nimport java.util.Stack;\n\npublic class Main{\n\n	public static boolean isInteger(String value) {\n		try {\n			Integer.parseInt(value);\n			return true;\n\n		} catch (NumberFormatException e) {\n			return false;\n		}\n	}\n\n	public static void main(String[] args) {\n\n		Stack<Integer> stack = new Stack<Integer>();\n\n		ArrayList<Integer> listInt = new ArrayList<Integer>();\n\n		Scanner reader = new Scanner(System.in);\n\n		String s = reader.next();\n\n		boolean b = true;\n\n		String[] dist = new String[] { s };\n\n		for (String li : dist) {\n\n			String[] nums = li.split(\"\\\\D+\");\n			for (String num : nums) {\n		\n				listInt.add(Integer.parseInt(num));\n\n			}\n\n		}\n\n\n		int j = 0;\n		for (int i = 0; i < s.length(); i++) {\n			if (!isInteger(String.valueOf(s.charAt(i)))) {\n\n				String c = String.valueOf(s.charAt(i));\n				if (c.equals(\"*\")) {\n					int m = stack.pop();;\n					int n = listInt.get(j++);\n					stack.push(m*n);\n					\n					\n					\n					b=false;\n					\n				}else\n					b=true;\n			} else {\n				\n				if (b) {\n					int n = listInt.get(j++);\n					stack.push(n);\n					b=false;\n				}\n			}\n\n		}\n		\n		int sum=0;\n		while(!stack.empty()){\n			sum += stack.pop();\n		}\n		\n		System.out.println(sum);\n\n	}\n}'),(2802,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        String player = \"\";\n        int [] results = new int[]{133,211,322,313,121,232,331,112,223};\n        int len = results.length;\n        int i=0,j=0;\n        while(i<3){\n            String str = scanner.nextLine();\n            switch (str){\n                case \"rock\":\n                    player += \"1\";\n                    break;\n                case  \"paper\":\n                    player += \"2\";\n                    break;\n                case \"scissors\":\n                    player +=\"3\";\n                    break;\n            }\n            i++;\n 