List.add((int) mod);\n            number = number/10;\n            if (number==0)\n                break;\n        }\n        int x ;\n        for (int i = 0; i < inList.size() ; i++) {\n            for (int j = i; j < inList.size()-1; j++) {\n                if (inList.get(i) > inList.get(j + 1)) {\n                    x = inList.get(i);\n                    inList.set(i, inList.get(j + 1));\n                    inList.set(j + 1, x);\n                }\n            }\n        }\n        int y = 0;\n        int z = 1;\n        while (( z<inList.size())&&(inList.get(0)==0)) {\n            if (inList.get(z)!=0)\n                y=inList.get(0);\n            inList.set(0,inList.get(z));\n            inList.set(z,y);\n            z+=1;\n        }\n        long result = 0;\n        int firstNoZeroDigit = 0;\n        for (int i = 0; i < inList.size(); i++) {\n            firstNoZeroDigit = inList.get(i);\n            /*if (i==0&&firstNoZeroDigit==0){\n                continue;\n            }*/\n\n            result = 10*result + firstNoZeroDigit;\n        } //把数组中的单个数字组成一个整数\n        return result;\n    }\n}\n'),(2807,'import java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/27.\n */\npublic class Main{\n    public static void main(String[] args){\n\n        Scanner scnaner = new Scanner(System.in);\n\n        int number = scnaner.nextInt();\n        String str1 = scnaner.nextLine();\n        String str2 = scnaner.nextLine();\n\n        int m = Integer.parseInt(str2);\n        int n = integeReverse(number);\n\n        if(m==n){\n            System.out.println(\"OK\");\n        }else{\n            System.out.println(\"WRONG_ANSWER\");\n        }\n        scnaner.close();\n    }\n    public static  int integeReverse(int number) {\n        ArrayList<Integer> intList = new ArrayList<Integer>();\n\n        while (true) {\n\n            int mod = number % 10;\n            intList.add(mod);\n\n            number /= 10;\n            if (number == 0)\n                break;\n        }\n        Collections.sort(intList);\n        int result = 0;\n        int num = 1;\n        boolean isFirst = true;\n        int firstNoZeroDigit = 0;\n\n        for (int i = 0; i < intList.size(); i++) {\n            firstNoZeroDigit = intList.get(i);\n            if (firstNoZeroDigit != 0) {\n                if (num>1&isFirst==true) {\n                    firstNoZeroDigit = firstNoZeroDigit * num;\n                }\n                isFirst = false;\n            }\n            if (isFirst) {\n                num = num *10;\n                continue;\n            }\n            result = result * 10 + firstNoZeroDigit;\n        }\n       return result;\n    }\n\n}\n\n'),(2808,'import java.util.Scanner;\n\npublic class Main {\n\n    public static void main(String[] args) {\n	// write your code here\n        Scanner s= new Scanner(System.in);\n        int num1= s.nextInt();\n        double avg =0;\n        float sum=0;\n\n        double[] num2 = new double[100];\n        for (int i=0;i<num1;i++){\n             num2[i]=s.nextDouble();\n             sum+=num2[i];\n        }\n            avg=sum/num1;\n            System.out.println(avg);\n\n    }\n}'),(2809,'import java.util.Scanner;\nimport java.awt.*;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n        int num = scanner.nextInt();\n        int kill = scanner.nextInt();\n        int[] a = new int[num];\n        int m = 0;\n        for (int h = 0; h < num; h++) {\n            a[h] = h+1;\n        }\n        int count;\n        for (int j = 1; j <= num; j++) {\n            count = 1;\n            while (count != kill) {\n                count++;\n                m = getNext(a, m);\n            }\n            a[m] = 0;\n            m = getNext(a, m);\n        }\n        for(int j=0;j<a.length ;j++){\n            if(a[j]!=0){\n                System.out .println(a[j]) ;\n                break;\n            }\n        }\n    }\n\n    public static int getNext(int[] a, int m) {\n        for (int i = 1; i < a.length; i++) {\n            if (m + i < a.length) {\n                if (a[m + i] == 0) {\n                    continue;\n                } else {\n                    m = m + i;\n                    return m;\n                }\n\n            }\n            else{\n                if(a[m+i-a.length ]==0){\n                    continue;\n                }\n                else{\n                    m=m+i-a.length ;\n                    return m;\n                }\n            }\n        }\n        return 0;\n    }\n}\n'),(2810,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\n/**\n * Created by sdlds on 2016/7/28.\n */\npublic class Main {\n    public static void main(String[] args) {\n        Scanner reader = new Scanner(System.in);\n        while ((reader.hasNextBigDecimal())) {\n            BigDecimal t = reader.nextBigDecimal();\n            int n = reader.nextInt();\n            t = new BigDecimal(t.stripTrailingZeros().toPlainString());\n            //System.out.println(t);\n            BigDecimal temp = t.pow(n);\n            if(temp.compareTo(new BigDecimal(1)) == -1){\n//                char[] ans = String.valueOf(temp).toCharArray();\n//                for(int i=0;i<ans.length;i++){\n//                    System.out.print(ans[i]);\n//                }\n//                System.out.println();\n                System.out.println(temp.stripTrailingZeros().toPlainString().replace(\"0.\",\".\"));\n            }\n            else{\n                System.out.println(temp.stripTrailingZeros().toPlainString());\n            }\n        }\n    }\n}\n'),(2811,'import java.util.*;\npublic class Main {\n    private static List<Integer> factorList= new ArrayList<>();\n    private static List<Integer> list =new ArrayList<>();\n    public static void main(String args[]){\n        Scanner sc=new Scanner(System.in);\n        String s=sc.nextLine();\n        int num=Integer.parseInt(s);\n        long a=System.currentTimeMillis();\n        decomposition(num);\n        Map<Integer,Integer> map=new TreeMap<>();\n        for(Integer i:factorList){\n            if(map.containsKey(i)){\n                map.put(i,map.get(i)+1);\n            }else{\n                map.put(i,1);\n            }\n        }\n        for(Integer key:map.keySet()){\n            System.out.print(key);\n            System.out.print(\"(\"+map.get(key)+\")\");\n        }\n    }\n    private static void decomposition(int num){\n        while(num%2==0){\n            factorList.add(2);\n            num=num/2;\n        }\n        for(int i=3;i<=num;){\n            if(num%i==0){\n                factorList.add(i);\n                num=num/i;\n            }else{\n                i+=2;\n            }\n        }\n    }\n\n}'),(2812,'mport java.util.Scanner;\n\n\npublic class Main{\n    public static void main(String[] args){\n        Scanner scanner=new Scanner(System.in);\n        int a=scanner.nextInt();\n        System.out.println( factorial(a));\n\n    }\n    public static  long factorial(int number) {\n      long result =1;\n        for (long i=number;i>0;i--){\n            result*=i;\n            result=result%10;\n\n\n\n        }\n        while(result%10==0){\n            long s=result/10;\n            result =s;\n        }\n        result=result%10;\n        return result;\n\n\n    }\n}\n'),(2813,'import java.math.BigDecimal;\n\n\npublic class Main{\n    public static void main (String [] args)\n    {\n    java.util.Scanner sc = new java.util.Scanner(System.in);\n        String shuru = sc.nextLine();\n        String[] q = shuru.split(\" \");\n        int yi = Integer.valueOf(q[0]);\n       int er = Integer.valueOf(q[1]);\n       int zhenghu = 0;\n        for (int i = 0; i <10000 ; i++) {\n            zhenghu += yi * (int) Math.pow(10.0, i);\n            BigDecimal d = BigDecimal.valueOf(zhenghu);\n            if(d.intValue