.util.ArrayList;\npublic class Main {\n    public static void main (String[] args){\n    Scanner s =  new Scanner(System.in);\n       int n = s.nextInt();\n       int f = s.nextInt();\n       String o = String.valueOf(integeReverse(n));\n       String p = String.valueOf(f);\n        if (p.equals(o)){\n           System.out.println(\"OK\");\n       }\n        else{\n            System.out.println(\"WRONG_ANSWER\");\n       }\n\n            }\n    public static int integeReverse(int number){\n        ArrayList<Integer> intList = new ArrayList<Integer>();\n        while (true){\n            int mod = number%10;\n            intList.add(mod);\n            number = number/10; //number /= 10;\n            if(number==0)\n                break;\n        }\n            for(int i = 0;i<intList.size()-1;i++){\n                for(int j = 1;j<intList.size()-i;j++){\n                     Integer  a;\n                    if(intList.get(j-1).compareTo(intList.get(j))>0){\n                        a=intList.get(j-1);\n                        intList.set((j-1),intList.get(j));\n                        intList.set(j,a);\n                    }\n                }\n            }\n            int result = 0;\n            int firsNoZeroDigit = 0;\n        if (intList.get(0)!=0){\n            for(int w=0;w<=intList.size()-1;w++){\n\n            result = 10*result + intList.get(w);\n             }\n\n        }\n        else {\n            int q=0;\n            for(;intList.get(q)==0;q++){\n            }\n             intList.set(0,intList.get(q));\n            intList.set(q,0);\n\n            for(int w=0;w<=intList.size()-1;w++){\n\n            result = 10*result + intList.get(w);\n        }\n        }\n        return result;\n        }\n        }'),(2857,'import java.util.Scanner;\n\npublic class Main {\n    public static void main(String[]args){\n        Scanner scan =new Scanner(System.in);\n        String s = scan.nextLine();\n        String t = scan.nextLine();\n        StringBuffer str = new StringBuffer(s);\n        str.reverse();\n        if(str.equals(t)){\n            System.out.println(\"NO\");\n        }else{\n            System.out.println(\"YES\");\n        }\n\n\n    }\n}\n'),(2858,'import java.util.Arrays;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner s= new Scanner(System.in);\n    int a=s.nextInt();\n    String str1=s.nextLine();\n    String str2=s.nextLine();\n   char c[]= Integer.toString(a).toCharArray();\n   if(a!=0){\n   Arrays.sort(c);\n   int count=0;\n   for(int i=0;i<c.length;i++){\n	   if(c[i]==\'0\'){\n		   count ++;\n	   }else {break ;} \n	   }\n   char tb= c[0];\n   c[0]=c[count];\n   c[count]=tb;\n   }\n   char b[]=str2.toCharArray();\n   if(Arrays.equals(c, b)){\n	   System.out.println(\"OK\");\n   }else{System.out.println(\"WRONG_ANSWER\");\n   \n   }\n	\n	\n	}\n}\n\n\n'),(2859,'import java.util.*;\npublic class Main {\n    private static List<Integer> factorList= new ArrayList<Integer>();\n    private static List<Integer> list =new ArrayList<Integer>();\n    public static void main(String args[]){\n        Scanner sc=new Scanner(System.in);\n        String s=sc.nextLine();\n        int num=Integer.parseInt(s);\n        long a=System.currentTimeMillis();\n        decomposition(num);\n        Map<Integer,Integer> map=new TreeMap();\n        for(Integer i:factorList){\n            if(map.containsKey(i)){\n                map.put(i,map.get(i)+1);\n                }else{\n                    map.put(i,1);\n            }\n        }\n        for(Integer key:map.keySet()){\n            System.out.print(key);\n            System.out.print(\"(\"+map.get(key)+\")\");\n        }\n    }\n    private static void decomposition(int num){\n        while(num%2==0){\n            factorList.add(2);\n            num=num/2;\n        }\n        for(int i=3;i<=num;){\n            if(num%i==0){\n                factorList.add(i);\n                num=num/i;\n            }else{\n                i+=2;\n            }\n        }\n    }\n\n}'),(2860,'import java.util.Scanner;\n\n\npublic class Main {\n    public static void main(String[] args){\n        Scanner scanner=new Scanner(System.in);\n        int a=scanner.nextInt();\n        System.out.println( factorial(a));\n\n    }\n    public static  long factorial(int number) {\n      long result =1;\n        for (long i=number;i>0;i--){\n            result*=i;\n            result=result%1000;\n            while(result==0){\n               result=result%1000;\n            }\n\n        }\n        while(result%10==0){\n            result=result/10;\n\n    }\n        result=result%10;\n        return result;\n\n\n    }\n}\n'),(2861,'import java.math.BigDecimal;\nimport java.util.ArrayList;\nimport java.util.Scanner;\n/**\n * Created by ZM on 2016/7/28.\n */\npublic class Main {\n    public static void main(String arg[]){\n        Scanner sc=new Scanner(System.in);\n        int i,n;\n        double sum=0;\n        //double output;\n        int [] p =new int[100];\n         n=sc.nextInt();\n        for (i = 1; i <= n; i++) {\n            p[i]=sc.nextInt();\n            sum=sum+p[i];\n        }\n        \n            System.out.println(div(sum, n, 4);//调用div方法\n        }\n    }\n\n    public static BigDecimal div(double v1, double v2, int scale){  //BigDecimal方法调整精度\n        if(scale<0){\n            throw new IllegalArgumentException(\n                    \"The scale must be a positive integer or zero\");\n        }\n        BigDecimal b1 =new BigDecimal(Double.toString(v1));\n        BigDecimal b2 =new BigDecimal(Double.toString(v2));\n        return\n                b1.divide(b2,scale,BigDecimal.ROUND_HALF_UP);\n    }\n\n}\n'),(2862,'package cheer;\nimport java.util.Scanner;\npublic class Main {\n    public static String k = \"\";\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n        String number = scanner.nextLine();\n        String[] c = number.split