   break;\n                }\n            }\n        }\n\n\n        //HashMap的遍历\n        StringBuilder sb  = new StringBuilder();\n        Iterator it = primeMap.entrySet().iterator();\n        while(it.hasNext()){\n            Map.Entry entry = (Map.Entry) it.next();\n            int  key = (Integer) entry.getKey();\n            int val = (Integer) entry.getValue();\n            sb.append(key+\"(\"+val+\")\");\n        }\n        return sb.toString();\n    }\n    /**\n     * 判断输入值是否为素数\n     * @param N\n     * @return\n     */\n\n    public static  int isPrime(int N){\n        for(int i=2;i<=Math.sqrt(N);i++){\n            int res = N%i;\n            if(res==0)\n                return 1;\n        }\n        return -1;\n    }\n\n}\n'),(2896,'import java.math.BigDecimal;\nimport java.util.ArrayList;\nimport java.util.Scanner;\n/**\n * Created by ZM on 2016/7/28.\n */\npublic class Main {\n    public static void main(String arg[]){\n        Scanner sc=new Scanner(System.in);\n        int i,n;\n        double sum=0;\n        double [] p =new double[100];\n         n=sc.nextInt();\n        for (i = 0; i < n; i++) {\n            p[i]=sc.nextInt();\n            sum+=p[i];\n        }\n            System.out.println(div(sum, n, 4));//调用div方法\n\n    }\n\n    public static BigDecimal div(double v1, double v2, int scale){  //BigDecimal方法调整精度\n        if(scale<0){\n            throw new IllegalArgumentException(\n                    \"The scale must be a positive integer or zero\");\n        }\n        BigDecimal b1 =new BigDecimal(Double.toString(v1));\n        BigDecimal b2 =new BigDecimal(Double.toString(v2));\n        return\n                b1.divide(b2,scale,BigDecimal.ROUND_HALF_UP);\n    }\n\n}\n'),(2897,'import java.util.ArrayList;\nimport java.util.List;\nimport java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/28.\n */\npublic class Main {\n    public static void main(String[] arge) {\n        Scanner scanner = new Scanner(System.in);\n        int tot