l.Stack;\n\npublic class Main{\n\n	public static boolean isInteger(String value) {\n		try {\n			Integer.parseInt(value);\n			return true;\n\n		} catch (NumberFormatException e) {\n			return false;\n		}\n	}\n\n	public static void main(String[] args) {\n\n		Stack<BigInteger> stack = new Stack<BigInteger>();\n\n		ArrayList<BigInteger> listInt = new ArrayList<BigInteger>();\n\n		Scanner reader = new Scanner(System.in);\n\n		String s = reader.next();\n\n		boolean b = true;\n\n		String[] dist = new String[] { s };\n\n		for (String li : dist) {\n\n			String[] nums = li.split(\"\\\\D+\");\n			for (String num : nums) {\n		\n				listInt.add(BigInteger.valueOf(Integer.parseInt(num)));\n\n			}\n\n		}\n\n\n		int j = 0;\n		for (int i = 0; i < s.length(); i++) {\n			if (!isInteger(String.valueOf(s.charAt(i)))) {\n\n				String c = String.valueOf(s.charAt(i));\n				if (c.equals(\"*\")) {\n					BigInteger m = stack.pop();;\n					BigInteger n = listInt.get(j++);\n					BigInteger ss= m.multiply(n);\n					stack.push(ss);\n					\n					\n					\n					b=false;\n					\n				}else\n					b=true;\n			} else {\n				\n				if (b) {\n					BigInteger n = listInt.get(j++);\n					stack.push(n);\n					b=false;\n				}\n			}\n\n		}\n		\n		BigInteger sum=new BigInteger(\"0\");\n		BigInteger u=new BigInteger(\"10000\");\n		\n		while(!stack.empty()){\n			BigInteger b1 = stack.pop();\n			\n			sum = sum.add(b1);\n			\n			\n		}\n		\n\n		System.out.println(sum.mod(u) );\n\n	}\n}'),(2999,'#include <stdio.h>\n#include <stdlib.h>\n struct person{\n     int number;\n    struct person *next;\n};\nint main(){\n    int deathnumber = 0;\n    int remberdeath = 0;\n    int n =0;\n    scanf(\"%d\",&n);\n    scanf(\"%d\",&deathnumber);\n    remberdeath = deathnumber;\n    struct person *headperson = nullptr;\n    struct  person *lastperson = nullptr;\n   struct person *pre =nullptr;\n    for (int i =0; i<n; i++) {\n        struct person *p ;\n        p = (struct person*)malloc(sizeof(struct person));\n        p ->number = n