i = 0; i < n; i++) {\n\n            sum = sum * 2;\n\n        }\n\n        return sum;\n    }\n}\n'),(3235,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        int a,b,c;\n        Scanner scan=new Scanner(System.in);\n\n        while (scan.hasNext()){\n            a=scan.nextInt();\n            b=scan.nextInt();\n            c=scan.nextInt();\n            int result=(int)((Math.pow(a%c,b))%c);\n            System.out.println(result);\n        }\n    }\n\n}\n'),(3236,'import java.util.Scanner;\nimport java.util.Stack;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        String expression = scanner.nextLine();\n        String[] nums = expression.split(\"\\\\D\");\n        String[] signs = expression.split(\"\\\\d+\");\n        long result = 0;\n        int numLen = nums.length;\n        int sigLen = signs.length;\n        int i=0,j=0;\n        Stack<String> stack = new Stack();\n        for(i=0,j=i+1; j<sigLen||i<numLen;){\n            if(stack.isEmpty()||stack.peek().matches(\"\\\\D\")){\n                stack.push(nums[i]);\n                i++;\n            }\n            if(j<sigLen){\n                if(signs[j].equals(\"+\")){\n                    stack.push(signs[j]);\n                }else {\n                    int a = Integer.parseInt(stack.pop());\n                    int re = a * Integer.parseInt(nums[i]);\n                    i++;\n                    stack.push(String.valueOf(re));\n                }\n                j++;\n            }\n        }\n        while(!stack.isEmpty()){\n            String num = stack.pop();\n            if(!num.equals(\"+\")){\n                result += Long.parseLong(num);\n            }\n        }\n        System.out.println(result%10000);\n    }\n}\n'),(3237,'import java.util.*;\n\n\n/**\n * Created by mona on 2016/7/28.\n */\npublic class Main {\n\n    public static void main(String[] args){\n        in