;\n            for (int i = zhongShu-1; i >=yiBan ; i--) {\n                if (paiXuC[i]==\'T\'){\n                    if (hPaiS.size()-fuZhu!=0){\n                        if (i>hPaiX.get(hPaiX.size()-1-fuZhu))\n                        {\n                            //paiXuC[hPaiX.get(hPaiX.size()-1-fuZhu)] = \'T\';\n                            tJiaoHuanCiShu++;\n                            fuZhu++;\n                        }else\n                            break;\n\n                    }\n                }\n            }\n            fuZhu =0;\n        if (hJiaoHuanCiShu>tJiaoHuanCiShu)\n            System.out.println(tJiaoHuanCiShu);\n        else\n            System.out.println(hJiaoHuanCiShu);\n    }\n\n    /**\n     * 对数组中数进行统计并计算出H是否适合移动到中间\n     * @param paiXu 进行统计的数组\n     * @param zhongShu 数组中数的个数\n     * @return 适合返回true\n     */\n    private static void isJiZhong(char[] paiXu,int zhongShu){\n        int yiBan = zhongShu/2;\n        for (int i = 0; i <yiBan ; i++) {\n            if (paiXu[i] == \'H\')\n            {\n                hPaiS.add(i);\n            }else {\n                tPaiS.add(i);\n            }\n        }\n        for (int i = zhongShu-1; i >=yiBan ; i--) {\n            if (paiXu[i]==\'H\'){\n                hPaiX.add(i);\n            }else {\n                tPaiX.add(i);\n            }\n        }\n    }\n}'),(3243,'import java.text.Collator;\nimport java.util.*;\n\n/**\n * Created by sdlds on 2016/7/28.\n */\npublic class Main {\n    public static void main(String[] args){\n        Scanner reader = new Scanner(System.in);\n        int n = reader.nextInt();\n        int k = reader.nextInt();\n        List<Integer> list = new ArrayList<>();\n        for(int i=0;i<n;i++){\n            list.add(reader.nextInt());\n        }\n        for(int i=0;i<n-k+1;i++){\n            List<Integer> list_k = new ArrayList<>();\n            for(int j=i;j<i+k;j++){\n                list_k.add(list.get(j));\n            }\n            String flag = first_k(k,list_k);\n            if(flag.equals(\"#\")){\n                System.out.println(\"Nothing\");\n            }\n            else{\n                System.out.println(flag);\n            }\n        }\n    }\n\n    private static String first_k(int k, List<Integer> list_k){\n        HashMap<Integer,Integer> hashMap = new HashMap<>();\n        //System.out.println(k);\n        //System.out.println(list_k.size());\n        for(int i=0;i<k;i++){\n            //System.out.print(list_k.get(i)+ \" \");\n            if(!hashMap.containsKey(list_k.get(i))){\n                hashMap.put(list_k.get(i),1);\n            }\n            else{\n                int n = hashMap.remove(list_k.get(i));\n                hashMap.put(list_k.get(i),++n);\n            }\n        }\n        //System.out.println();\n        return max_one(k,hashMap);\n    }\n\n    private static String max_one(int k , HashMap<Integer,Integer> hashMap){\n        List<Integer> list = new ArrayList<>();\n        Set set = hashMap.entrySet();\n        Iterator iterator = set.iterator();\n        while(iterator.hasNext()){\n            HashMap.Entry entry = (HashMap.Entry)iterator.next();\n            if(entry.getValue().equals(1)){\n                list.add(Integer.parseInt(String.valueOf(entry.getKey())));\n            }\n        }\n        if(list.size() < 1){\n            return \"Nothing\";\n        }\n        else{\n            Collections.sort(list);\n        }\n        return String.valueOf(list.get(list.size()-1));\n    }\n}\n'),(3244,'import java.util.ArrayList;\n\npublic class Main {\n\n    public static void Factorization(int n){\n        int key=1;\n        int num=n;\n        ArrayList<Integer>list=new ArrayList<Integer>();\n        while(num>1){\n            for(int i=2;i<=num;i++){\n                if(num%i==0){\n                    key=i;\n                    list.add(key);\n                    break;\n                }\n            }\n            num=num/key;\n        }\n        int temp=0;\n  