            num = num + i*i;\n                        b = b - i ;\n                    }else\n                    {\n                        num = num +  i*i;\n//                        System.out.print(num);\n                        map.put(n,num);\n                        break;\n                    }\n                }\n                else\n                {\n                    num = num + b * i;\n//                    System.out.print(num);\n                    map.put(n,num);\n                    break;\n                }\n            }\n             num = 0;\n        }\n        for (Map.Entry<Integer, Integer> entry : map.entrySet()){\n            System.out.println(entry.getKey() + \" \" + entry.getValue());\n        }\n\n    }\n}\n'),(3257,'import java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner s = new Scanner(System.in);\n	 int x=	s.nextInt();\n   \n	System.out.println(f(x));}\n  public  static int f(int x){\n	  if(x==1){\n		  return 1;\n	  }else{\n		  return 2*f(x-1)+1;\n		  \n	  }\n	\n	  \n	  \n  }\n}\n'),(3258,'import java.util.Scanner;\nimport java.util.Stack;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        String expression = scanner.nextLine();\n        String[] nums = expression.split(\"\\\\D\");\n        String[] signs = expression.split(\"\\\\d+\");\n        long result = 0;\n        int numLen = nums.length;\n        int sigLen = signs.length;\n        int i=0,j=0;\n        Stack<String> stack = new Stack();\n        for(i=0,j=i+1; j<sigLen||i<numLen;){\n            if(stack.isEmpty()||stack.peek().matches(\"\\\\D\")){\n                stack.push(nums[i]);\n                i++;\n            }\n            if(j<sigLen){\n                if(signs[j].equals(\"+\")){\n                    stack.push(signs[j]);\n                }else {\n                    int a = Long.parseLong(stack.pop());\n                    int re = a * L