 x;\n                    }\n                    for (int i = 0; i < a; i++) {\n                        p = p + x;\n                        x = x - 2;\n                        System.out.println(p);\n                    }\n                } else {\n                    x = 2 * b - 1;\n                    for (int i = 0; i < a; i++) {\n                        x = x + 2;\n                        p = p + x;\n                    }\n                    for (int i = 0; i < b; i++) {\n                        p = p + x;\n                        x = x - 2;\n                        System.out.println(p);\n                    }\n                }\n            } else {\n                if (a == d && b == e && c == f) {\n                    if (a == c) {\n                        x = 2 * b - 1;\n                        for (int i = 0; i < a; i++) {\n                            x = x + 2;\n                            p = p + x;\n                        }\n                        System.out.println(2 * p);\n                    } else {\n                        if (b == c) {\n                            x = 2 * a - 1;\n                            for (int i = 0; i < b; i++) {\n                                x = x + 2;\n                                p = p + x;\n                            }\n                            System.out.println(2 * p);\n                        } else {\n                            if (a == b) {\n                                x = 2 * c - 1;\n                                for (int i = 0; i < a; i++) {\n                                    x = x + 2;\n                                    p = p + x;\n                                }\n                                System.out.println(2 * p);\n                            }\n                        }\n                    }\n                }\n            }\n        }\n    }\n}\n'),(3337,'import java.util.Scanner;\n\npublic class Main{\n    public static void main(String[] args){\n       int num=0;\n        Scanner s=new Scanner(System.in);\n        while(s.hasNext()){\n            //hasNext 判断是否为数字\n            String a=s.next();\n            if(a.equals(\"end\")){\n                //equals 等于  输入end 循环结束\n                break;\n            } else{\n                  num=num+Integer.parseInt(a)   ;      }\n                  // Integer.pareInt 取整数a\n        } System.out.println(num);\n    }\n}'),(3338,'import java.util.Scanner;\n\npublic class Main{\n    static int step=0;\n    public static void main(String[] args){\n       Scanner sc=new Scanner(System.in);\n        int num=sc.nextInt() ;\n        hanioSort(num,\"A\",\"B\",\"C\");\n        System.out.println(step);\n    }\n     public static void hanioSort(int num,String a,String b,String c){\n         if(num==1){\n             move(num,a,c);\n         }\n         else{\n             hanioSort(num-1,a,c,b);\n             move(num,a,c);             \n             hanioSort(num-1,b,a,c);\n         }\n     }\n     public static int move(int num,String a,String b){\n                      step++;\n                      return step;\n     }\n}'),(3339,'import com.sun.glass.ui.SystemClipboard;\nimport com.sun.java_cup.internal.runtime.Scanner;\nimport java.util.ArrayList;\npublic class Main {\n    public static void main(String[] args){\n        java.util.Scanner input=new java.util.Scanner(System.in);\n       int n;\n        int n1;\n        double a;\n        int p;\n        double sum=0;\n        n=input.nextInt();//输入的橘汁数量\n        int[] array=new int[n];\n        for (int i = 0; i <n; i++) {\n            array[i]=input.nextInt();\n            sum=sum+array[i];\n        }\n        n1=n*100;\n        //需要将字符串所有的数提取出来并相加\n        a=sum/n1;\n        System.out.printf(\"%.4f\",a);\n    }\n    }\n\n'),(3340,'/**\n * Created by mojin on 7/28 0028.\n */\npublic class Main {\n    public static boolean isPrime(int n){\n        int q=(int)Math.sqrt(n);\n        for(int i=2;i<=q;++i){\n            if(n%i==0)\n                return false;\n        }\n        return true;\n    }\n    public static void fenjie(int num){\n        int k=0;\n        int[] array=new int[num];\n        int[] array1=new int[num];\n        int[] array2=new int[num];\n        int q=(int)Math.sqrt(num);\n        if(isPrime(num))\n        System.out.print(num+\"(1)\");\n        else\n            for(int i=2;i<=q;i++){\n            if(num%i==0) {\n                array[k++] = i;\n                num /= i;\n                i=1;\n            }\n            }\n            array[k]=num;\n        /*for(int i=0;i<k;i++) {\n            System.out.print(array[i]);\n\n        }\n        System.out.println();*/\n        int m=1,n=0,p=1;\n        for(int i=0;i<k;i++){\n\n            if(array[i]==array[i+1]) {\n                m = m + 1;\n            }\n            else {\n                array1[n++]=m;\n                m=1;\n                array2[0]=array[0];\n                array2[p++]=array[i+1];\n            }\n        }\n        for(int i=0;i<p-1;i++){\n            System.out.print(array2[i]+\"(\"+array1[i]+\")\");\n        }\n    }\n\n    public static void main(String[] args){\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        int num=input.nextInt();\n        fenjie(num);\n    }\n}\n'),(3341,'import java.math.BigDecimal;\nimport java.text.DecimalFormat;\nimport java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.HashMap;\nimport java.util.Map;\nimport java.util.Scanner;\nimport java.util.Map.Entry;\n\n/*\n * \n * 114 - 选择相同对\n */\npublic class  Main{\n\n	public static void main(String[] args) {\n\n		Scanner reader = new Scanner(System.in);\n\n		String s = reader.nextLine();\n\n		ArrayList<String> list = new ArrayList<String>();\n\n		// ArrayList<Integer> list1 = new ArrayList<Integer>();\n\n		Map<String, Integer> m = new HashMap<String, Integer>();\n\n		for (int i = 0; i < s.length(); i++) {\n			list.add(String.valueOf(s.charAt(i)));\n		}\n\n		Collections.sort(list);\n\n		boolean b = true;\n		int i = 0;\n		int j = 1;\n		while (j < list.size()) {\n\n			while (j < list.size()) {\n				int count = 1;\n				if (!list.get(i).equals(list.get(j))) {\n					if (m.containsKey(list.get(i))) {\n						m.put(list.get(j), count);\n					} else {\n						m.put(list.get(i), count);\n					}\n					i = j;\n					j = i + 1;\n					if(j == list.size()-1){\n						m.put(list.get(j), count);\n					}\n				} else {\n					if (!m.containsKey(list.get(i))) {\n						m.put(list.get(i), ++count);\n						j++;\n						break;\n					} else {\n						int c = m.get(list.get(i));\n						c++;\n						m.put(list.get(i), c);\n						j++;\n					}\n\n				}\n			}\n		}\n		\n		int sum2=1;\n		\n		int sum1 = 0;\n		\n		for (Entry<String, Integer> entry : m.entrySet()) {\n\n			//System.out.println(\"Key = \" + entry.getKey() + \", Value = \"\n				//	+ entry.getValue());\n			\n			if(entry.getValue()!=1){\n				sum2=1;\n				for(int r=1; r<=entry.getValue(); r++)\n				{\n					sum2 *= r;\n				}\n				\n				sum1 += sum2;\n				//System.out.println(entry.getValue()+\"   \"+sum2+\"  \"+sum1);\n			}\n		}\n		\n		//System.out.println(\"list.size()= \"+list.size());\n		//System.out.println(\"sum1= \"+sum1);\n		int sum = sum1+list.size();\n		\n		System.out.println(sum);\n\n		\n\n	}\n\n}'),(3342,'import java.util.*;\npublic class Main {\n    public static void main(String args[]) {\n        int num;\n        int temp;\n        int r;\n        int i,j=0;\n        int cin[] = new int[21];\n        int result[] = new int[21];\n        Scanner scan = new Scanner(System.in);\n        num = scan.nextInt();\n        while (num != 0) {\n            cin[j] = num;\n            int part = 1;\n            for (i = 1; i <= 100000; i++) {\n                if (num == i * (i + 1) / 2) {\n                    part = i;\n                    break;\n                }\n                if (num > i * (i + 1) / 2 && num < (i + 1) * ((i + 1) + 1) / 2) {\n                    part = i + 1;\n                    break;\n                }\n      