st.get(j + 1));\n                    inList.set(j + 1, x);\n                }\n            }\n        }\n        int y = 0;\n        int z = 1;\n        while (( z<inList.size())&&(inList.get(0)==0)) {\n            if (inList.get(z)!=0)\n                y=inList.get(0);\n            inList.set(0,inList.get(z));\n            inList.set(z,y);\n            z+=1;\n        }\n        long result = 0;\n        int firstNoZeroDigit = 0;\n        for (int i = 0; i < inList.size(); i++) {\n            firstNoZeroDigit = inList.get(i);\n            /*if (i==0&&firstNoZeroDigit==0){\n                continue;\n            }*/\n\n            result = 10*result + firstNoZeroDigit;\n        } //把数组中的单个数字组成一个整数\n        return result;\n    }\n}'),(3386,'import java.util.ArrayList;\n\npublic class Main {\n    public static void main(String[] args) {\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        int[] days=new int[21];\n        int total=0;\n        int coins;\n        for(int i=0;i<21;i++){\n            days[i] = input.nextInt();\n            if(days[i]==0)\n                break;\n            total++;\n        }\n        //System.out.println(days[0]);\n        for(int i=0;i<total;i++){\n            coins=0;\n            int coin_temp=1;\n            int day_temp=1;\n            int temp=0;\n            for(int j=0;j<days[i];j++){\n                if(days[i]==1){\n                    System.out.println(days[i]+\" \"+1);\n                    break;\n                }\n                else if(days[i]>day_temp){\n                    coins+=coin_temp*coin_temp;\n                    ++coin_temp;\n                    day_temp+=j+2;\n                    continue;\n                }\n                else if(days[i]==day_temp){\n                    coins+=coin_temp*coin_temp;\n                    System.out.println(days[i]+\" \"+coins);\n                    break;\n                }\n                else if(days[i]<day_temp){\n                    temp=day_tem