ic String intersort(int num1) {\n\n        //提取整数中的每一个数存入数组arraylist\n        int count = digit(num1);//获得输入的整数的位数\n        int[] arrayList = new int[count];\n        for (int i = 0; i <= count - 1; i++) {\n            arrayList[i] = num1 % 10;\n            num1 = num1 / 10;\n//            System.out.println(arrayList[i]);\n        }\n\n        //对生成的数组排序\n        Arrays.sort(arrayList);\n\n        //将第一个非0的数移动到第0位\n        int temp;\n        for (int i = 0; i < count - 1; i++)\n            if (arrayList[i] != 0 && arrayList[0] == 0) {\n                temp = arrayList[0];\n                arrayList[0] = arrayList[i];\n                arrayList[i] = temp;\n                continue;\n            }\n\n        //循环输出移动后的数组\n        String result = \"\";\n        for (int i = 0; i <= count - 1; i++) {\n            result += arrayList[i];\n        }\n        return result;\n        //            num3 += arrayList[i] * Math.pow(10 , i);\n//            System.out.println(\"num3\" + num3);//      }\n//        int temp;\n//        //读取arryList中的每一个数并进行排序\n//        for (int i = 0; i <= count - 1; i++) {\n//            for (int j = i + 1; j < count;j++)\n//                if(arrayList[i] < arrayList[j]){\n//                    temp = arrayList[j];\n//                    arrayList[j] = arrayList[i];\n//                    arrayList[i] = temp;\n//                }else if(arrayList[i] == arrayList[j]){\n//                    continue;\n//                }\n//        }\n    }\n    //判断输入的整数为多少位数\n    public static int digit(int num1) {\n        int count = 0;\n        while (Math.abs(num1) % 10 > 0 || num1 / 10 != 0) {\n            count++;\n            num1 = num1 / 10;\n        }\n        return count;\n    }\n}\n'),(3389,'import java.util.Scanner;\npublic class Main{\n    public  static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        int sum=0;\n        while(true){\n            try{\n                sum+=Integer.parseInt(sc.nextLine());\n    