;\n        System.out.print(\"\");\n        for (int i = 0; i < num.length; i++) {\n        num[i] = input.nextInt();\n        sum += num[i];   }\n        avg = sum / (count*100);\n        System.out.println(String.format(\"%.4f\",avg));\n    }\n}\n\n'),(3417,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args){\n        int num;\n        Scanner scanner=new Scanner(System.in);\n        num=scanner.nextInt();\n        System.out.println(f(num));\n    }\n    static long f(int num){\n        if(num==1){\n            return 1;\n        }else{\n            return(2*f(num-1)+1);\n        }\n    }\n}'),(3418,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n    public static void main (String[] args){\n        Scanner sd =new Scanner(System.in );\n        int a=sd.nextInt();\n    }\n    /**\n     * integeReverse反转数字排列顺序\n     *@param number 传入正整数\\\n     *@return 返回翻转结果\n     */\n     public static int integeReverse(int number){\n         ArrayList<Integer> intList = new ArrayList<>();\n         /**\n          * Integei是int型数据类型的类被封装\n          */\n         while (true){\n             int mod = number%10;\n             intList.add(mod);\n             number = number/10;//number/=10;\n             if(number==10)\n                 break;\n         }\n         int result = 0;\n         int firstNoZeroDigit=0;\n         for(int i=intList.size()-1;i>=0;i--){\n             firstNoZeroDigit=intList.get(i);\n             if(firstNoZeroDigit==0){\n                 continue;\n             }\n             if (i==intList.size()-1){\n                 intList.get(i);\n             }\n             result=10*result+intList.get(i);\n         }\n         return result;}\n}'),(3419,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        String[] enter= scanner.nextLine().split(\" \");\n        BigDecimal t = new BigDecimal(enter[0]);\n        int n = Integer.parseInt(enter[1]);\n        BigDecimal result = BigDecimal.ONE;\n        for(int i=1; i<=n; i++){\n            result = result.multiply(t);\n        }\n        String res = result.toString();\n        if(res.contains(\"E\")){\n            String[] rr = res.split(\"E-\");\n            int len = Integer.parseInt(rr[1]);\n            StringBuffer strb = new StringBuffer(rr[0]);\n            strb.deleteCharAt(1);\n            for(int i=0; i<len; i++){\n                strb.insert(0,\'0\');\n\n            }\n            strb.insert(0,\'.\');\n            res = strb.toString();\n        }\n        int len = res.length();\n        if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n            int i;\n            for(i=len-1; i>=0; i--){\n                if(res.charAt(i)!=\'0\'){\n                    break;\n                }\n            }\n            if(res.charAt(i)==\'.\'){\n                res = res.substring(0,i+2);\n            }else{\n                res = res.substring(0,i+1);\n            }\n\n        }\n        System.out.println(res);\n    }\n}'),(3420,'package Arithmetic;\n//将整数各个数字打乱并排序（最小）前导数不能为0\n\n        import java.util.ArrayList;\n        import java.util.Arrays;\n        import java.util.Scanner;\n\npublic class Main{\n    public static void main(String[] args) {\n        Scanner input = new Scanner(System.in);\n        int num1 = input.nextInt();\n        int num2 = input.nextInt();\n//        System.out.print(\"result \" + intersort(num1));\n        //在进行num1和num2对比之前对num2进行String强转\n        if(intersort(num1).equals(String.valueOf(num2))){\n            System.out.println(\"OK\");\n        }else{\n            System.out.println(\"WRONG_ANSWER\");\n        }\n    }\n\n    //排序\n    public static String intersort(int num1) {\n\n        //提取整数中的每一个数存入数组arraylist\n        int count = digit(num1);//获得输入的整数的位数\n        int[] arrayList = new int[count];\n        for (int i = 0; i <= count - 1; i++) {\n            arrayList[i] = num1 % 10;\n            num1 = num1 / 10;\n//            System.out.println(arrayList[i]);\n        }\n\n        //对生成的数组排序\n        Arrays.sort(arrayList);\n\n        //将第一个非0的数移动到第0位\n        int temp;\n        for (int i = 1; i < count ; i++)\n            if (arrayList[i] != 0 && arrayList[0] == 0) {\n                temp = arrayList[0];\n                arrayList[0] = arrayList[i];\n                arrayList[i] = temp;\n                continue;\n            }\n\n        //循环输出移动后的数组\n        String result = \"\";\n        for (int i = 0; i <= count - 1; i++) {\n            result += arrayList[i];\n        }\n        return result;\n        //            num3 += arrayList[i] * Math.pow(10 , i);\n//            System.out.println(\"num3\" + num3);//      }\n//        int temp;\n//        //读取arryList中的每一个数并进行排序\n//        for (int i = 0; i <= count - 1; i++) {\n//            for (int j = i + 1; j < count;j++)\n//                if(arrayList[i] < arrayList[j]){\n//                    temp = arrayList[j];\n//                    arrayList[j] = arrayList[i];\n//                    arrayList[i] = temp;\n//                }else if(arrayList[i] == arrayList[j]){\n//                    continue;\n//                }\n//        }\n    }\n    //判断输入的整数为多少位数\n    public static int digit(int num1) {\n        int count = 0;\n        while (Math.abs(num1) % 10 > 0 || num1 / 10 != 0) {\n            count++;\n            num1 = num1 / 10;\n        }\n        return count;\n    }\n}\n'),(3421,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main{\n   public static void main(String[]args){\n   ArrayList<Integer>list = new ArrayList<>();\n   Scanner ww = new Scanner(System.in);\n   int a=ww.nextInt();\n   for(int i=0;i<a;i++){\n       int b=ww.nextInt();\n       list.add(b);\n}\n   double sun=0;\n   double d;\n   for(int i=0;i<list,size();i++){\n       sun=sun+list.get(i);\n}\n  d=sun/a;\n  System.out.println(String.format(\"%.4f\",d));\n }\n}'),(3422,'import java.text.DecimalFormat;\n\n/**\n * Created by mojin on 7/29 0029.\n */\npublic class Main {\n    public static void main(String[] args){\n        java.util.Scanner input=new java.util.Scanner(System.in);\n        int n=input.nextInt();\n        int[] array=new int [n];\n        for(int i=0;i<n;i++){\n             array[i]=input.nextInt();\n        }\n        int res=0;\n        for(int i=0;i<n;i++){\n            res+=array[i];\n        }\n        double  result=res/4;\n        DecimalFormat dec=new DecimalFormat(\"###.0000\");\n       System.out.println(dec.format(result));\n    }\n}\n'),(3423,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main111 {\n    public static void main(String[]args){\n        ArrayList<Integer>list = new ArrayList<>();\n        Scanner ww =new Scanner(System.in);\n        int a=ww.nextInt();\n        for(int i=0;i<a;i++){\n            int b=ww.nextInt();\n            list.add(b);\n        }\n        double sun=0;\n        double d;\n        for(int i=0;i<list.size();i++){\n            sun=sun+list.get(i);\n        }\n        d=sun/a;\n        System.out.println(String.format(\"%.4f\",d));\n    }\n}'),(3424,'import java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.Scanner;\n\npublic class Main{\n\n	public static void main(String[] args) {\n\n		Scanner reader = new Scanner(System.in);\n\n		ArrayList<Integer> list = new ArrayList<Integer>();\n\n		while (true) {\n			int q = Integer.parseInt(reader.nextLine());\n			if (q != 0) {\n				list.add(q);\n			}else\n			{\n				break;\n			}\n		}\n\n		for (int k = 0; k < list.size(); k++) {\n\n			int n = list.get(k);\n\n			int sum = 0;\n\n			int sum1 = 0;\n\n			for (int i = 1; i <= 10000; i++) {\n				sum += i;\n				if (n <= sum) {\n					int y = sum - n;\n					for (int j = 1; j <= i; j++) {\n						int usu = j;\n						int sub = j;\n						while (sub > 0) {\n							sum1 += usu;\n							sub--;\n						}\n					}\n					if (y == 0)\n					