);\n            }\n            for(int i=1; i<len; i++){\n                strb.insert(0,\'0\');\n\n            }\n            strb.insert(0,\'.\');\n            res = strb.toString();\n        }\n        int len = res.length();\n        if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n            int i;\n            for(i=len-1; i>=0; i--){\n                if(res.charAt(i)!=\'0\'){\n                    break;\n                }\n            }\n            if(res.charAt(i)==\'.\'){\n                res = res.substring(0,i);\n            }else{\n                res = res.substring(0,i+1);\n            }\n\n        }\n        System.out.println(res);\n    }\n}'),(3483,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        String[] enter= scanner.nextLine().split(\" \");\n        BigDecimal t = new BigDecimal(enter[0]);\n        int n = Integer.parseInt(enter[1]);\n        BigDecimal result = BigDecimal.ONE;\n        for(int i=1; i<=n; i++){\n            result = result.multiply(t);\n        }\n        String res = result.toString();\n        if(res.contains(\"E\")){\n            String[] rr = res.split(\"E-\");\n            int len = Integer.parseInt(rr[1]);\n            StringBuffer strb = new StringBuffer(rr[0]);\n            if(strb.length()>1){\n                strb.deleteCharAt(1);\n            }\n            for(int i=0; i<len; i++){\n                strb.insert(0,\'0\');\n\n            }\n            strb.insert(0,\'.\');\n            res = strb.toString();\n        }\n        int len = res.length();\n        if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n            int i;\n            for(i=len-1; i>=0; i--){\n                if(res.charAt(i)!=\'0\'){\n                    break;\n                }\n            }\n            if(res.charAt(i)==\'.\'){\n                res = res.substring(0,i);\n            }else{\n                res = res.substring(0,i+1);\n            }\n\n        }\n        System.out.println(res);\n    }\n}'),(3484,'#include<iostream>\nusing namespace std;\n\nvoid insert(char *pSrc, char *pDst, char *pPst,int pos)  //将一个数组插入另一个数组\n{\n    for(int i = 0; i < pos; i ++)\n    {\n        *(pDst+i) = *(pSrc+i);\n    }\n	for(int j=0;j<strlen(pPst);j++)\n	{\n	   *(pDst+i+j)= *(pPst+j);\n	}\n     for(i = pos; i<strlen(pSrc); i++)\n    {\n        *(pDst+i+j) = *(pSrc+i);\n    }\n    *(pDst+j+i+1) = \'\\0\';\n    return;\n}\n\nvoid Juaged(char ** pSrc, char ** pDst,int IT,int T,int *P)\n{\n	        \n			for(int k=0;k<IT;k++)\n		   {\n				char N[150];\n				char S[150];\n		        memset(N,0,150);\n				memset(S,0,150);\n\n			   char *PpSrc=*(pSrc+k);\n	           \n			   int n1=0,sn1=0;\n			   for(int i=0;i<150;i++)\n			   {\n				   if( *(PpSrc+i)>=\'0\' && *(PpSrc+i)<=\'9\') \n				   { \n					  *(N+n1)=*(PpSrc+i);\n					  n1++;\n				   }      \n				   else\n				   {\n				    *(S+sn1)=*(PpSrc+i);\n					sn1++;\n				   }\n				   \n				   if(*(PpSrc+i)==\'\\0\') break;	\n			   }\n			   *(N+n1)=\'\\0\';\n               *(S+sn1)=\'\\0\';\n\n				char N2[150];\n				char S2[150];\n				memset(N2,0,150);\n				memset(S2,0,150);\n			   int n2=0,sn2=0;\n			   char *PpDst=*(pDst+k);\n\n			   for(int j=0;i<150;j++)\n				{\n				   if(*(PpDst+j)>=\'0\' && *(PpDst+j)<=\'9\')\n				   {\n				       *(N2+n2)=*(PpDst+j);\n					  n2++;\n				   }\n            \n				   else\n				   {\n					    *(S2+sn2)=*(PpDst+j);\n						sn2++;\n				   }\n					if(*(PpDst+j)==\'\\0\') break;	          \n				}\n		       *(N2+n2)=\'\\0\';\n               *(S2+sn2)=\'\\0\';\n\n\n			  if(strcmp(N,N2)==0)\n			  {\n				  if(strcmp(S,S2)==0 && P[T]!=0 && strcmp(pSrc[k],pDst[k])==0)  P[T]=1;\n				  else P[T]=0;\n			  }\n			  else \n			  {\n			   P[T]=-1;\n			   break;\n			  }\n			}\n\n}\n\nint main()\n{\n\n    char wa[]=\"Run #: Wrong Answer\";\n	char pe[]=\"Run #: Presentation Error\";\n	char ac[]=\"Run #: Accepted\";\n    int N,M,Jnum=0;//判断的个数\n    int P[100];\n  while( cin>>N && N!=0)\n  {\n\n       char** Answer;\n       char** Up;\n\n	   Answer=new char*[N];\n	   getchar(); \n	   for(int i=0;i<N;i++)\n	   {\n		 Answer[i]=new char[150];\n		 gets(Answer[i]); \n	   }\n\n	   cin>>M;\n       Up=new char*[N];\n	   getchar(); \n	   for(int j=0;j<M;j++)\n	   {\n		 Up[j]=new char[150];\n		 gets(Up[j]); \n	   }\n\n	   Jnum++;\n    \n        Juaged(Answer,Up,N,Jnum,P);\n	\n\n		for(int d=0;d<N;d++){\n			 delete[] Up[d];\n			 delete[] Answer[d];\n		}\n			delete [] Up;\n			delete [] Answer;\n\n }\n      for(int k=1;k<=Jnum;k++)\n		{\n		   char str[5];\n           sprintf(str,\"%d\",k);\n\n		   char a[150]; \n		   switch(P[k])\n		   {\n		   case 0:insert(pe,a,str,5);break;//PE\n		   case 1:insert(ac,a,str,5);break;//成功\n		   case -1:insert(wa,a,str,5);break; //错误 \n		   }\n		   cout<<a<<endl;\n		}\n\n  return 0;\n}'),(3485,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        String[] enter= scanner.nextLine().split(\" \");\n        BigDecimal t = new BigDecimal(enter[0]);\n        int n = Integer.parseInt(enter[1]);\n        BigDecimal result = BigDecimal.ONE;\n        for(int i=1; i<=n; i++){\n            result = result.multiply(t);\n        }\n        String res = result.toString();\n        if(res.contains(\"E\")){\n            String[] rr = res.split(\"E-\");\n            int len = Integer.parseInt(rr[1]);\n            StringBuffer strb = new StringBuffer(rr[0]);\n            if(strb.length()>1){\n                strb.deleteCharAt(1);\n            }\n            for(int i=1; i<len; i++){\n                strb.insert(0,\'0\');\n\n            }\n            strb.insert(0,\'.\');\n            res = strb.toString();\n        }\n        int len = res.length();\n        if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n            int i;\n            for(i=len-1; i>=0; i--){\n                if(res.charAt(i)!=\'0\'){\n                    break;\n                }\n            }\n            if(res.charAt(i)==\'.\'){\n                res = res.substring(0,i);\n            }else{\n                res = res.substring(0,i+1);\n            }\n\n        }\n        System.out.println(res);\n    }\n}'),(3486,'import java.util.*;\n\npublic class Main {\n    public static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        int a = sc.nextInt();\n        int b = sc.nextInt();\n        int c = sc.nextInt();\n        int d = sc.nextInt();\n        int e = sc.nextInt();\n        int f = sc.nextInt();\n        long x,y;\n        long  p = 0;\n        x=a+b+f;\n        p=x*x;\n        y=p-b*b-d*d-f*f;\n        System.out.println(y) ;\n    }\n}\n'),(3487,'#include<iostream>\n#include <string>\nusing namespace std;\n\nvoid insert(char *pSrc, char *pDst, char *pPst,int pos)  //将一个数组插入另一个数组\n{\n    for(int i = 0; i < pos; i ++)\n    {\n        *(pDst+i) = *(pSrc+i);\n    }\n	for(int j=0;j<strlen(pPst);j++)\n	{\n	   *(pDst+i+j)= *(pPst+j);\n	}\n     for(i = pos; i<strlen(pSrc); i++)\n    {\n        *(pDst+i+j) = *(pSrc+i);\n    }\n    *(pDst+j+i+1) = \'\\0\';\n    return;\n}\n\nvoid Juaged(char ** pSrc, char ** pDst,int IT,int T,int *P)\n{\n	        \n			for(int k=0;k<IT;k++)\n		   {\n				char N[150];\n				char S[150];\n		        memset(N,0,150);\n				memset(S,0,150);\n\n			   char *PpSrc=*(pSrc+k);\n	           \n			   int n1=0,sn1=0;\n			   for(int i=0;i<150;i++)\n			   {\n				   if( *(PpSrc+i)>=\'0\' && *(PpSrc+i)<=\'9\') \n				   { \n					  *(N+n1)=*(PpSrc+i);\n					  n1++;\n				   }      \n				   else\n				   {\n				    *(S+sn1)=*(PpSrc+i);\n					sn1++;\n				   }\n				   \n				   if(*(PpSrc+i)==\'\\0\') break;	\n			   }\n			   *(N+n1)=\'\\0\';\n               *(S+sn1)=\'\\0\';\n\n				char N2[150];\n				char S2[150];\n				memset(N2,0,150);\n				memset(S2,0,150);\n			   int n2=0,sn2=0;\n			   char *PpDst=*(pDst+k);\n\n			   for(int j=0;i<150;j++)\n				{\n				   if(*(PpDst+j)>=\'0\' && *(PpDst+j)<=\'9\')\n				   {\n				       *(N2+n2)=*(PpDst+j);\n					  n2++;\n				   }\n            \n				   else\n				   {\n					    *(S2+sn2)=*(PpDst+j);\n						sn2++;\n				   }\n					if(*(PpDst+j)==\'\\0\') break;	          \n				}\n		       *(N2+n2)=\'\\0\';\n               *(S2+sn2)=\'\\0\';\n\n\n			  if(strcmp(N,N2)==0)\n			  {\n				  if(strcmp(S,S2)==0 && P[T]!=0 && strcmp(pSrc[k],pDst[k])==0)  P[T]=1;\n				  else P[T]=0;\n			  }\n			  else \n			  {\n			   P[T]=-1;\n			   break;\n			  }\n			}\n\n}\n\nint main()\n{\n\n    char wa[]=\"Run #: Wrong Answer\";\n	char pe[]=\"Run #: Presentation Error\";\n	char ac[]=\"Run #: Accepted\";\n    int N,M,Jnum=0;//判断的个数\n    int P[100];\n  while( cin>>N && N!=0)\n  {\n\n       char** Answer;\n       char** Up;\n\n	   Answer=new char*[N];\n	   getchar(); \n	   for(int i=0;i<N;i++)\n	   {\n		 Answer[i]=new char[150];\n		 gets(Answer[i]); \n	   }\n\n	   cin>>M;\n       Up=new char*[N];\n	   getchar(); \n	   for(int j=0;j<M;j++)\n	   {\n		 Up[j]=new char[150];\n		 gets(Up[j]); \n	   }\n\n	   Jnum++;\n    \n        Juaged(Answer,Up,N,Jnum,P);\n	\n\n		for(int d=0;d<N;d++){\n			 delete[] Up[d];\n			 delete[] Answer[d];\n		}\n			delete [] Up;\n			delete [] Answer;\n\n }\n      for(int k=1;k<=Jnum;k++)\n		{\n		   char str[5];\n           sprintf(str,\"%d\",k);\n\n		   char a[150]; \n		   switch(P[k])\n		   {\n		   case 0:insert(pe,a,str,5);break;//PE\n		   case 1:insert(ac,a,str,5);break;//成功\n		   case -1:insert(wa,a,str,5);break; //错误 \n		   }\n		   cout<<a<<endl;\n		}\n\n  return 0;\n}'),(3488,'\nimport java.util.ArrayList;\nimport java.util.Scanner;\npublic class Main {\n    public  static void main(String[] args) {\n        Scanner sc=new Scanner(System.in);\n        long a=0;\n        ArrayList<Long> b=new ArrayList<>();\n\n        int lengh=0;\n        long result=0;\n        while(true){\n            try{\n                lengh++;\n                a=sc.nextLong();\n                b.add(a);\n\n\n\n\n                }\n            catch (Exception e){\n\n                long[] n=new  long[lengh];\n                for (int i=0;i<lengh-1;i++) {\n                    n[i] = b.get(i);\n             //       System.out.println(n[i]);\n                }\n                // divisor\n                // multiple\n                long multiple=n[0];\n                long divisor=n[0];\n                long h1=divisor;\n                long h2=1;\n                for (int i=1;i<lengh-1;i++){\n\n                    h2=n[i];\n                    while (true)\n                    {\n\n                        if (( h2 =  h2 % divisor) == 0)\n                        {      divisor=divisor;\n                            break;\n                        }\n                        if ((divisor = divisor % h2) == 0)\n                        {\n                            divisor= h2;\n                            break;\n                        }\n                    }\n                    h1=n[i];\n                    long h3=multiple;\n                    while (true){\n                        if (( h3 =  h3 % h1) == 0)\n                        {      h1=h1;\n                            break;\n                        }\n                        if ((h1 = h1 % h3) == 0)\n                        {\n                            h1= h3;\n                            break;\n                        }\n\n                    }\n                    multiple=multiple*n[i]/h1;\n                }\n                System.out.println(divisor);\n               //  System.out.println(\"h1 \"+h1);\n               //  System.out.println(\"h2 \"+n[lengh-2]);\n                System.out.println(multiple);\n                return;\n                }\n\n\n            }\n        }\n\n}\n'),(3489,'#include<iostream>\n#include <string.h>\nusing namespace std;\n\nvoid insert(char *pSrc, char *pDst, char *pPst,int pos)  //将一个数组插入另一个数组\n{\n    for(int i = 0; i < pos; i ++)\n    {\n        *(pDst+i) = *(pSrc+i);\n    }\n	for(int j=0;j<strlen(pPst);j++)\n	{\n	   *(pDst+i+j)= *(pPst+j);\n	}\n     for(i = pos; i<strlen(pSrc); i++)\n    {\n        *(pDst+i+j) = *(pSrc+i);\n    }\n    *(pDst+j+i+1) = \'\\0\';\n    return;\n}\n\nvoid Juaged(char ** pSrc, char ** pDst,int IT,int T,int *P)\n{\n	        \n			for(int k=0;k<IT;k++)\n		   {\n				char N[150];\n				char S[150];\n		        memset(N,0,150);\n				memset(S,0,150);\n\n			   char *PpSrc=*(pSrc+k);\n	           \n			   int n1=0,sn1=0;\n			   for(int i=0;i<150;i++)\n			   {\n				   if( *(PpSrc+i)>=\'0\' && *(PpSrc+i)<=\'9\') \n				   { \n					  *(N+n1)=*(PpSrc+i);\n					  n1++;\n				   }      \n				   else\n				   {\n				    *(S+sn1)=*(PpSrc+i);\n					sn1++;\n				   }\n				   \n				   if(*(PpSrc+i)==\'\\0\') break;	\n			   }\n			   *(N+n1)=\'\\0\';\n               *(S+sn1)=\'\\0\';\n\n				char N2[150];\n				char S2[150];\n				memset(N2,0,150);\n				memset(S2,0,150);\n			   int n2=0,sn2=0;\n			   char *PpDst=*(pDst+k);\n\n			   for(int j=0;i<150;j++)\n				{\n				   if(*(PpDst+j)>=\'0\' && *(PpDst+j)<=\'9\')\n				   {\n				       *(N2+n2)=*(PpDst+j);\n					  n2++;\n				   }\n            \n				   else\n				   {\n					    *(S2+sn2)=*(PpDst+j);\n						sn2++;\n				   }\n					if(*(PpDst+j)==\'\\0\') break;	          \n				}\n		       *(N2+n2)=\'\\0\';\n               *(S2+sn2)=\'\\0\';\n\n\n			  if(strcmp(N,N2)==0)\n			  {\n				  if(strcmp(S,S2)==0 && P[T]!=0 && strcmp(pSrc[k],pDst[k])==0)  P[T]=1;\n				  else P[T]=0;\n			  }\n			  else \n			  {\n			   P[T]=-1;\n			   break;\n			  }\n			}\n\n}\n\nint main()\n{\n\n    char wa[]=\"Run #: Wrong Answer\";\n	char pe[]=\"Run #: Presentation Error\";\n	char ac[]=\"Run #: Accepted\";\n    int N,M,Jnum=0;//判断的个数\n    int P[100];\n  while( cin>>N && N!=0)\n  {\n\n       char** Answer;\n       char** Up;\n\n	   Answer=new char*[N];\n	   getchar(); \n	   for(int i=0;i<N;i++)\n	   {\n		 Answer[i]=new char[150];\n		 gets(Answer[i]); \n	   }\n\n	   cin>>M;\n       Up=new char*[N];\n	   getchar(); \n	   for(int j=0;j<M;j++)\n	   {\n		 Up[j]=new char[150];\n		 gets(Up[j]); \n	   }\n\n	   Jnum++;\n    \n        Juaged(Answer,Up,N,Jnum,P);\n	\n\n		for(int d=0;d<N;d++){\n			 delete[] Up[d];\n			 delete[] Answer[d];\n		}\n			delete [] Up;\n			delete [] Answer;\n\n }\n      for(int k=1;k<=Jnum;k++)\n		{\n		   char str[5];\n           sprintf(str,\"%d\",k);\n\n		   char a[150]; \n		   switch(P[k])\n		   {\n		   case 0:insert(pe,a,str,5);break;//PE\n		   case 1:insert(ac,a,str,5);break;//成功\n		   case -1:insert(wa,a,str,5);break; //错误 \n		   }\n		   cout<<a<<endl;\n		}\n\n  return 0;\n}'),(3490,'import java.util.ArrayList;\n\n/**\n * Created by Mr.Tang on 2016/7/29.\n */\npublic class Main {\n    public static void main(String[] args){\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        ArrayList<Integer> tian = new ArrayList<>();\n        while (true){\n            int li = input.nextInt();\n            if (li == 0)\n                break;\n            tian.add(li);\n        }\n        for (int i = 0; i < tian.size(); i++) {\n            int t =0;\n            int tianShu = tian.get(i);\n            while (tianShu>=0)\n            {\n                t++;\n                tianShu -=t;\n            }\n            int jiBi = 0;\n            for (int j = 1; j <t ; j++) {\n                jiBi += j*j;\n            }\n            jiBi +=(tianShu + t)*t;\n            System.out.print(tian.get(i));\n            System.out.print(\" \");\n            System.out.println(jiBi);\n        }\n    }\n}'),(3491,'import java.util.ArrayList;\n\n/**\n * Created by Mr.Tang on 2016/7/29.\n */\npublic class Main {\n    public static void main(String[] args){\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        ArrayList<Integer> tian = new ArrayList<>();\n        while (true){\n            int li = input.nextInt();\n            if (li == 0)\n                break;\n            tian.add(li);\n        }\n        for (int i = 0; i < tian.size(); i++) {\n            int t =0;\n            int tianShu = tian.get(i);\n            while (tianShu>=0)\n            {\n                t++;\n                tianShu -=t;\n            }\n            int jiBi = 0;\n            for (int j = 1; j <t ; j++) {\n                jiBi += j*j;\n            }\n            jiBi +=(tianShu + t)*t;\n            System.out.print(tian.get(i));\n            System.out.print(\" \");\n            System.out.println(jiBi);\n        }\n    }\n}'),(3492,'#include<iostream>\n#include <string.h>\nusing namespace std;\n\nvoid insert(char *pSrc, char *pDst, char *pPst,int pos)  //将一个数组插入另一个数组\n{\n	int i,j;\n    for(i=0;i<pos;i++)\n    {\n      *(pDst+i) = *(pSrc+i);\n    }\n	for(j=0;j<strlen(pPst);j++)\n	{\n	   *(pDst+i+j)= *(pPst+j);\n	}\n     for(i=pos;i<strlen(pSrc);i++)\n    {\n       *(pDst+i+j) = *(pSrc+i);\n    }\n    *(pDst+j+i+1) = \'\\0\';\n    return;\n}\n\nvoid Juaged(char ** pSrc, char ** pDst,int IT,int T,int *P)\n{\n	       \n	        \n			for(int k=0;k<IT;k++)\n		   {\n				char N[150];\n				char S[150];\n		        memset(N,0,150);\n				memset(S,0,150);\n\n			   char *PpSrc=*(pSrc+k);\n	           \n			   int n1=0,sn1=0,i;\n			   for(i=0;i<150;i++)\n			   {\n				   if( *(PpSrc+i)>=\'0\' && *(PpSrc+i)<=\'9\') \n				   { \n					  *(N+n1)=*(PpSrc+i);\n					  n1++;\n				   }      \n				   else\n				   {\n				    *(S+sn1)=*(PpSrc+i);\n					sn1++;\n				   }\n				   \n				   if(*(PpSrc+i)==\'\\0\') break;	\n			   }\n			   *(N+n1)=\'\\0\';\n               *(S+sn1)=\'\\0\';\n\n				char N2[150];\n				char S2[150];\n				memset(N2,0,150);\n				memset(S2,0,150);\n			   int n2=0,sn2=0,j;\n			   char *PpDst=*(pDst+k);\n\n			   for(j=0;i<150;j++)\n				{\n				   if(*(PpDst+j)>=\'0\' && *(PpDst+j)<=\'9\')\n				   {\n				       *(N2+n2)=*(PpDst+j);\n					  n2++;\n				   }\n            \n				   else\n				   {\n					    *(S2+sn2)=*(PpDst+j);\n						sn2++;\n				   }\n					if(*(PpDst+j)==\'\\0\') break;	          \n				}\n		       *(N2+n2)=\'\\0\';\n               *(S2+sn2)=\'\\0\';\n\n\n			  if(strcmp(N,N2)==0)\n			  {\n				  if(strcmp(S,S2)==0 && P[T]!=0 && strcmp(pSrc[k],pDst[k])==0)  P[T]=1;\n				  else P[T]=0;\n			  }\n			  else \n			  {\n			   P[T]=-1;\n			   break;\n			  }\n			}\n\n}\n\nint main()\n{\n\n    char wa[]=\"Run #: Wrong Answer\";\n	char pe[]=\"Run #: Presentation Error\";\n	char ac[]=\"Run #: Accepted\";\n    int N,M,Jnum=0;//判断的个数\n    int P[100];\n  while( cin>>N && N!=0)\n  {\n\n       char** Answer;\n       char** Up;\n\n	   Answer=new char*[N];\n	   getchar(); \n	   for(int i=0;i<N;i++)\n	   {\n		 Answer[i]=new char[150];\n		 gets(Answer[i]); \n	   }\n\n	   cin>>M;\n       Up=new char*[N];\n	   getchar(); \n	   for(int j=0;j<M;j++)\n	   {\n		 Up[j]=new char[150];\n		 gets(Up[j]); \n	   }\n\n	   Jnum++;\n    \n        Juaged(Answer,Up,N,Jnum,P);\n	\n\n		for(int d=0;d<N;d++){\n			 delete[] Up[d];\n			 delete[] Answer[d];\n		}\n			delete [] Up;\n			delete [] Answer;\n\n }\n      for(int k=1;k<=Jnum;k++)\n		{\n		   char str[5];\n           sprintf(str,\"%d\",k);\n\n		   char a[150]; \n		   switch(P[k])\n		   {\n		   case 0:insert(pe,a,str,5);break;//PE\n		   case 1:insert(ac,a,str,5);break;//成功\n		   case -1:insert(wa,a,str,5);break; //错误 \n		   }\n		   cout<<a<<endl;\n		}\n\n  return 0;\n}'),(3493,'import java.util.ArrayList;\n\npublic class Main {\n    public static void main(String[] args) {\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        int n=input.nextInt();\n        int[] str01=new int[n];\n        int[] str02=new int[n];\n        int[] Temp=new int[n];\n        int i,j,k;\n        int total=0;\n        int a=str01.length-1;\n        for(i=0;i<n;i++){\n            str01[i] = input.nextInt();\n        }\n        for(i=0;i<n;i++){\n            str02[i] = input.nextInt();\n        }\n        if(equals(str01,str02)==true){\n            System.out.println(0);\n        }\n        else{\n            for (i=a;i>=0;i--){\n                for(j=str01.length-1;j>=0;j--){\n                    if(str01[i]==str02[j]&&i==j){\n                        Temp[i]=str01[i];\n                        continue;\n                    }\n                    else if(str01[i]==str02[j]&&i!=j){\n                        ++total;\n                        Temp[j]=str01[i];\n                        for(k=j;k<str01.length-1;k++){\n                            Temp[k+1]=str01[k];\n                        }\n                        for(k=j;k<str01.length-1;k++){\n                            str01[k+1]=Temp[k+1];\n                        }\n                        a+=1;\n                    }\n                }\n            }\n            System.out.println(total);\n        }\n    }\n    public static boolean equals(int[] str01,int[] str02) {\n        for (int i=0; i<str01.length;i++)\n            if (str01[i]!=str02[i])\n                return false;\n            return true;\n    }\n}');
INSERT INTO `source_code` VALUES (3494,'\nimport java.util.Scanner;\n\npublic class Main {\n    public static void main(String[] args){\n        Scanner scanner=new Scanner(System.in);\n        int s=0;\n        int n=scanner.nextInt();\n        int arra[]=new int[n];\n         for(int i=0;i<n;i++){\n            arra[i]=scanner.nextInt();\n            s+=arra[i];\n        }\n\n        double f = 0;\n         f=(double) s/n;\n        DecimalFormat mm=new DecimalFormat(\"#.0000\");\n        System.out.println(mm.format(f));}\n    }\n\n'),(3495,'import java.util.Scanner;\npublic class Main {\n    public static void main(String args[]) {\n        Scanner sc = new Scanner(System.in);\n        int N = sc.nextInt();\n        int M = sc.nextInt();\n        int a = N;\n        int result=0;\n        int q= M % 10 %10;\n        if (q == 0 || q == 5) {\n            System.out.print(\"0\");\n        } else {\n            while(true){\n                if (M <= 10000) {\n                    if (N >= 0 && N <= 9) {\n                        if (a % M == 0) {\n                            result = Long.toString(a).length();\n                            System.out.print(result);\n                            break;\n                        }\n                        a = a * 10 + N;\n                    }\n                }\n            }\n        }\n    }\n}\n\n'),(3496,'import java.util.*;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner cin = new Scanner(System.in);\n            int day = cin.nextInt();\n            if(day != 0)\n            System.out.println(day + \" \" + func(day));\n    }\n     static int func(int day)\n    {\n        int sum = 1;\n        int k=2;\n        int m=0;\n        if(day == 1) return 1;\n        for(int i = 2; i <= day; i++)\n        {\n            if(k == m)\n            {\n                m = 0;\n                k ++;\n            }\n            sum += k;\n            m ++;\n        }\n        return sum;\n    }\n}'