rt java.util.Collections;\nimport java.util.HashSet;\nimport java.util.Map;\nimport java.util.Scanner;\nimport java.util.Set;\n\n/*\n *\n * 1006 - N的个数\n */\npublic class Main{\n\n	public static void main(String[] args) {\n\n		Scanner reader = new Scanner(System.in);\n\n		Set<BigInteger> set = new HashSet<BigInteger>();\n\n		int n = reader.nextInt();\n		int m = reader.nextInt();\n\n		BigInteger nn = new BigInteger(String.valueOf(n));\n		BigInteger mm = new BigInteger(String.valueOf(m));\n		\n		BigInteger yushu = new BigInteger(\"0\");\n		BigInteger chushi = new BigInteger(String.valueOf(n));\n		BigInteger shi = new BigInteger(\"10\");\n		BigInteger zero = new BigInteger(\"0\");\n		\n		\n		int i = 1;\n\n		while (true) {\n			\n			if(i==1){\n				if(n%m==0){\n					System.out.println(1);\n					return;\n				}\n			}\n\n			BigInteger k = nn.multiply(shi).add(chushi);\n			nn=k;\n			yushu = k.mod(mm);\n			if (yushu.equals(zero)) {\n				System.out.println(i + 1);\n				return;\n			} else {\n				if (!set.contains(yushu)) {\n					set.add(yushu);\n					i++;\n				}else{\n					System.out.println(0);\n					return;\n				}\n				\n			}\n		}\n	\n\n	}\n}'),(3513,'\nimport java.util.Scanner;\n\npublic class Main{\n    public static void main(String args[]) {\n        int n;\n        Scanner input = new Scanner(System.in);\n        String scanner = input.nextLine();\n        char[] arrayList = scanner.toCharArray();\n//        System.out.println(arrayList);\n        //计算最终结果是字符串长度+重复字符串的排列数\n        int result = (int)arrayList.length + arrgne(sameChar(arrayList));\n        System.out.println(result);\n    }\n\n\n    //找出输入字符串中相同的字符\n    public static int sameChar(char[] arrayList) {\n        int count = 0;\n        for (int i = 0; i < arrayList.length - 1; i++) {\n            for (int j = i + 1; j < arrayList.length; j++) {\n                if (arrayList[i] == arrayList[j]) {\n                    count++;\n                }\n            }\n        }\n        return count;\n    }\n\n    // 计算字符串中相同字符的排列数num = A（2，n）\n    public static int arrgne(int n) {\n        int n2 = n;\n        int num = 1;\n        for (; n >= n2 - 1; n--) {\n            num = num * n;\n        }\n        return num;\n    }\n}\n'),(3514,'import java.util.Scanner;\npublic class Main {\n    public static void main(String args[]) {\n        Scanner sc = new Scanner(System.in);\n        int N = sc.nextInt();\n        int M = sc.nextInt();\n        int a = N;\n        int result=0;\n        int q= M % 10 %10;\n        if (q == 0 || q == 5) {\n            System.out.print(\"0\");\n        } else {\n            while(true){\n                if (M> 10000) {\n                    break;}else{\n                        if (a % M == 0) {\n                            result = Long.toString(a).length();\n                            System.out.print(result);\n                            break;\n                        }\n                        a = a * 10 + N;\n                }\n            }\n        }\n    }\n}\n\n'),(3515,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        while(true){\n            String[] enter= scanner.nextLine().split(\" \");\n            BigDecimal t = new BigDecimal(enter[0]);\n            int n = Integer.parseInt(enter[1]);\n            BigDecimal result = BigDecimal.ONE;\n            for(int i=1; i<=n; i++){\n                result = result.multiply(t);\n            }\n            String res = result.toString();\n            if(res.contains(\"E\")){\n                String[] rr = res.split(\"E-\");\n                int len = Integer.parseInt(rr[1]);\n                StringBuffer strb = new StringBuffer(rr[0]);\n                if(strb.length()>1){\n                    strb.deleteCharAt(1);\n                }\n                for(int i=1; i<len; i++){\n                    strb.insert(0,\'0\');\n\n                }\n                strb.insert(0,\'.\');\n                res = strb.toString();\n            }\n            int len = res.length();\n            if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n                int i;\n                for(i=len-1; i>=0; i--){\n                    if(res.charAt(i)!=\'0\'){\n                        break;\n                    }\n                }\n                if(res.charAt(i)==\'.\'){\n                    res = res.substring(0,i);\n                }else{\n                    res = res.substring(0,i+1);\n                }\n\n            }\n            System.out.println(res);\n        }\n    }\n}'),(3516,'import java.util.Scanner;\npublic class Main {\n    public static void main(String [] args){\n        Scanner in = new Scanner(System.in);\n        String  S = in.next();\n        char[] s = S.toCharArray();\n        int count = 0;\n        for (int i = 0; i < s.length; i++){\n            for (int j = 0; j < s.length; j++){\n                if (s[i] == s[j])\n                    count++;\n            }\n        }\n        System.out.println(count);\n\n    }\n}\n'),(3517,'public class Main{\n    public static void main(String[] args) {\n        java.util.Scanner sc  = new java.util.Scanner(System.in);\n        String w = sc.nextLine();\n        String[] qwer = w.split(\" \");\n        int diyi = Integer.valueOf(qwer[0]);\n        int dier = Integer.valueOf(qwer[1]);\n        System.out.println(Kill(diyi,dier));\n    }\n    public static  int Kill(int total, int interval) {\n        boolean[] arr = new boolean[total];\n        for(int i = 0; i < arr.length; i++) {\n            arr[i] = true;\n        }\n        int left = arr.length;\n        int count = 0;\n        int index = 0;\n        while (left > 1) {\n            if(arr[index] == true) {\n                count++;\n                if(count == interval) {\n                    count = 0;\n                    arr[index] = false;\n                    left--;\n                }\n            }\n            index++;\n            if(index == arr.length) {\n                index = 0;\n            }\n\n        }\n        for(int i = 0;i < arr.length; i++) {\n            if(arr[i] == true) {\n                return i+1;\n            }\n        }\n        return -1;\n    }\n}'),(3518,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        while(scanner.hasNextLine()){\n            String[] enter= scanner.nextLine().split(\" \");\n            BigDecimal t = new BigDecimal(enter[0]);\n            int n = Integer.parseInt(enter[1]);\n            BigDecimal result = BigDecimal.ONE;\n            for(int i=1; i<=n; i++){\n                result = result.multiply(t);\n            }\n            String res = result.toString();\n            if(res.contains(\"E\")){\n                String[] rr = res.split(\"E-\");\n                int len = Integer.parseInt(rr[1]);\n                StringBuffer strb = new StringBuffer(rr[0]);\n                if(strb.length()>1){\n                    strb.deleteCharAt(1);\n                }\n                for(int i=1; i<len; i++){\n                    strb.insert(0,\'0\');\n\n                }\n                strb.insert(0,\'.\');\n                res = strb.toString();\n            }\n            int len = res.length();\n            if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n                int i;\n                for(i=len-1; i>=0; i--){\n                    if(res.charAt(i)!=\'0\'){\n                        break;\n                    }\n                }\n                if(res.charAt(i)==\'.\'){\n                    res = res.substring(0,i);\n                }else{\n                    res = res.substring(0,i+1);\n                }\n\n            }\n            System.out.println(res);\n        }\n    }\n}'),(3519,'import java.util.ArrayList;\nimport java.util.Scanner;\nimport java.util.Stack;\n\npublic class Calculate {\n    public ArrayList<String> getStringList(String str) {\n        ArrayList<String> result = new ArrayList<String>();\n        String num = \"\";\n        for (int i = 0; i < str.length(); i++) {\n            if (Character.isDigit(str.charAt(i))) {\n                num = num + str.charAt(i);\n            } else {\n                if (num != \"\") {\n                    result.add(num);\n                }\n                result.add(str.charAt(i) + \"\");\n                num = \"\";\n            }\n        }\n        if (num != \"\") {\n            result.add(num);\n        }\n        return result;\n    }\n\n    public ArrayList<String> getPostOrder(ArrayList<String> inOrderList) {\n\n        ArrayList<String> result = new ArrayList<String>();\n        Stack<String> stack = new Stack<String>();\n        for (int i = 0; i < inOrderList.size(); i++) {\n            if (Character.isDigit(inOrderList.get(i).charAt(0))) {\n                result.add(inOrderList.get(i));\n            } else {\n                switch (inOrderList.get(i).charAt(0)) {\n                    case \'(\':\n                        stack.push(inOrderList.get(i));\n                        break;\n                    case \')\':\n                        while (!stack.peek().equals(\"(\")) {\n                            result.add(stack.pop());\n                        }\n                        stack.pop();\n                        break;\n                    default:\n                        while (!stack.isEmpty() && compare(stack.peek(), inOrderList.get(i))) {\n                            result.add(stack.pop());\n                        }\n                        stack.push(inOrderList.get(i));\n                        break;\n                }\n            }\n        }\n        while (!stack.isEmpty()) {\n            result.add(stack.pop());\n        }\n        return result;\n    }\n\n    public Integer calculate(ArrayList<String> postOrder) {\n        Stack stack = new Stack();\n