 += mod * (s.t[i] % b);\n      s.t[i] /= b;\n      if (i == s.w && s.t[i] == 0) --s.w;\n  }\n  my = s.t[0] / mod;\n  s.t[0] = 0;\n}\nint Ans = 1;\nint n;\nBignum source;\nvoid test(Bignum source)\n{\n  printf(\"%d\", source.t[source.w]);\n  for (int i = source.w - 1; i >= 1; --i) printf(\"%04d\", source.t[i]);\n  printf(\"----%d\\n\", source.w);\n}\nvoid Init()\n{\n  char t;\n  int k;\n  int w = 0;\n  int num[maxs] = {0};\n\n  memset(source.t, 0, sizeof(source.t));\n  Ans = 1;\n\n  while ((t = getchar()) < \'1\' || t > \'9\');\n  do num[++w] = t - \'0\'; while((t = getchar()) >= \'0\' && t <= \'9\');\n  REP(i, w / 2) swap(num[i], num[w - i + 1]);\n  for (int i = 1; i <= w; i += 4)\n  {\n      k = 0;\n      for (int j = i + 3; j >= i; --j) k = k * 10 + num[j];\n      source.t[i / 4 + 1] = k;\n  }\n  source.w = (w + 3) / 4;\n}\nvoid Work()\n{\n  int my;\n  Bignum c;\n  Bignum s = source;\n  do\n  {\n      divide(s, 5, my);\n      c = c + s;\n      REP(i, my) Ans *= i; Ans %= 5;\n  }while (s.w);\n  if (c.t[1] & 1) Ans *= -1;\n  divide(c, 4, my);\n  REP(i, my) Ans *= 3; Ans = (Ans + 1000) % 5;\n  if (source.w == 1 && source.t[1] == 1) cout << pp[0] << endl;\n  else cout << pp[Ans] << endl;\n}\nint main()\n{\n  int T;\n  freopen(\"a.in\", \"r\", stdin);\n  freopen(\"a.out\", \"w\", stdout);\n  scanf(\"%d\", &T);\n  while (T--)\n  {\n      Init();\n\n      Work();\n  }\n  fclose(stdin);\n  fclose(stdout);\n  return 0;\n}'),(3632,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\npublic class Main {\n\n    public static void main(String[] args) {\n	// write your code here\n        Scanner s = new Scanner(System.in);\n        while(s.hasNext())\n        {\n            BigDecimal a=s.nextBigDecimal();\n            int n=s.nextInt();\n            a=a.pow(n).stripTrailingZeros();//移除所有尾部零\n            String m=a.toPlainString();//输出非科学计数法的数字\n            if(m.charAt(0)==\'0\')\n                m=m.substring(1);\n            System.out.println(m);\n        }\n    }\n}'),(3633,'import java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner s= new Scanner(System.in);\n        String str =s.nextLine();\n        char c[] =str.toCharArray();\n        int count=0;\n        for(int i=0;i<c.length;i++){\n        	 for(int j=0;j<c.length;j++){\n        		 if( c[i]== c[j]){\n        			 count++;\n        		 }\n        	 \n        	 }\n        	\n        }\n        System.out.println(count);\n	}\n\n}\n'),(3634,'import java.util.Scanner;\n\npublic class Main {\n    private static int num = 1;\n    public static void main(String[] args) {\n        Scanner scan = new Scanner(System.in);\n        while (scan.hasNext()){\n            String s = scan.nextLine();\n            String[] strings= s.split(\" \");\n            num = 1;\n            Boolean flags = true;\n            for (int i=1;i<10;i++){\n\n                int temp = Integer.parseInt(strings[0]);\n                int t = Integer.parseInt(strings[1]);\n                if (temp==(t*i)%10){\n                    compute(temp,t);\n                    break;\n                }\n                    if (i==9){\n                        flags = false;\n                        break;\n                    }\n            }\n            if (flags){\n                System.out.println(num);\n            }else {\n                System.out.println(0);\n            }\n\n\n        }\n\n    }\n\n    private static void compute(int temp, int t) {\n\n        String str = temp+\"\";\n\n        int tLength = Integer.toString(t).length();\n        while (str.length()<tLength){\n            if (temp%t==0){\n                num +=1;\n            }\n                str = str +Integer.toString(temp);\n                num +=1;\n\n        }\n        int remainder = Integer.parseInt(str)%t;\n        while (remainder!=0){\n            remainder=(remainder*10+temp)%t;\n            num+=1;\n        }\n\n    }\n}\n\n\n'),(3635,'import java.util.HashSet;\nimport java.util.Scanner;\nimport java.util.Set;\n\npublic class Main {\n    private static int num = 1;\n    public static void main(String[] args) {\n        Scanner scan = new Scanner(System.in);\n        while (scan.hasNext()){\n            String s = scan.nextLine();\n            String[] strings= s.split(\" \");\n            num = 1;\n            Boolean flags = true;\n            for (int i=1;i<10;i++){\n\n                int temp = Integer.parseInt(strings[0]);\n                int t = Integer.parseInt(strings[1]);\n                if (temp==(t*i)%10){\n                    compute(temp,t);\n                    break;\n                }\n                    if (i==9){\n                        flags = false;\n                        break;\n                    }\n            }\n            if (flags){\n                System.out.println(num);\n            }else {\n                System.out.println(0);\n            }\n\n\n        }\n\n    }\n\n    private static void compute(int temp, int t) {\n\n        String str = temp+\"\";\n\n        int tLength = Integer.toString(t).length();\n        while (str.length()<tLength){\n            if (temp%t==0){\n                num +=1;\n            }\n                str = str +Integer.toString(temp);\n                num +=1;\n\n        }\n        int remainder = Integer.parseInt(str)%t;\n        Set set = new HashSet();\n        while (remainder!=0){\n\n            remainder=(remainder*10+temp)%t;\n            num+=1;\n            if (set.contains(remainder)){\n                num = 0;\n                break;\n            }else {\n                set.add(remainder);\n            }\n        }\n\n    }\n}\n\n\n'),(3636,'public class Main {\n    public static void main(String[] args)\n    {\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        int n=input.nextInt();\n        int k=input.nextInt();\n        char[] array=new char[k];\n        for(int i=0;i<array.length;i++) {\n            array[i]=(char)(97+i);\n        }\